(144, 'Wudhu', '{\"blocks\":[{\"key\":\"bclbu\",\"text\":\"Video animasi yang berisikan tata cara wudhu yang baik dan benar, pada video disertai dengan niat dan do\'a. “al Wudhu” dengan dhommah, berarti pekerjaan bersuci dan dengan huruf wawunya (Wadhu), berarti air yang dipergunakan untuk berwudhu. Wudhu menurut bahasa artinya bersih dan indah, sedang menurut syara’ artinya membersihkan anggota wudhu untuk menghilangkan hadats kecil mengutip dari Risalah Tuntunan Shalat Lengkap oleh Moh. Rifa’i.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Wudhu.jpeg', 'https://www.youtube.com/watch?v=IHU7OcoGiuk', '', 'https://api.informatics-expo.id/Wudhu.jpeg', 193, 4, 1, '2021-07-10 00:25:47', '2021-07-10 00:25:47'),
(145, 'ModalMudah', '{\"blocks\":[{\"key\":\"1v0a7\",\"text\":\"Di era sekarang ini,  memiliki sebuah usaha sendiri adalah impian banyak kalangan orang , mulai dari yang muda hingga yang tua,banyak orang berlomba lomba membuat inovasi dalam membuat suatu usaha, mulai dari usaha makanan, fashion, transportasi, sampai usaha kerajinan. Tetapi terkadang tidak sedikit dari usaha yang sudah dibangun terhenti di tengah jalan, dikarenakan modal yang tidak mencukupi, karena itulah Modal mudah hadir untuk anda.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bi8am\",\"text\":\"Aplikasi yang memberikan anda kemudahan untuk mendapatkan modal usaha. Modal mudah hadir dengan fitur yang memberikan kenyamanan bagi penggunanya. Modal mudah membawa misi untuk memajukan ukm yang ada di Indonesia, dengan memudahkan para ukm dalam mendapatkan modal. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"143fi\",\"text\":\"Dengan modal mudah mendapatkan modal dana jadi lebih mudah\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ModalMudah.png', 'https://youtu.be/EbQ7CdQ6QwI', 'https://linktr.ee/ModalMuah', 'https://api.informatics-expo.id/ModalMudah.png', 208, 8, 1, '2021-07-10 01:31:47', '2021-07-10 09:12:58'),
(146, 'Reksator', '{\"blocks\":[{\"key\":\"cjo2t\",\"text\":\"Reksator menghubungkan para pengusaha UKM dari berbagai daerah di Indonesia dengan para Investor. Melihat banyak UKM di indonesia yang terkendala finansial dalam pengembangan bisnisnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"12kes\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7cmov\",\"text\":\"Melihat masalah tersebut, kami Alpha Engineer meluncurkan Reksator dengan tujuan untuk memberikan pembiayaan bagi para pengusaha UKM di Indonesia. Dengan bantuan pembiayaan dari para funder, maka diharapkan ukm di Indonesia dapat mengembangkan usahanya. Selain itu, masyarakat Indonesia dapat ikut serta membantu meningkatkan perekonomian Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Reksator.jpeg', 'https://youtu.be/_xapji73lN0', 'https://www.figma.com/proto/nz1pwI3Y5Btsp8MEsbb67b/Reksator-1.0?page-id=0%3A1&node-id=18%3A449&viewport=113%2C349%2C0.08804518729448318&scaling=min-zoom', 'https://api.informatics-expo.id/Reksator.jpeg', 167, 9, 1, '2021-07-10 05:42:35', '2021-07-10 05:42:35'),
(147, 'Do\'s and Don\'ts Ramadhan Edition', '{\"blocks\":[{\"key\":\"2pf40\",\"text\":\"Animasi yang mengangkat tema Dakwah / Islami, kami mengambil judul yaitu \\\"Do\'s and Don\'ts Ramadhan Edition\\\". Ramadhan adalah bulan kesembilan dalam kalender Islam (Hijriyah) dan dirayakan oleh seluruh umat Muslin di dunia dengan puasa. Sehingga, penting bagi kita untuk mengetahui dan memperhatikan apa saja \\\"Do\'s\\\" (amalan / hal yang boleh dilakukan) dan \\\"Don\'ts\\\" (larangan / hal yang tidak boleh dilakukan) pada saat berpuasa di bulan suci Ramadhan. Animasi ini dibuat menggunakan software Processing 3. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Do\'s and Don\'ts Ramadhan Edition.jpeg', 'https://youtu.be/thY2rbRaE20', '', 'https://api.informatics-expo.id/Do\'s and Don\'ts Ramadhan Edition.jpeg', 142, 3, 1, '2021-07-10 05:51:38', '2021-07-10 05:51:38'),
(148, 'KebudSum', '{\"blocks\":[{\"key\":\"6220m\",\"text\":\"KebudSum adalah website E-learning untuk mempelajari kebudayaan sumatra\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KebudSum.jpeg', 'https://youtu.be/oFLZyNagjpo', '', 'https://api.informatics-expo.id/KebudSum.jpeg', 212, 4, 1, '2021-07-10 08:12:13', '2021-07-10 08:12:13'),
(149, 'M-Society', '{\"blocks\":[{\"key\":\"bqr0d\",\"text\":\"M-Society merupakan sebuah aplikasi  yang membantu pemilik UKM dalam menjual produk-produk milik-nya, dengan aplikasi kami para penjual produk dapat mendaftarkan berbagai produk dan mengotrol toko dengan mudah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'M-Society.png', 'https://youtu.be/I4aFGyuPEak', 'https://docs.google.com/presentation/d/11qCcFkAiHa3lZBWLYcwiTSAAKuMOEoxk8Y9z9K6RT38/edit?usp=sharing', 'https://api.informatics-expo.id/M-Society.png', 218, 9, 1, '2021-07-10 11:44:22', '2021-07-10 11:44:22'),
(150, 'B.I.O.T (Buy In One Tap)', '{\"blocks\":[{\"key\":\"5cudn\",\"text\":\"B.I.O.T sendiri kepanjangan dari buy in one tap, Platform penghubung antara penjual dan pembeli produk UKM adalah platform berbasis aplikasi dan web sebagai penghubung antara penjual dan pembeli produk UKM. Sistem ini berperan sebagai lapak bagi para penjual produk UKM. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":270,\"style\":\"color-rgb(255,255,255)\"},{\"offset\":0,\"length\":270,\"style\":\"bgcolor-rgb(42,57,144)\"},{\"offset\":0,\"length\":270,\"style\":\"fontsize-18pt\"},{\"offset\":0,\"length\":270,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'B.I.O.T (Buy In One Tap).jpeg', 'https://youtu.be/5cvCwZ2jXJk', 'https://docs.google.com/presentation/d/1G0yoWDv5dR1gZsn3ZeXuWPc2WOXlhZ4KtQxMK2icawE/edit?usp=sharing', 'https://api.informatics-expo.id/B.I.O.T (Buy In One Tap).jpeg', 219, 8, 1, '2021-07-10 12:33:10', '2021-07-10 12:56:31'),
(153, 'INVESTMO', '{\"blocks\":[{\"key\":\"4ssuh\",\"text\":\"INVESTMO adalah suatu sistem perangkat lunak untuk sarana investasi bagi investor dan sarana pengajuan modal bagi penjual. Investmo mencakup berbagai jenis usaha kecil menengah (UKM)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'INVESTMO.png', 'https://youtu.be/dLcIg1VVB4c', 'https://docs.google.com/presentation/d/1e6CTLu-KWiK4yFLPnEiSQcp17yNryWmQybBouI0TAfM/edit?usp=sharing', 'https://api.informatics-expo.id/INVESTMO.png', 41, 9, 1, '2021-07-10 15:22:21', '2021-07-11 07:26:56'),
(154, 'BISA(Business Idea Sharing Application)', '{\"blocks\":[{\"key\":\"cc7q7\",\"text\":\"Aplikasi ini dapat digunakan untuk para pemilik ide bisnis yang ingin menyalurkan idenya(pencetus ide) dan dapat di gunakan untuk para pencari ide bisnis(investor). Di aplikasi ini dapat melihat grafik ide bisnis yang telah tersedia di dalam aplikasi, melihat perkembangan ide melalui grafik, memasukan ide bisnis yang anda punya, mencari artikel untuk referensi ide bisnis anda, dan mencari ide bisnis yang anda inginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISA(Business Idea Sharing Application).png', 'https://youtu.be/yJO7qlYivGw', 'https://linktr.ee/agrifaldy', 'https://api.informatics-expo.id/BISA(Business Idea Sharing Application).png', 224, 8, 1, '2021-07-10 16:54:13', '2021-07-10 16:54:13'),
(155, 'Modalin', '{\"blocks\":[{\"key\":\"7fl0o\",\"text\":\"Modalin merupakan aplikasi untuk berinvestasi spesifik hanya di UKM. Modalin merupakan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1u0cc\",\"text\":\"perantara antara UKM yang kekurangan modal dengan masyarakat yang memiliki uang untuk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3ehg6\",\"text\":\"diinvestasikan tetapi tidak berminat untuk berinvestasi di instrumen investasi seperti reksadana,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7f49u\",\"text\":\"saham, atau usaha pribadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"pgu\",\"text\":\"Dengan adanya aplikasi ini diharapkan pelaku UKM dapat dipertemukan dengan investor yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3536c\",\"text\":\"ingin berinvestasi di sektor UKM dan meningkatkan rasa lebih berani bagi pelaku UKM untuk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"aeb6v\",\"text\":\"membuka atau melanjutkan UKM di masa sekarang dan tidak takut akan kekurangan modal.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"25cen\",\"text\":\"Fungsi Modalin adalah sebagai wadah yang menyediakan berbagai pilihan UKM untuk bisa\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"61m3v\",\"text\":\"diberikan modal oleh investor. Para investor yang telah mendaftarkan diri dapat memilih daftar UKM\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"658ll\",\"text\":\"yang menarik untuk diinvestasikan. Dengan adanya Modalin pelaku UKM dapat memiliki\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eo1j9\",\"text\":\"kesempatan untuk diberi dukungan modal oleh investor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"gna3\",\"text\":\"Dalam prosesnya, transaksi yang telah dilakukan oleh investor tidak dapat dikembalikan langsung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1u2pl\",\"text\":\"UKM yang telah mendapatkan modal dari investor akan mengelola dana tersebut terlebih dahulu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"coshr\",\"text\":\"Nantinya investor akan mendapatkan dana yang telah diinvestasikan (beserta keuntungan atau\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"978no\",\"text\":\"kerugian yang diperoleh) setelah UKM selesai mengelola dana tersebut. Proses ini berlangsung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"13nmk\",\"text\":\"dalam waktu yang tidak dapat ditentukan. Setelah proses ini selesai, investor dapat mengambil\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"33gop\",\"text\":\"semua dananya atau melakukan investasi kembali.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Modalin.jpeg', 'https://www.youtube.com/watch?v=199es5Xrpj8', 'https://www.figma.com/proto/0K9OX4fNafj3cDAUaNM1YO/RPL-Desain?node-id=1%3A7&scaling=contain&page-id=0%3A1', 'https://api.informatics-expo.id/Modalin.jpeg', 230, 8, 1, '2021-07-10 18:45:57', '2021-07-10 20:27:38'),
(156, 'Retect.id', '{\"blocks\":[{\"key\":\"d88eu\",\"text\":\"Assallamualaikum, rekan-rekan kampus perjuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"808rt\",\"text\":\"                 Kami dari Team Analyst menperkenalkan dan mengembangkan aplikasi bernama Retect.id Aplikasi ini berjalan di ruang lingkup kampus UII yang berfungsi untuk melakukan penanganan cepat penanggulangan PDP dan ODP covid-19.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":32,\"length\":7,\"style\":\"BOLD\"},{\"offset\":90,\"length\":10,\"style\":\"BOLD\"},{\"offset\":90,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4o8cp\",\"text\":\"                Dengan memanfaatkan pengolahan data yang valid serta diambil berdasarkan pertanyaan secara berkala setiap harinya kepada pengguna. Dalam hal ini pengguna adalah dosen dan mahasiswa Fakultas Teknologi Industri. Kemudian, dari data tersebut akan diolah sedemikian rupa sehingga menghasilkan informasi yang aktraktif, variatif dan informatif. Dimana data tersebut akan disajikan sebagai manajemen informasi Covid 19 diruang lingkup kampu s Universitas Islam Indonesia khususnya di Fakultas Teknologi Industri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Retect.id.png', 'https://youtu.be/rfcB3FKxul0', 'https://marvelapp.com/prototype/66f23f2/screen/80771790', 'https://api.informatics-expo.id/Retect.id.png', 231, 9, 1, '2021-07-10 21:43:50', '2021-07-10 22:44:53'),
(157, 'CALOO', '{\"blocks\":[{\"key\":\"b92c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CALOO.jpeg', 'https://youtu.be/eBvkdaYfFNI', 'https://drive.google.com/file/d/1XQ1CUcAc1ljo5RXE0nOQ_vEW3B3xgRsr/view?usp=sharing', 'https://api.informatics-expo.id/CALOO.jpeg', 234, 8, 1, '2021-07-11 23:10:00', '2021-07-11 23:10:00'),
(158, 'Tele - Sistem Informasi Ternak Lele', '{\"blocks\":[{\"key\":\"1ha4u\",\"text\":\"Tele adalah sistem informasi yang diperuntukan bagi para peternak lele dengan berbasis web diharapkan nya tele dapat berguna untuk memudahkan peternak, dalam mengelola dan memantau perkembangan ikan lele hanya dengan menggunakan aplikasi saja.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c9etr\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tele - Sistem Informasi Ternak Lele.jpeg', 'https://www.youtube.com/watch?v=LpCFppWiVN4&feature=youtu.be', 'https://drive.google.com/file/d/1EgP5Uo2LKSw6M70tJGhX-8PV4TW2Tei5/view', 'https://api.informatics-expo.id/Tele - Sistem Informasi Ternak Lele.jpeg', 235, 9, 1, '2021-07-12 14:54:43', '2021-07-12 14:54:43'),
(161, 'Kopid Mantul', '{\"blocks\":[{\"key\":\"fkhf6\",\"text\":\"Kopid Mantul adalah game bertema covid-19 dimana karakter utama yang digunakan berupa virus itu sendiri dan akan menghancurkan karakter manusia tanpa masker yang ada di dalam area tertutup berupa dinding yang akan memantulkan bola virus. Namun virus tidak dapat menghancurkan karakter manusia yang menggunakan masker. Dilengkapi dengan paddle untuk user mengontrol kemana virus itu akan dipantulkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kopid Mantul.png', 'https://youtu.be/Ii0Ohe7osWE', 'https://drive.google.com/file/d/1ZCQMf8_kQKciWayCWS15oAOZOxzNQvCx/view?usp=sharing', 'https://api.informatics-expo.id/Kopid Mantul.png', 242, 18, 2, '2021-12-28 20:33:26', '2022-01-03 20:59:44'),
(162, 'LeftOver', '{\"blocks\":[{\"key\":\"7mt8i\",\"text\":\"LeftOver adalah sebuah wadah yang bertujuan untuk mengurangi limbah sisa makanan yang memungkinkan penggunanya untuk membeli makanan dengan setengah harga dan membantu para pelaku bisnis untuk bisa menekan kerugian yang disebabkan oleh makanan yang tidak habis terjual\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LeftOver.jpeg', 'https://youtu.be/PUFnutqzNx4', '', 'https://api.informatics-expo.id/LeftOver.jpeg', 244, 12, 2, '2021-12-28 21:06:07', '2021-12-28 21:06:07'),
(163, 'Pepe and The Rise of CoronaVirus', '{\"blocks\":[{\"key\":\"1tuh0\",\"text\":\"Game ini berlatar belakang pada tahun 2020, dimana terdapat sebuah tenaga kesehatan yang harus melalui beberapa rintangan-rintangan untuk mengakhiri pandemi yang terjadi pada saat itu. Objek dalam game ini adalah mengalahkan semua musuh yang merupakan sebuah virus corona yang ada dalam stage dan mengalahkan bos yang ada pada stage terakhir. Maksud dari gim ini adalah untuk edukasi mengenai pentingnya berhati-hati terhadap bahayanya virus corona saat ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":458,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":458,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":458,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":458,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pepe and The Rise of CoronaVirus.png', 'https://www.youtube.com/watch?v=uZGAFJHSq5I', 'https://github.com/ilham-2001/pepe-and-the-rise-of-coronavirus', 'https://api.informatics-expo.id/Pepe and The Rise of CoronaVirus.png', 245, 19, 2, '2021-12-28 21:49:32', '2021-12-28 21:49:32'),
(164, 'Me Against Monster', '{\"blocks\":[{\"key\":\"sqnr\",\"text\":\"Me Against Monster adalah game bergenre Adventure, Platformer. Player akan merasakan sensasi penuh petualangan dan tantangan melawan monster.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Me Against Monster.png', 'https://www.youtube.com/watch?v=RXsECa2RwOw', '', 'https://api.informatics-expo.id/Me Against Monster.png', 247, 9, 2, '2021-12-29 15:12:07', '2022-01-01 20:15:28'),
(165, 'CAU GEDANG', '{\"blocks\":[{\"key\":\"a3utc\",\"text\":\"CAU GEDANG ini adalah aplikasi pengelola keuangan ukm, yang mana di dalam aplikasi ini bisa mencatat pemasukkan dan pengluaran. aplikasi ini juga dapat menampilkan rekapitulasi bulanan dan bisa juga untuk melihat riwayat transaksi yang pernah di lakukan. tujuan aplikasi ini adalah untuk mengganti cara pengelolaan UKM yang masi menggunakan cara manual seperti menggunakan buku catatan ke cara yang lebih mudah dan lebih aman dari resiko catatan hilang atau rusak.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CAU GEDANG.png', 'https://youtu.be/LMGO39_5WJg', 'https://github.com/RezaPahlevi156/caugedang', 'https://api.informatics-expo.id/CAU GEDANG.png', 250, 8, 2, '2021-12-29 16:10:15', '2022-01-01 20:51:44'),
(166, 'Brain Game', '{\"blocks\":[{\"key\":\"33l6e\",\"text\":\"Gim ringan dan singkat untuk mengasah daya ingat anak-anak, wawasan islami anak-anak, dan kemampuan berhitung anak-anak. Gim yang dapat memacu anak-anak untuk mempelajari lebih lanjut tentang agama islam, matematika, dan sedikit kemampuan dasar mengingat sesuatu. Gim ini cocok digunakan di sekolah dasar islam manapun.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Brain Game.png', 'https://www.youtube.com/watch?v=ZfSFwOQpM4I', 'https://github.com/RashidMaulana/Brain-Game-FInal', 'https://api.informatics-expo.id/Brain Game.png', 258, 4, 2, '2021-12-30 08:02:47', '2021-12-30 08:02:47'),
(167, 'NOKET', '{\"blocks\":[{\"key\":\"ddkcu\",\"text\":\"Noket adalah aplikasi pencatatan dan pengelolaan keuangan UKM berbasis web  yang sasaran utamanya adalah pelaku UKM. Noket dibuat memiliki tujuan untuk membantu pelaku UKM mencapai keberhasilan manajemen keuangan agar menunjang kemajuan dari UKM itu sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NOKET.png', 'https://youtu.be/lLQIqGDn0kQ', '', 'https://api.informatics-expo.id/NOKET.png', 249, 17, 2, '2021-12-30 08:49:13', '2022-01-05 12:54:41'),
(168, 'Lunga', '{\"blocks\":[{\"key\":\"ba9ol\",\"text\":\"Lunga adalah aplikasi pariwisata yang menampilkan informasi tentang pariwisata yang jarang dikunjungi di Daerah Istimewa Yogyakarta.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lunga.png', 'https://youtu.be/Spvw2tqzwGI', '', 'https://api.informatics-expo.id/Lunga.png', 248, 3, 2, '2021-12-30 12:12:35', '2022-01-05 19:11:49'),
(171, 'COKINI', '{\"blocks\":[{\"key\":\"58hgo\",\"text\":\"COKINI adalah aplikasi equity crowdfunding berbasis web yang memiliki tujuan  untuk  membantu UMKM local mengembangkan bisnisnya supaya kondisi ekonomi di sekitarnya  makmur dan merata.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":186,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":186,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":186,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'COKINI.png', 'https://youtu.be/VOGvI57c_2o', 'https://github.com/NichtsElse/COKINI', 'https://api.informatics-expo.id/COKINI.png', 280, 8, 2, '2021-12-30 19:30:44', '2022-01-03 00:50:11');
