(172, 'SampahKu', '{\"blocks\":[{\"key\":\"4dg15\",\"text\":\"    Sejak kemunculan kasus pertama Covid-19 di Indonesia pada tanggal 2 Maret 2020, banyak orang yang menjadi malas untuk beraktivitas di luar ruangan karena adanya penerapan kebiasaan  hidup baru (new normal) yang mengharuskan mereka untuk mengurangi aktivitas di luar ruangan sebanyak mungkin. Hal ini tentunya sangat berpengaruh terhadap berbagai hal, salah satunya adalah kebiasaan membuang sampah. Dulu, ketika pandemi belum menyerang negara kita, sebagian besar masyarakat terbiasa untuk membuang sampah pada tempatnya meskipun tidak sedikit juga orang-orang yang membuang sampah mereka secara sembarangan. Namun, ketika pandemi Covid-19 mulai datang di Indonesia, masyarakat dipaksa untuk mengurangi aktivitas di luar ruangan sebanyak mungkin. Kebijakan ini berlangsung sampai berbulan-bulan lamanya hingga memicu efek samping. Efek samping tersebut adalah kemalasan. Sekarang, mereka menjadi malas untuk membuang sampah pada tempatnya dan lebih memilih untuk membuangnya secara sembarangan. Hal ini tentu sangat berbahaya bagi lingkungan kita. Pasalnya, penimbunan sampah di lingkungan atau sungai dapat menjadi sumber penyakit dan pemicu banjir. Badan nasional penanggulan bencana (BNPB) mencatat, ada 487 kejadian banjir sejak 1 januari hingga 10 april 2021. Apabila solusi dari permasalahan tersebut tidak segera dibuat, maka dampaknya akan semakin besar. Oleh karena itu, kami, kelompok Pemuda Pancasila, memberikan suatu solusi  terkait permasalahan tersebut dalam bentuk pembuatan aplikasi layanan angkut sampah yang bernama “SampahKu” \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":70,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1155,\"length\":395,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":70,\"style\":\"bgcolor-transparent\"},{\"offset\":1155,\"length\":395,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":1550,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":1550,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":70,\"length\":1085,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":70,\"length\":1085,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":198,\"length\":12,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}},{\"key\":\"f0tik\",\"text\":\"    Apa itu SampahKu ? SampahKu adalah aplikasi layanan angkut sampah prabayar yang yang bekerja sama dengan pemerintah daerah. Aplikasi ini dibuat berdasarkan tiga tujuan utama : (1) Mengurangi pencemaran sampah di lingkungan ,(2) meningkatkan kualitas layanan kebersihan kota, (3) membuka lapangan pekerjaan baru. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":232,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":0,\"length\":232,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":232,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":316,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":232,\"length\":84,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":232,\"length\":84,\"style\":\"bgcolor-transparent\"},{\"offset\":232,\"length\":84,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b8j79\",\"text\":\"    Mengapa aplikasi SampahKu merupakan solusi yang tepat untuk permasalahan yang sudah dibahas sebelumnya? Sebab, pengguna dapat memesan layanan angkut sampah secara online sehingga mereka tidak perlu untuk keluar dari rumah mereka. Ditambah lagi,aplikasi ini dibuat dengan konsep yang hampir mirip dengan aplikasi yang sudah terbukti keefektifannya, yaitu aplikasi Gojek. Pengguna dapat melacak posisi driver truk pengangkut sampah secara real-time pada tampilan map yang ada di aplikasi SampahKu. Mereka juga dapat melihat history dari pemesanan layanan angkut sampah sehingga apabila mereka secara tidak sengaja membuang barang berharga mereka di tas/plastik sampah, mereka dapat menghubungi customer service SampahKu dan memberikan informasi-informasi yang diperlukan untuk melakukan prosedur pengambilan barang.   \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":820,\"style\":\"color-rgb(33,37,41)\"},{\"offset\":0,\"length\":820,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":820,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":820,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":441,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SampahKu.png', 'https://youtu.be/AO0p0g_fovM', 'https://www.figma.com/proto/0y4fKwE1rGrE9vwFmJ6qsf/Aplikasi-SampahKu?node-id=1%3A2112&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2112', 'https://api.informatics-expo.id/SampahKu.png', 277, 15, 2, '2021-12-30 19:33:44', '2021-12-30 19:33:44'),
(173, 'The Boy', '{\"blocks\":[{\"key\":\"ov0e\",\"text\":\"Kehidupan di hutan Indonesia memiliki banyak misteri yang mana karakter utama akan bertemu dengan berbagai makhluk mitologi khas indonesia (misal. buto ijo) dan  flora dan fauna yang beraneka ragam. Dengan beraneka ragam makhluk dan misteri yang ada di dalam hutan bisa menghalangi karakter utama, selain itu juga ada yang akan membantu karakter untuk menyelesaikan tujuan nya di dalam hutan tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":401,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":401,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":401,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":401,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'The Boy.png', 'https://www.youtube.com/watch?v=z56JchlsTPY', '', 'https://api.informatics-expo.id/The Boy.png', 283, 4, 2, '2021-12-30 20:58:51', '2021-12-30 20:58:51'),
(174, 'Sino the virus killer', '{\"blocks\":[{\"key\":\"246ov\",\"text\":\"Sino the virus killer adalah gim yang berlatar belakang pada pandemi Covid-19 yang mewabah di seluruh belahan dunia. Karakter utama dari gim ini adalah Sino sebagai representasi dari salah satu vaksin yang bernama sinovac. Tujuan utama dari gim ini adalah melawan semua virus yang ada dan jangan sampai terbunuh. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":312,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":312,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":312,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":312,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sino the virus killer.jpeg', 'https://youtu.be/y1HElFygQ4E', '', 'https://api.informatics-expo.id/Sino the virus killer.jpeg', 284, 19, 2, '2021-12-30 21:08:14', '2021-12-30 21:08:14'),
(175, 'VSID ', '{\"blocks\":[{\"key\":\"9u9n6\",\"text\":\"VSID adalah Sistem informasi berbasis web yang dapat menampilkan berbagai pilihan franchise. Dapat dijual oleh pemilik franchise (perusahaan) dan dapat dibeli oleh siapa saja yang membutuhkan franchise.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'VSID .png', 'https://youtu.be/SgOB3SKYG9Y', '', 'https://api.informatics-expo.id/VSID .png', 286, 8, 2, '2021-12-30 21:21:10', '2022-01-03 00:13:01'),
(176, 'Cofight', '{\"blocks\":[{\"key\":\"d1j90\",\"text\":\"Cofight adalah gim yang menceritakan seorang dokter yang berjuang menyelamatkan pasien yang berada di desa pedalaman namun ditengah jalan terhalang oleh musuh yang berupa virus dan ia diharuskan untuk menghindari dengan selamat untuk menyelesaikan misinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cofight.jpeg', 'https://youtu.be/oROk2cO3FQ8', '', 'https://api.informatics-expo.id/Cofight.jpeg', 288, 19, 2, '2021-12-30 23:30:47', '2021-12-30 23:30:47'),
(177, 'InMate', '{\"blocks\":[{\"key\":\"4lu2q\",\"text\":\"InMate merupakan game 2D Platformer, dalam game ini karakter utamanya ada seorang penyihir api (Wizard fire) yang berusaha kabur dari sebuah gua tahanan, karena diduga melakukan kejahatan. Namun, ternyata gua tahanan tersebut memiliki sebuah rahasia yaitu sebuah dunia lain. Penyihir tersebut nantinya akan menjelajahi gua tersebut untuk kabur. Gim ini hanya dapat dimainkan oleh satu orang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":390,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":390,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"aomue\",\"text\":\"Konsep dari  gim ini  akan memiliki genre petualangan (adventure), aksi (action-platformer games), dan juga semi-survival. Dimana penyihir tersebut melewati berbagai rintangan seperti jebakan-jebakan dan monster/musuh-musuh yang ada di sekitarnya untuk kabur.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":259,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":259,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":259,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":259,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"34at\",\"text\":\"Platformer game menggunakan PC/Laptop yang dikendalikan dengan keyboard. Pada tampilan game terdapat background gua yang dalam dan berbagai environment/lingkungan yang beragam sebagai poin adventure dari game ini.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":213,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":213,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":213,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":213,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'InMate.jpeg', 'https://www.youtube.com/watch?v=jlwDXCnumqg', '', 'https://api.informatics-expo.id/InMate.jpeg', 263, 16, 2, '2021-12-30 23:37:04', '2021-12-30 23:37:04'),
(178, 'Nyari Dana', '{\"blocks\":[{\"key\":\"c78o9\",\"text\":\"NyariDana merupakan sebuah platform untuk membantu para pelaku usaha mencari sumber dana bagi usaha mereka agar dapat berkembang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nyari Dana.png', 'https://youtu.be/DFBkQdbFZ1k', '', 'https://api.informatics-expo.id/Nyari Dana.png', 279, 17, 2, '2021-12-31 07:36:27', '2022-01-02 15:39:36'),
(179, 'Vaccine, Go!', '{\"blocks\":[{\"key\":\"fbc1n\",\"text\":\"Wabah virus mematikan yang bernama COVID-19 telah melanda dunia. Tom berusaha untuk terhindar dari wabah ini dengan cara mendapatkan vaksin. Wabah dapat membunuh Tom secara perlahan jika ia tidak melawannya. Let\'s play Vaccine, Go!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":231,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":231,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":231,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":231,\"style\":\"fontfamily-Arial\"},{\"offset\":208,\"length\":23,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Vaccine, Go!.png', 'https://youtu.be/IREcGp3KxdY', '', 'https://api.informatics-expo.id/Vaccine, Go!.png', 290, 18, 2, '2021-12-31 07:52:03', '2021-12-31 07:52:03'),
(180, 'Bished Rent Car', '{\"blocks\":[{\"key\":\"3rh9g\",\"text\":\"BISHED RENT AR adalah platform rental mobil yang dapat mempermudah mobilitas. rental mobil di BISHE RENT CAR dijamin aman, nyaman dan terpercaya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1e5hu\",\"text\":\"BISHED Rent Car merupakan website rental mobil yang ditujukan untuk membantu masyarakat terkait permasalahan kebingungan masyarakat akan mobilitas dari dalam maupun luar Kota Yogyakarta yang akan melakukan wisata atau ziarah dengan nyaman, aman, dan tentunya terjangkau.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dk8ab\",\"text\":\"BISHED Rent Car akan dikembangkan sebagai sistem berbasis web yang bisa diakses menggunakan Internet.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"80hg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bished Rent Car.png', 'https://youtu.be/QxbKGRDDlVc', 'https://www.figma.com/proto/LjjzL7MOusO6NPSfivz1f9/BISHED?node-id=387%3A2&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=387%3A2', 'https://api.informatics-expo.id/Bished Rent Car.png', 292, 8, 2, '2021-12-31 09:12:12', '2022-07-23 13:05:12'),
(181, 'Matching Things', '{\"blocks\":[{\"key\":\"d434\",\"text\":\"Matching Things merupakan game bertemakan edukasi untuk anak-anak usia 4-12 tahun. Dalam game ini pemain akan bermain sambil belajar mengenal hal-hal disekitar rumahnya seperti hewan, tumbuhan, makanan dan warna. Cara memainkan game adalah dengan mencocokan tiap gambar pada board hingga semua gambar menghilang agar dapat lanjut ke level berikutnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Matching Things.jpeg', 'https://youtu.be/4nBpcceUd7c', '', 'https://api.informatics-expo.id/Matching Things.jpeg', 303, 4, 2, '2021-12-31 13:46:54', '2022-01-01 23:25:16'),
(182, 'DELIFREE', '{\"blocks\":[{\"key\":\"1ie0t\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bjd8o\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c5hfk\",\"text\":\"\\\"DELIFREE\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ad88f\",\"text\":\"Meningkatnya tingkat infeksi Covid-19 membuat pemerintah menetapkan Lockdown dan peraturan PSBB, semua aktivitas yang dianggap tidak penting tidak diperbolehkan, juga patroli dan pendirian posko yang dilakukan penegak hukum untuk menegaskan peraturan tersebut bisa kita lihat di sekitar kita.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"foq69\",\"text\":\"Dengan adanya lockdown dan PSBB membatasi mobilitas masyarakat, akses ke sumber bahan makanan atau makanan menjadi semakin sulit. Solusi yang ada sekarang adalah aplikasi pemesanan online namun proses pemesanan masih menjadi proses yang rumit dan belum optimal karena aplikasi-aplikasi belum  menyelesaikan permasalahan seperti beragamnya prosedur kesehatan dalam setiap daerah, juga informasi dan status kesehatan kurir.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"30nso\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3q6ab\",\"text\":\"DELIFREE adalah aplikasi pemesanan makanan dan bahan pangan yang mengutamakan kemudahan pengguna saat Lockdown \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9v4ol\",\"text\":\"DELIFREE memiliki berbagai fitur yang dapat membantu pengguna dalam Lockdown seperti detail prosedur kesehatan daerah, pemesanan social distancing dan informasi kesehatan kurir.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DELIFREE.png', 'https://youtu.be/9WgcLeARZaE', 'https://www.figma.com/proto/edt1gvJgiXMdbSXNv2mwjH/rismoi?page-id=0%3A1&node-id=1%3A3&viewport=241%2C48%2C0.15&scaling=scale-down&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/DELIFREE.png', 301, 2, 2, '2021-12-31 14:32:24', '2021-12-31 14:32:24'),
(183, 'Covid Run', '{\"blocks\":[{\"key\":\"dmtvp\",\"text\":\"Pada tahun 2019 sebuah virus menyerang kota dan menyebabkan pandemi diseluruh dunia. hal ini disebabkan karena sebuah pabrik biologiss yang meledak menyebabkan virus tersebut tersebar. satu satunya cara untuk menyelamatkan dunia yaitu dengan mencari vaksin di bangunan pabrik yang sudah hancur dan penuh dengan virus. Ghazi sebagai pemuda yang sehat bervoluntir untuk mencari vaksin tersebut. mampukah ghazi menyelamatkan dunia?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Covid Run.jpeg', 'https://youtu.be/YZamORYQY_g', '', 'https://api.informatics-expo.id/Covid Run.jpeg', 307, 18, 2, '2021-12-31 15:00:19', '2021-12-31 15:06:14'),
(184, 'Yahuut!', '{\"blocks\":[{\"key\":\"fq395\",\"text\":\"Yahuut! adalah sebuah game berupa quiz yang memiliki macam soal umum dan pilihan jawaban untuk menambah wawasan yang ada di Indonesia teruntuk orang yang memainkannya. \",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":167,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":167,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":167,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":167,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"-4.6pt\"}}],\"entityMap\":{}}', 'Yahoot!.png', 'https://youtu.be/IztwWTRz7xA', '', 'https://api.informatics-expo.id/Yahoot!.png', 310, 4, 2, '2021-12-31 15:45:10', '2022-01-01 14:49:18'),
(185, 'NGONSUL', '{\"blocks\":[{\"key\":\"7j4ks\",\"text\":\"Pandemi COVID-19 memberikan tantangan bagi manusia untuk terus beradaptasi dengan cepat, banyak sektor-sektor terdampak yang dituntut untuk beradaptasi dan bertransformasi agar dapat terus bertahan dalam menjalankan sektor. Salah satu sektor terdampak adalah sektor kesehatan. Sektor kesehatan pada masa pandemi ini menjadi sektor yang paling krusial pada pandemi COVID-19. Banyaknya pasien-pasien COVID-19 yang terus bertambah tanpa henti yang menjadi perhatian utama pemerintah. Akan tetapi, akibat pandemi ini ternyata bukanlah hanya masalah penyakit COVID-19 yang bermunculan, tetapi masalah tentang mental health masyarakat Indonesia pun semakin meningkat. Berangkat dari permasalahan tersebut, kami berinisiatif untuk menciptakan sebuah solusi untuk masyarakat yang memiliki masalah kesehatan mental namun terhalang akan mobilitas yang sulit terutama pada masa pandemi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"74mui\",\"text\":\"Dengan NGONSUL anda dapat memesan pertemuan dengan psikolog dengan cepat dan mudah dengan aplikasi Ngonsul! Ngonsul membuka suatu gerbang kemudahan baru dalam menunjang kesehatan mental anda. Dengan puluhan hingga ratusan ahli psikolog yang kredibel, Ngonsul memberikan pengalaman layanan kesehatan yang interaktif, berkualitas, dan efektif. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c30dp\",\"text\":\"BOOKING PERTEMUAN DENGAN PSIKOLOG\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5nk03\",\"text\":\"Pilih puluhan hingga ratusan ahli psikolog kredibel yang siap melayani anda dengan pilihan pertemuan langsung ataupun secara on-line.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"849j2\",\"text\":\"MEDITASI\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c9vkv\",\"text\":\"Ingin mudah untuk mengontrol emosi? Ngonsul menyediakan fitur meditasi untuk pengguna melakukan guided meditation secara step-by-step.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dqpvb\",\"text\":\"CONNECT WITH PEOPLE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6ghs6\",\"text\":\"Berhubunglah dengan pengguna Ngonsul yang lain! dengan fitur connect with people/add friend, Ngonsul memberikan kemudahan untuk menemukan dan mendapatkan teman antar sesama pengguna aplikasi!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"na87\",\"text\":\"CHAT WITH FRIENDS\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"86d1\",\"text\":\"Merasa kesepian? Berkomunikasilah dengan teman sesama pengguna! Ngonsul memberikan kemudahan pengguna untuk berkomunikasi antar sesama pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NGONSUL.png', 'https://youtu.be/OukCMZonG0M', 'https://www.figma.com/proto/LTwqAiVTEKOuKVBMO8iH0x/BISMILLAH-BEST-APP-2022?page-id=0%3A1&node-id=15%3A2&viewport=241%2C48%2C0.63&scaling=scale-down&starting-point-node-id=15%3A2', 'https://api.informatics-expo.id/NGONSUL.png', 304, 3, 2, '2021-12-31 16:17:26', '2021-12-31 16:17:26'),
(186, 'CovFree', '{\"blocks\":[{\"key\":\"67cum\",\"text\":\"Di masa pandemi yang seperti ini, covid-19 pun terus berlanjut. Bahkan angka persentase orang yang terkena covid-19 bisa meningkat pesat dalam sehari. Masyarakat awam yang tidak tahu harus melakukan apa ketika sedang menjalani isolasi mandiri. Pada akhirnya, mereka pun tetap kebingungan dan kadang kesulitan dalam mencari informasi terkait covid-19.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3tp46\",\"text\":\"CovFree merupakan suatu aplikasi yang bergerak dibidang kesehatan yang bertujuan membantu para penderita covid-19 dalam masa isolasi mandirinya. Di dalam aplikasi ini terdapat fitur-fitur yang menjadi arahan untuk mempermudah para penderita covid yang sedang menjalani isolasi mandiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8f5nm\",\"text\":\"Kami menghadirkan beberapa fitur yang diantaranya ada fitur Konsultasi, untuk melakukan konsultasi dengan dokter mengenai keluhan yang dirasakan pengguna, fitur delivery, untuk melakukan pengantaran obat/vitamin kepada pengguna, fitur aktivitas,untuk menyarankan kegiatan yang membantu peningkatan imun pengguna, fitur reminder,untuk membantu user dalam mengingat apa saja yang harus dilakukannya selama menggunakan aplikasi ini,kami juga menyediakan tutorial video untuk menggunakan aplikasi agar pengguna tidak kebingungan ketika sedang menggunakan aplikasi CovFree dan yang perlu kalian ketahui aplikasi ini bekerja sama dengan bpjs.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fqroo\",\"text\":\" Konsep yang kami buat ini terinspirasi dari aplikasi kesehatan yang sudah tersedia lebih dulu seperti Halodoc, dan Peduli Lindungi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CovFree.png', 'https://youtu.be/4MoWiXvC6I0', 'https://www.figma.com/proto/GBq1bR0HIfu2QsWJh4kvIG/2gether?node-id=46%3A21&scaling=scale-down&page-id=2%3A1003&starting-point-node-id=46%3A21&show-proto-sidebar=1', 'https://api.informatics-expo.id/CovFree.png', 306, 18, 2, '2021-12-31 16:31:30', '2021-12-31 16:31:30'),
(187, 'JualinYuk', '{\"blocks\":[{\"key\":\"259uc\",\"text\":\"Aplikasi JualinYuk merupakan aplikasi marketplace yang diprogram untuk mempermudah para UKM lokal untuk memperjual belikan dagangannya secara online, dengan begini para pelaku UKM yang berbasis ekonomi menengah kebawah dan hanya bermain sekitar daerah atau lokal mampu menembus pasar yang lebih luas dan dikenal baik didalam dan luar daerah seperti batik daerah dan buah tangan khas daerah masing-masing yang memang memiliki corak desain dan cita rasa yang unik \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":462,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":462,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fmd8d\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JualinYuk.jpeg', 'https://youtu.be/22VzEzMA7Yw', '', 'https://api.informatics-expo.id/JualinYuk.jpeg', 254, 8, 2, '2021-12-31 17:16:27', '2023-02-18 03:21:29'),
(188, 'FinancialMu', '{\"blocks\":[{\"key\":\"2eieg\",\"text\":\"FinancialMu adalah aplikasi \'Personal Budget Management\' yang digunakan untuk mengatur keuangan pengguna. FinancialMu dapat mencatat pengeluaran dan pemasukan, sesuai dengan kebutuhan yang telah ditentukan oleh pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":220,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":220,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":220,\"style\":\"fontfamily-Poppins, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FinancialMu.png', 'https://youtu.be/lECrbyZPXh4', 'https://github.com/udangRakus/Financialmu_Expo-uii-2022', 'https://api.informatics-expo.id/FinancialMu.png', 316, 1, 2, '2021-12-31 17:53:25', '2022-01-03 06:59:44'),
(190, 'Hotel Of Angker', '{\"blocks\":[{\"key\":\"13hv8\",\"text\":\"Meningkatnya jumlah korban yang meninggal di Hotel of Angker, membuat aktivitas paranormal semakin meresahkan warga. Anda sebagai pemain yang terjebak di hotel ini ditantang untuk mencari jalan keluar rahasia agar dapat menyelamatkan diri. Selama perjalanan, kalian akan bertemu dengan berbagai jenis hantu yang mengerikan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":45,\"length\":16,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"9g37f\",\"text\":\"Gunakan kesempatan yang tersedia untuk dapat keluar dari Hotel of Angker. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":57,\"length\":15,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2p4o7\",\"text\":\"Jika Anda tertantang, main dan selesaikan misi yang ada! \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":57,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hotel Of Angker.png', 'https://www.youtube.com/watch?v=ZRvOSozZb1g&ab_channel=OktoNugroho', 'https://www.mediafire.com/file/38dszsv0mdcgrza/EarlyAccessHotelOfAngker.rar/file', 'https://api.informatics-expo.id/Hotel Of Angker.png', 317, 16, 2, '2021-12-31 19:00:00', '2022-01-01 17:31:35'),
(191, 'Don\'t Go Crowd', '{\"blocks\":[{\"key\":\"bl7ej\",\"text\":\"Virus Covid-19 adalah Virus yang sangat berbahaya, penyebarannya sangat cepat menular terhadap orang sekita. Maka dari itu menjaga jarak adalah solusi terbaik untuk menghindari terkena virus tersebut. Ayo bantu PakPol untuk membasmi para Virus yang tersebar di jalanan dan mengingatkan warga untuk berjaga jalan dan memakai masker. Mainkan sekarang!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Don\'t Go Crowd.jpeg', 'https://www.youtube.com/watch?v=IRWwAxx8ahg', 'https://play.unity.com/mg/other/dont-t-go-crowd', 'https://api.informatics-expo.id/Don\'t Go Crowd.jpeg', 321, 19, 2, '2021-12-31 19:53:57', '2022-01-01 18:40:02'),
(192, 'Cuanin', '{\"blocks\":[{\"key\":\"b6bgm\",\"text\":\"UKM merupakan salah satu sektor bisnis penggerak roda perekonomian masyarakat. Banyaknya transaksi yang dihasilkan oleh UKM mengakibatkan pencatatan yang dihasilkan hariannya pun tidak sedikit. Maka dari itu, tidak sedikit UKM kewalahan dalam mengelola keuangan tersebut. Akibatnya UKM kesulitan untuk menelusuri jumlah keuntungan yang dihasilkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"af6to\",\"text\":\"Oleh karena itu, Cuanin hadir untuk mengatasi permasalahan tersebut. Cuanin merupakan aplikasi berbasis web yang berfokus untuk membantu pengelolaan keuangan para penggiat UKM. Cuanin memiliki misi yaitu untuk membantu para penggiat UKM di Indonesia dalam memonitor dan mengatur arus keuangan secara lebih baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cuanin.png', 'https://youtu.be/0cOsOkiMI0s', 'https://farhannovan.com/cuanin', 'https://api.informatics-expo.id/Cuanin.png', 329, 9, 2, '2021-12-31 21:47:31', '2021-12-31 22:23:46'),
(193, 'Breakout', '{\"blocks\":[{\"key\":\"4ailt\",\"text\":\"Breakout adalah game di mana Anda seorang subjek eksperimen terjebak di sebuah penjara lab yang para ilmuan jahat melakukan berbagai eksperimen kepada Anda. Kaburlah dari lab tersebut dengan mempelajari bahasa pemrograman untuk meretas pintu-pintu yang ada pada lab tersebut dan carilah jalan keluarnya!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Breakout.jpeg', 'https://www.youtube.com/watch?v=zEHDwUlIz3o', '', 'https://api.informatics-expo.id/Breakout.jpeg', 330, 4, 2, '2021-12-31 22:01:27', '2021-12-31 22:01:27'),
(194, 'IdeaShop', '{\"blocks\":[{\"key\":\"3eqk6\",\"text\":\"Idea Shop adalah aplikasi berbasis web untuk memfasilitasi bertemunya pelaku UKM secara online. Disini pelaku UKM disediakan tempat untuk berdiksusi seputar bisnis UKM dan bagi yang tidak memiliki ide, akan tetapi memiliki biaya/budget bisa mengikuti bisnis UKM yang diinginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":278,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'IdeaShop.jpeg', 'https://youtu.be/f_VinqLmvnc', 'https://ideasp.000webhostapp.com/welcome.php', 'https://api.informatics-expo.id/IdeaShop.jpeg', 332, 9, 2, '2021-12-31 22:29:52', '2022-01-01 22:56:36'),
(197, 'Localation', '{\"blocks\":[{\"key\":\"f7h3m\",\"text\":\"Sebuah aplikasi berbasis Android yang bisa digunakan dimana saja dan kapan saja ketika pengguna ingin berwisata di daerah Yogyakarta. Aplikasi ini memiliki dua fitur utama yaitu untuk menyediakan tour wisata yang direkomendasikan dan memberikan rating di setiap lokasi wisata yang dikunjungi untuk memberi masukan terhadap tempat wisata yang dikunjungi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lolalation.jpeg', 'https://youtu.be/v0MxkEhzvCE', '', 'https://api.informatics-expo.id/Lolalation.jpeg', 335, 11, 2, '2021-12-31 23:07:07', '2022-01-01 08:09:14'),
(198, 'Cakep (Cegah Kena Penipuan', '{\"blocks\":[{\"key\":\"d42t1\",\"text\":\"“Sepanjang tahun 2021 ini, Kementerian Kominfo menerima laporan aduan penipuan transaksi online sebanyak 115.756 laporan. Jika dibandingkan dengan angka laporan penipuan online dari tahun 2020 yang berjumlah 167.675 laporan, maka terjadi penurunan jumlah laporan di tahun 2021,\\\" kata Juru Bicara Kominfo, Dedy Permadi \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1,\"style\":\"color-rgb(32,33,34)\"},{\"offset\":0,\"length\":1,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":1,\"style\":\"fontsize-10.5pt\"},{\"offset\":0,\"length\":1,\"style\":\"fontfamily-Arial\"},{\"offset\":1,\"length\":317,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1,\"length\":317,\"style\":\"bgcolor-transparent\"},{\"offset\":1,\"length\":317,\"style\":\"fontsize-12pt\"},{\"offset\":1,\"length\":317,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2vv3c\",\"text\":\"Mayoritas laporan tersebut berisikan laporan terhadap transaksi jual-beli di e-commerce,serta sedikit tentang penipuan lewat pengosongan saldo di e-wallet.Modus yang diceritakan di beberapa laporan penipuan, penipu mengajak korban untuk bertransaksi selain lewat e-commerce,namun menggunakan rekening pribadi.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":309,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":309,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":309,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":309,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"24vre\",\"text\":\"Meskipun bukti laporan nya menurun, masih banyak terjadi penipuan di Indonesia.Oleh karena itu kami mencoba untuk membangun aplikasi Cakep ini untuk mengedukasi masyarakat dan membantu memeriksa keamanan sebelum transaksi.Aplikasi kami juga  dapat menjadi wadah bagi para korban sehingga kasus yang sama tidak terulang lagi. konsep aplikasi kami dapat mengakomodir pengguna untuk melaporkan kasus penipuan sehingga laporan korban dapat terkumpul dan menindaklanjuti kasus tersebut.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":481,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":481,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":481,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":481,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5t7e6\",\"text\":\"Dengan menggunakan aplikasi tersebut, masyarakat diharapkan dapat semakin bijak dalam bertransaksi melalui media digital dan pemberantasan penipuan online dapat semakin efektif.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":177,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":177,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":177,\"style\":\"fontfamily-Arial Narrow\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cakep (Cegah Kena Penipuan.png', 'https://youtu.be/Gsq9uHdG710', 'https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbjQzQkNoQVdPUnZkcllKa0o3dUhQUC1VclEyZ3xBQ3Jtc0trSW1ybjVCclMwcDNQcDZVLWg3ZzM1aFZDNENjTjRVeXVGYTZadmpWNnRSVm10bXhEZ01ydm9HSEQyVzhkSHZrRmcweGdVbGVTRTBsa1pTVkxGd0hQRW1JREdwczdRbW5tSFVTbGJWWC1WV0g3aUg4cw&q=https%3A%2F%2Fwww.figma.com%2Fproto%2FGEF5EZMCNxYmnhXzbdSIO1%2Fnew-app%3Fnode-id%3D124%253A1218%26scaling%3Dscale-down%26page-id%3D0%253A1%26starting-point-node-id%3D124%253A1218', 'https://api.informatics-expo.id/Cakep (Cegah Kena Penipuan.png', 338, 16, 2, '2021-12-31 23:26:56', '2022-01-01 10:33:17'),
(199, 'SERIUS \"BELAJAR\" ', '{\"blocks\":[{\"key\":\"6rfrq\",\"text\":\"Aplikasi SERIUS “BELAJAR”  merupakan aplikasi berbasis pendidikan yang dapat dijangkau semua kalangan karena tidak perlu berlangganan apalagi mengeluarkan biaya, oleh karena adanya pandemi covid 19 ini sektor yang terdampak tidak hanya perekonomian saja tapi pendidikan juga ikut terdampak, banyak orang yang terdampak secara ekonomi sehingga mereka mengalami kesulitan dalam membiayai pendidikan anak anaknya, terutama pendidikan tambahan diluar sekolah seperti kebutuhan untuk bimbel, maka dari itu kami berniat menghadirkan sebuah aplikasi yang dapat menjangkau mereka itu, agar mereka dapat merasakan suatu pembelajaran yang menyenangkan dari sebuah video yang tersedia, karena aplikasi yang kami kembangkan ini dapat diakses secara gratis untuk perantara belajar siswa/siswi . Selain itu, minat siswa/siswi dalam belajar daring juga masih tergolong rendah, oleh karenanya membutuhkan sebuah terobosan agar siswa/siswi dimasa pandemi ini dimana mayoritas pembelajaran disekolah dilaksanakan secara daring dapat tetap semangat dalam belajar, karena pandemi bukan suatu hambatan bagi kita semua untuk tetap belajar menuntut ilmu, dari hal tersebut aplikasi kami menyediakan sebuah gift yang akan diberikan kepada siswa/siswi yang semangat dalam menjalankan pembelajaran melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"32a24\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cg62\",\"text\":\"Aplikasi SERIUS “BELAJAR” merupakan solusi yang tepat atas permasalahan diatas karena fitur yang tersedia pada aplikasi SERIUS “BELAJAR”  ini menurut kami sudah sangat membantu pengguna atau siswa agar lebih mudah dalam mencari sebuah video pembelajaran. Kami menghadirkan fitur diantaranya fitur search dan filter video, sehingga mereka dapat lebih spesifik untuk mencari video yang mereka inginkan, fitur notifikasi, jadi pengguna dapat langsung mengetahui video pembelajaran apa yang telah dibuat oleh creator yang mereka follow,  fitur share dan download, tentu saja itu sangat berguna bagi para pengguna aplikasi ini, karena jika mereka ingin men-share video materi pembelajaran mereka dapat melakukannya dengan membagikannya via media sosial atau aplikasi pesan instan tentu ini memberikan manfaat karena pengguna juga dapat menyebarkan video kepada teman temannya sehingga diharapkan ilmu yang bermanfaat dapat tersebar luas dan apabila mereka ingin menonton tanpa menggunakan koneksi internet mereka juga dapat mendownloadnya, fitur gift yang diharapkan dapat mendorong semangat belajar bagi siswa/siswi dan yang terakhir yaitu fitur klip, dengan video yang berdurasi panjang pengguna hanya perlu beberapa langkah saja bisa memilih letak momen menariknya dan juga fitur playlist yang dapat mengelompokkan video berdasarkan kategori.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SERIUS \"BELAJAR\" .jpeg', 'https://youtu.be/6QJCXnq_Fno', 'https://www.figma.com/proto/nCbI1DKbJWVXkr3CC9RXay/aplikasi-pendidikan?node-id=525%3A67&scaling=scale-down&page-id=0%3A1&starting-point-node-id=525%3A67', 'https://api.informatics-expo.id/SERIUS \"BELAJAR\" .jpeg', 339, 4, 2, '2021-12-31 23:37:49', '2021-12-31 23:37:49'),
(200, 'Halo Farmasi', '{\"blocks\":[{\"key\":\"alc7q\",\"text\":\"Perkembangan teknologi semakin berinovasi memberikan tantangan bagi manusia untuk terus beradaptasi dengan cepat. Salah satu inovasi dibidang teknologi yaitu inovasi aplikasi. Banyak aplikasi sekarang yang berguna untuk manusia. Zaman modern seperti saat ini kurang lengkap jika kita tidak menggunakan aplikasi secara online. Masyarakat sekarang sudah mulai sibuk dengan kegiatannya masing masing dan juga masyarakat ingin mempunyai aplikasi yang dapat mempermudah pekerjaan. Apalagi saat ini sedang dalam pandemic covid 19, masyarakat takut keluar karena banyaknya kasus terkena virus tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dbm09\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1ohak\",\"text\":\"Maka dari itu, dengan HALO FARMASI anda dapat memesan obat tanpa harus ke apotek. Anda juga dapat melakukan konsultasi dengan dokter secara cepat dan mudah. Dan diaplikasi ini,  juga menyediakan fitur Paylater sehingga anda dapat mendapat obat terlebih dahulu dan membayar belakangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cfi5q\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b2a5\",\"text\":\"MEMBELI OBAT MENGGUNAKAN HANDPHONE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4a6mj\",\"text\":\"Sekarang tidak perlu lagi bersusah-susah untuk pergi ke apotek, tinggal duduk manis lalu obat akan diantar ke alamat anda.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e34et\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"59n6d\",\"text\":\"MENYEDIAKAN FITUR BAYAR NANTI (Paylater)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7g6hd\",\"text\":\"Bagi pengguna yang belum memiliki uang juga bisa membeli obat, tentunya dengan syarat dan ketentuan tertentu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"38vk4\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8mdbf\",\"text\":\"BERKONSULTASI DENGAN DOKTER\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5amq5\",\"text\":\"Kami menghadirkan fitur chat untuk berkonsultasi langsung dengan dokter mengenai penyakit dan obatnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Halo Farmasi.jpeg', 'https://youtu.be/2qOMqOC8Yx8', 'https://www.figma.com/proto/eDi7rPnIhQE6wpSMU6KKhE/Halo-Farmasi?node-id=460%3A429&scaling=min-zoom&page-id=103%3A194&starting-point-node-id=324%3A61', 'https://api.informatics-expo.id/Halo Farmasi.jpeg', 325, 3, 2, '2021-12-31 23:41:33', '2022-01-01 00:27:57'),
(202, 'Box.id', '{\"blocks\":[{\"key\":\"5b8g8\",\"text\":\"Why Box.id?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5e2nu\",\"text\":\"Bisnis UKM menjadi salah satu alternatif mencari penghasilan di masa pandemi Covid-19 seperti sekarang ini. Oleh karena itu, Box.id hadir untuk bantu wujudkan bisnis UKM masyarakat dan pulihkan kembali perekonomian Indonesia. Go Rangers!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Box.id.png', 'https://youtu.be/kIF3mUQOKBU', '', 'https://api.informatics-expo.id/Box.id.png', 340, 9, 2, '2021-12-31 23:52:41', '2021-12-31 23:52:41'),
(204, 'Crazy Car', '{\"blocks\":[{\"key\":\"63t3e\",\"text\":\"Hero Car adalah seorang relawan yang betugas mengantar vaksin melalui rintangan/obstacle jalanan seperti zombie dan crazy car, vaksin diambil dari checkpoint rumah sakit atau puskesmas penyedia vaksin kemudian diantar ke rumah sakit untuk pasien covid. Dapatkah mobil relawan tersebut berhasil melewati rintangan untuk menyelamatkan pasien covid?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Crazy Car.jpeg', 'https://youtu.be/eZCHpK-N000', '', 'https://api.informatics-expo.id/Crazy Car.jpeg', 331, 9, 2, '2022-01-01 00:48:26', '2022-01-01 00:48:26'),
(205, 'Turispot', '{\"blocks\":[{\"key\":\"943uq\",\"text\":\"Turispot merupakan aplikasi yang digunakan untuk membuat pengguna dapat mengetahui objek-objek wisata yang ada di Yogyakarta yang mungkin belum banyak diketahui oleh masyarakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Turispot.jpeg', 'https://youtu.be/wTQwJXUY_-c', '', 'https://api.informatics-expo.id/Turispot.jpeg', 342, 9, 2, '2022-01-01 01:26:32', '2022-01-02 15:19:51'),
(206, 'Edu-Planner', '{\"blocks\":[{\"key\":\"ff2il\",\"text\":\"Edu-Planner merupakan aplikasi belajar yang membantu pelajar dalam mengorganisir kegiatan belajarnya secara mandiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Edu-Planner.jpeg', 'https://youtu.be/TjA4OSHfS4U', '', 'https://api.informatics-expo.id/Edu-Planner.jpeg', 343, 4, 2, '2022-01-01 01:27:40', '2022-01-01 19:42:56'),
(207, 'Digital Elektronik Shoes', '{\"blocks\":[{\"key\":\"1l7j\",\"text\":\"Digital Elektronik Shoes (Deshoes) merupakan sebuah website marketplace yang berfungsi sebagai sarana bagi pelaku UMKM pengrajin sepatu untuk dapat menjual produk mereka dan mendapatkan jangkauan pasar yang lebih luas. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":219,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":219,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":219,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"67kih\",\"text\":\"Proyek ini bertujuan untuk membantu para pelaku UMKM khususnya sektor kerajinan  sepatu untuk mendapatkan jangkauan pasar yang lebih luas. Tidak hanya itu, lingkungan yang kami khususkan hanya untuk para pelaku umkm di bidang sepatu yang dimana nantinya  diharapkan mampu untuk menjaga agar pelaku umkm mendapat lingkungan bisnis yang lebih suportif sehingga bisa mngembangkan bisnisnya ke tahap yang lebi baik dan lebih besar lagi.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":433,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":433,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":433,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":433,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":433,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Digital Elektronik Shoes.jpeg', 'https://youtu.be/1ZFA3-kDhtI', 'https://deshoesmarketplace.000webhostapp.com/', 'https://api.informatics-expo.id/Digital Elektronik Shoes.jpeg', 345, 8, 2, '2022-01-01 02:26:54', '2022-01-01 02:26:54'),
(208, 'Turney', '{\"blocks\":[{\"key\":\"bljs\",\"text\":\"Turney Merupakan sebuah aplikasi yang digunakan mahasiswa/i dalam mencari event yang diselenggarakan oleh penyelenggara event serta digunakan mahasiswa/i dalam mencari teman bermain. Digunakan oleh penyelenggara event untuk menyalurkan informasi/mempromosikan event mereka. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":273,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":273,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":273,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":273,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Turney.jpeg', 'https://www.youtube.com/watch?v=5jir2GQvreg', 'https://github.com/Mul101/Turney-App', 'https://api.informatics-expo.id/Turney.jpeg', 346, 9, 2, '2022-01-01 02:30:10', '2022-01-01 02:30:10');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(211, 'Upskilling ', '{\"blocks\":[{\"key\":\"778qj\",\"text\":\"Upskilling adalah aplikasi berbasis e-learning yang mempertemukan antara siswa dan mentor untuk mengembangkan keterampilan softskill.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":133,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":133,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":133,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":133,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":133,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"e47vb\",\"text\":\"Kami menyadari softskill sangat diperlukan dalam dunia kerja dan untuk masa depan yang lebih baik. Namun saat ini belum ada tempat khusus untuk mempelajarinya, selain itu karena softskill tidak diresmikan sebagai pelajaran wajib di sekolah, masyarakat menjadi sangat kesulitan jika ingin mempelajari softskill. Sehingga mengakibatkan minimnya kualitas keterampilan softskill dan meningkatnya angka pegangguran.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":410,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":410,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":410,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":410,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":410,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"c2jkp\",\"text\":\"Cara untuk mengembangkan keterampilan softskill begitu banyak, seperti dengan mengikuti seminar atau menonton video dari youtube. Tetapi biasanya kita kesulitan dalam mencari seminar atau video yang terpercaya dan tidak adanya bimbingan langsung dari mentor. Sebab itulah kami tim poseidon mengembangkan aplikasi upskilling ini dengan fitur :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":342,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":342,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":342,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":342,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":342,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"d8rjn\",\"text\":\"1. AKSES VIDEO & LATIHAN SOAL berbagai jenis softskill dari mentor yang ahli\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":76,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":76,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":76,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":76,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":76,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":30,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a8e\",\"text\":\"2. TIMELINE berisi informasi lowongan pekerjaan dan webinar\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":59,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":59,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":59,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":59,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":59,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":12,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a5d5g\",\"text\":\"3. LIVE CHAT yaitu chat dengan mentor secara langsung untuk meminta bimbingan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":77,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":77,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":77,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"f9dk0\",\"text\":\"Pengguna juga dapat memilih apakah ingin menjadi mentor atau ingin menjadi siswa, disini tidak hanya belajar tetapi kita juga dapat mengajarkan softskill yang telah kita miliki. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":177,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":177,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":177,\"style\":\"fontsize-inherit\"},{\"offset\":49,\"length\":7,\"style\":\"BOLD\"},{\"offset\":75,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"8kdn6\",\"text\":\"Fitur yang lengkap dan sangat dibutuhkan ini akan memudahkan pengguna untuk memaksimalkan proses pengembangan softskill.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":120,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":120,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":120,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'Upskilling .png', 'https://youtu.be/iX728vQFCmc', 'https://www.figma.com/proto/1EfVQy0WyiRAqj28kg65qx/UPSKILLING-by-POSEIDON?scaling=scale-down&page-id=0%3A1&starting-point-node-id=21%3A223&show-proto-sidebar=1&node-id=21%3A223', 'https://api.informatics-expo.id/Upskilling .png', 349, 4, 2, '2022-01-01 06:11:13', '2022-01-04 23:46:18'),
(212, 'Dive Into Danger', '{\"blocks\":[{\"key\":\"9sio9\",\"text\":\"Dive Into Danger merupakan gim platformer 2D yang memiliki genre adventure.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8tjhg\",\"text\":\"Di suatu kerajaan terdapat tuan putri yang dicintai rakyatnya. Suatu hari saat tuan putri dan pengawalnya pergi ke luar kerajaan, mereka diserang oleh gerombolan monster dan tuan putri diculik oleh para monster. Saat mendengar kabar putrinya diculik oleh monster, raja segera membuat pengumuman yang berisi siapa saja yang berhasil menyelamatkan putrinya akan diberi harta yang banyak. Kabar tuan putri yang diculik dan pengumuman sang raja sampai di telinga Edward, kesatria miskin yang ingin merubah hidupnya. Edward pun tertarik untuk masuk ke sarang para monster dan menyelamatkan tuan putri lalu menjadi kaya. Mampukah Edward menyelamatkan tuan putri? Atau malah nasib buruk yang menghampiri Edward?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Dive Into Danger.png', 'https://youtu.be/w6TXN4acGi8', 'https://github.com/alifmaulanarizqi/Gim-Platformer-2D', 'https://api.informatics-expo.id/Dive Into Danger.png', 326, 19, 2, '2022-01-01 06:18:09', '2022-01-08 13:06:39'),
(213, 'Piyo And The Gangs', '{\"blocks\":[{\"key\":\"dsbha\",\"text\":\"Piyo and the gangs merupakan game 2D platformer yang memberikan keseruan game bertema turn base attack dengan metode baru dengan digabungkan dengan edukasi. Sehingga anak dapat bermain sekaligus belajar pada satu waktu yang sama\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Piyo And The Gangs.png', 'https://www.youtube.com/watch?v=OqQ9ictDE_E&t=11s', 'https://drive.google.com/drive/folders/1RlaEwGU9so2tazv48Z6YyC-1YkPlY--o?usp=sharing', 'https://api.informatics-expo.id/Piyo And The Gangs.png', 276, 4, 2, '2022-01-01 08:03:13', '2022-01-01 08:03:13'),
(214, 'Missing Other Side', '{\"blocks\":[{\"key\":\"b7ue5\",\"text\":\"Seorang bernama Sri Romanoff kehilangan saudaranya yang dicurigai diculik oleh monster-monster yang didalangi oleh seseorang. Sri Romanoff harus menyelamatkan saudaranya dengan melewati beberapa rintangan dan musuh yang dilalui. Selamatkan saudara yang hilang bersama Sri Romanoff!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":281,\"style\":\"color-rgb(13,13,13)\"},{\"offset\":0,\"length\":281,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":281,\"style\":\"fontsize-15\"},{\"offset\":0,\"length\":281,\"style\":\"fontfamily-Roboto, Noto, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Missing Other Side.png', 'https://www.youtube.com/watch?v=vcOPBTNx_l8', '', 'https://api.informatics-expo.id/Missing Other Side.png', 352, 16, 2, '2022-01-01 08:16:15', '2022-01-01 08:23:28'),
(215, 'Faisal Covidventure', '{\"blocks\":[{\"key\":\"cn8e7\",\"text\":\"Di suatu kota yang ditempati Faisal sedang mengalami kasus covid yang cukup memprihatinkan. Banyak warga dan virus covid yang bergerak bebas disana. Faisal yang harus mengunjungi rumah nenek nya harus menghindari hal tersebut dengan menjaga jarak, dan di sepanjang perjalanan Faisal dapat menemui vitamin yang akan menambah daya tahannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Faisal Covidventure.png', 'https://www.youtube.com/watch?v=4sjtFn1egq0', 'https://drive.google.com/file/d/1bJt5rvWR31Lcw8tuYTmxx7NS6SDomafn/view?usp=sharing', 'https://api.informatics-expo.id/Faisal Covidventure.png', 353, 3, 2, '2022-01-01 08:17:54', '2022-01-07 00:05:53'),
(216, 'Stranger', '{\"blocks\":[{\"key\":\"u1vb\",\"text\":\"Platform Stranger ditujukan kepada anak dan remaja yang menjadi korban kekerasan agar dapat bangkit dari trauma dan dapat menjalani kehidupan secara normal dengan mendorong mereka melakukan serangkaian aktivitas yang dijadikan sebagai target harian. Tujuan utama adalah membantu user untuk membentuk kebiasaan baru secara menyenangkan dan mengurangi efek tekanan akibat trauma. Dengan Stranger, user dapat membuat custom avatar dan menentukan karakter avatar dengan diberikan beberapa pilihan karakter serta aktivitas yang ingin user jadikan rutinitas. Setiap aktivitas pada daftar memiliki batas waktu dan status, apabila user lupa mengubah status dari lakukan menjadi selesai maka setelah melewati batas waktu sistem akan mengubah status default yaitu tidak terlaksana. Setiap aktivitas memiliki poin dan akumulasi poin harian menjadi tolak ukur bagi psikiater dalam memantau perkembangan pasien. Untuk melihat dokumentasi dari pengembangan apk Stranger dapat di akses melalui link dibawah ini :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":997,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":997,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":997,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":997,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":9,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7n4gh\",\"text\":\"Dokumen Final Report \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":21,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":21,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":21,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":21,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[{\"offset\":0,\"length\":20,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://drive.google.com/file/d/1dGUWFE5UVENkxFx71bOhPeQSRnljZDx8/view?usp=sharing\",\"targetOption\":\"_self\"}}}}', 'Stranger.jpeg', 'https://www.youtube.com/watch?v=VkIlDokj4_8', 'https://www.slideshare.net/AzkaNabilah/stranger-mobile-apps-by-the-celestial', 'https://api.informatics-expo.id/Stranger.jpeg', 354, 18, 2, '2022-01-01 08:43:53', '2022-01-05 16:29:04'),
(217, 'BOBOT', '{\"blocks\":[{\"key\":\"b5pe7\",\"text\":\"BOBOT adalah Web untuk membantu UKM-UKM kecil mendapatkan Investor\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BOBOT.png', 'https://youtu.be/1jyv-6mQlGc', '', 'https://api.informatics-expo.id/BOBOT.png', 358, 9, 2, '2022-01-01 08:57:47', '2022-01-01 08:57:47'),
(218, 'Stargazing', '{\"blocks\":[{\"key\":\"b2gcb\",\"text\":\"Stargazing adalah aplikasi pendidikan modern di bidang astronomi dengan menerapkan tema gamifikasi yang bisa membuat proses pembelajaran menjadi lebih asik serta menyenangkan dengan menerapkan fitur-fitur yang baru dan unik sesuai dengan minat dan usia pengguna, yaitu anak Sekolah Dasar dengan kelas 4, 5, dan 6.\\n\\nGamifikasi yang diterapkan yaitu dengan menciptakan fitur quiz yang dilengkapi dengan progress bar agar pengguna bisa mengetahui sejauh mana dalam mengerjakan quiz. Setelah pengguna mengerjakan quiz, muncul score yang didapatkan dan score tersebut bisa dicompare dengan pengguna lain dengan adanya fitur leaderboard.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":373,\"length\":4,\"style\":\"BOLD\"},{\"offset\":401,\"length\":12,\"style\":\"BOLD\"},{\"offset\":619,\"length\":11,\"style\":\"BOLD\"},{\"offset\":373,\"length\":4,\"style\":\"ITALIC\"},{\"offset\":401,\"length\":12,\"style\":\"ITALIC\"},{\"offset\":619,\"length\":11,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Stargazing.png', 'https://youtu.be/KcrNoO5y01M', 'https://github.com/yoesran/stargazing', 'https://api.informatics-expo.id/Stargazing.png', 243, 4, 2, '2022-01-01 08:59:30', '2022-01-01 08:59:30'),
(219, 'Asep : Perjalanan di Kota Virus ', '{\"blocks\":[{\"key\":\"abgti\",\"text\":\"Kota Amanesu terserang virus berbahaya! Virus-virus tersebut  dengan cepat menyebar dengan sentuhan maupun dari udara dalam jarak yang sangat dekat. Asep sebagai kurir harus mengantarkan paket makanan dari satu tempat ke tempat lain dengan aman agar para penduduk tidak kelaparan di saat pandemi berlangsung. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":308,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":308,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":308,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Asep : Perjalanan di Kota Virus .png', 'https://youtu.be/9_Mw8Y6R2DY', '', 'https://api.informatics-expo.id/Asep : Perjalanan di Kota Virus .png', 359, 18, 2, '2022-01-01 09:03:28', '2022-01-02 23:49:46'),
(220, 'Chabit', '{\"blocks\":[{\"key\":\"90s6d\",\"text\":\"Climate change is a significant change in climate, air temperature and rainfall. What we have experienced is the decline in air health due to motorized vehicles or forest fires. Besidesthat, garbage also greatly affects the quality of the natural environment and it is also very disturbing to living things around us. To solve this problem we introduce you to an application called Chabit. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dlvnn\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cr1ge\",\"text\":\"Chabit is an application that helps you to change your life habits tobe more environmentally friendly. We want to invite you to help reduce the impact of climate change, caring about the environment, and also make people more aware about the importance of caring for the environment.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"144ce\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"et4rg\",\"text\":\"Chabit provides several interesting features such as:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bog9\",\"text\":\"1. Pacer\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"210ch\",\"text\":\"Pacer is a feature that supports the movement to reduce air pollution that is if you choose to walk then you can convert your number of steps to coins.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ebjsr\",\"text\":\"2. Sell Ur Trash\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5elll\",\"text\":\"Sell ​​Ur Trash is a feature that invites you to manage the amount of trash. You can sell your trash and get incentives.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ed2ei\",\"text\":\"3. Recycle Marketplace\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"v6jb\",\"text\":\"The marketplace in our app is more unique than others because we sell recycled goods that can be reused and be useful again.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Chabit.png', 'https://youtu.be/l8q7o1UQwd4', 'https://www.figma.com/proto/MTyKI559FFiY7UOSHECTmp/Group-1-CYBERISE-Chabit-Design-Thinking-Project?node-id=380%3A20538&scaling=scale-down&starting-point-node-id=477%3A18168&show-proto-sidebar=1', 'https://api.informatics-expo.id/Chabit.png', 356, 13, 2, '2022-01-01 09:18:00', '2022-01-01 09:18:00'),
(221, 'AstronautGo', '{\"blocks\":[{\"key\":\"1fphg\",\"text\":\"AstronautGo merupakan gim dua dimensi, dalam gim ini ada seorang astronaut yang memiliki tujuan untuk mendapatkan sebanyak-banyaknya rocket agar dapat kembali ke bumi. Gim ini hanya dapat dimainkan oleh 1 orang. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":11,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"131qe\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3vo9m\",\"text\":\"Gim ini akan dibangun dengan tema luar angkasa dimana pemain harus terus bergerak dan menembak musuhnya dan menghindari rintangan yang ada. Pemain dapat mengumpulkan rocket sebanyak-banyaknya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":167,\"length\":5,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"ds3qp\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"csv4a\",\"text\":\"Jumlah rocket yang dikumpulkan nantinya akan digunakan sebagai skor pemain,jika bintang tercukupi maka rocket dapat digunakan oleh sang astronaut untuk pulang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":7,\"length\":6,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dh52d\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4hu1u\",\"text\":\"Platformer gim menggunakan PC yang dikendalikan dengan keyboard. Pada tampilan game terdapat background luar angkasa dengan pemandangan galaxy yang indah sebagai bentuk kita menyayangi planet kita.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":14,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AstronautGo.png', 'https://youtu.be/or99fU2ZVLI', '', 'https://api.informatics-expo.id/AstronautGo.png', 270, 9, 2, '2022-01-01 09:24:17', '2022-01-02 20:21:54'),
(222, 'YukBisnis!', '{\"blocks\":[{\"key\":\"9l7ff\",\"text\":\"Wanna be an entrepreneur but got stuck on finding a nice idea? Well, others share their ideas on YukBisnis!, so people like you can find inspirations! You can share your ideas too, so others can give you the feedbacks you need~ Join the growing community of entrepreneurs on YukBisnis!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":285,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":285,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":285,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":285,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":285,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"a9af5\",\"text\":\"We make no claim, it is all on you! \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'YukBisnis!.jpeg', 'https://youtu.be/8k2JMMY60bc', 'http://yukbisnis-super-sentai.herokuapp.com/', 'https://api.informatics-expo.id/YukBisnis!.jpeg', 362, 8, 2, '2022-01-01 09:47:50', '2022-01-01 19:30:30'),
(223, 'KELASIK', '{\"blocks\":[{\"key\":\"1kvv5\",\"text\":\"Di Masa Pandemi saat ini,banyak siswa yang merasa tertinggal atau tidak mengerti tentang pelajaran di sekolah dikarenakan pembelajaran yang dilakukan secara daring,solusinya mau tidak mau mereka harus mendaftar di bimbingan belajar,masalah yang sering muncul adalah banyak pelajar tidak mendapatkan kuota di bimbel tersebut dan biaya bimbel yang terbilang mahal,selain itu juga karena banyak pelajar yang lebih menyukai pembelajaran secara privat,tetapi kebanyakan hanya berasal dari kenalan guru atau teman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9rdb1\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"kb5f\",\"text\":\"Oleh Karena itu,Kami membuat solusi berupa aplikasi KELASIK. KELASIK merupakan aplikasi pencari pengajar privat yang tidak dipungut biaya dan menampilkan banyak fitur-fitur untuk mencari pengajar privat sehingga mereka dapat memilih belajar apa,metode pembelajaran seperti offline atau online,serta partisipan pembelajaran dan fitur lain seperti materi,informasi universitas,games,quiz,dll yang user friendly dan dapat diakses oleh semua pelajar yang membutuhkan pengajar privat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dmkci\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8jk1c\",\"text\":\"Aplikasi ini diharapkan dapat menyelesaikan masalah yang dapat membantu para pelajar dalam menambah pengetahuan baru dan ilmu  baru yang tidak diajarkan disekolah serta aplikasi ini dapat menyediakan lapangan pekerjaan bagi para pengajar yang belum memiliki pekerjaan dikarenakan susahnya mencari pekerjaan di masa pandemi saat ini.Harapannya aplikasi ini dapat membuat pelajar menjadi mandiri dan memiliki kebebasan untuk dapat belajar dan memilih pengajar yang diinginkan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"22gbe\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9uv1u\",\"text\":\"Konsep aplikasi kami berbeda dengan aplikasi pendidikan lainnya seperti ruangguru,Zenius,dll karena kami ingin menciptakan inovasi baru dalam dunia pendidikan dan menerapkan pentingnya belajar privat serta mandiri dan bebas dalam memilih pembelajaran yang diinginkan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KELASIK.jpeg', 'https://youtu.be/nDtIAJSmZwU', 'https://www.figma.com/proto/od39QuPw0x7GpA4Vpo1f6y/Aplikasi-Kelasik?node-id=1%3A3&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/KELASIK.jpeg', 367, 4, 2, '2022-01-01 11:17:32', '2022-01-01 11:17:32'),
(224, 'BaliCraft', '{\"blocks\":[{\"key\":\"5n69a\",\"text\":\"Bali Craft merupakan suatu sistem perangkat lunak Ecommerce marketplace yang memberikan fasilitas kepada pelaku UKM agar dapat berpartisipasi mempromosikan lapak dagang serta menjual produk bisnis yang mana merupakan produk khas asli dari bali. Bali Craft dimaksudkan untuk membantu pelaku UKM setempat agar dapat memulihkan kembali perekonomian sekaligus diharapkan dapat membantu program we love Bali movement sehingga dapat bermanfaat untuk perekonomian Bali agar bisa kembali pulih\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":485,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":485,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":485,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":485,\"style\":\"fontfamily-Arial\"},{\"offset\":50,\"length\":21,\"style\":\"ITALIC\"},{\"offset\":390,\"length\":21,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BaliCraft.png', 'https://youtu.be/uODqXr53rC4', 'https://linktr.ee/BaliCraft', 'https://api.informatics-expo.id/BaliCraft.png', 300, 8, 2, '2022-01-01 11:38:12', '2022-01-02 07:29:31'),
(225, 'UKMZone', '{\"blocks\":[{\"key\":\"8ui9r\",\"text\":\"Aplikasi berbasis web untuk jual beli buah-buahan di daerah sekitaran jogjakarta\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKMZone.png', 'https://youtu.be/vTC26eN0pr4', 'https://github.com/hamidibm/EXPO--FutureRoad', 'https://api.informatics-expo.id/UKMZone.png', 302, 8, 2, '2022-01-01 11:42:32', '2022-04-12 06:39:41'),
(226, 'Healthy Life', '{\"blocks\":[{\"key\":\"9k2ds\",\"text\":\"Menurut data WHO dan UNICEF menyebutkan bahwa saat ini jumlah orang dewasa yang kelebihan berat badan di Indonesia telah berlipat ganda selama dua dekade terakhir. Obesitas pada anak-anak juga meningkat dengan satu dari lima anak usia sekolah dasar dan satu dari tujuh usia remaja di Indonesia kelebihan berat badan menurut Survei Riset Kesehatan Dasar (RISKESDAS) nasional tahun 2018. Oleh karena itu, Healthy Life dikembangkan untuk mengatasi beberapa permasalahan tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":476,\"style\":\"color-black\"},{\"offset\":0,\"length\":476,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":476,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3dd08\",\"text\":\"Healthy Life merupakan sebuah aplikasi mobile yang bergerak pada bidang kesehatan. Aplikasi ini nantinya akan menyediakan berbagai macam fitur kesehatan seperti fitur pengukuran Body Mass Index (BMI), tips dan trik yang dapat membantu pengguna agar bisa hidup lebih sehat, penyedia informasi tentang berbagai macam penyakit gizi, dan fitur workout.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":200,\"style\":\"color-black\"},{\"offset\":201,\"length\":147,\"style\":\"color-black\"},{\"offset\":0,\"length\":200,\"style\":\"fontsize-12pt\"},{\"offset\":201,\"length\":147,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":200,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"},{\"offset\":201,\"length\":147,\"style\":\"fontfamily-Calibri Light\\\", \\\"sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Healthy Life.png', 'https://youtu.be/Y26WweKY67M', '', 'https://api.informatics-expo.id/Healthy Life.png', 255, 18, 2, '2022-01-01 12:11:55', '2022-01-03 21:26:35'),
(227, 'Polaris', '{\"blocks\":[{\"key\":\"eg3r9\",\"text\":\"Masa pandemi sekarang mengubah perilaku manusia terutama di bidang \\npendidikan. Pembelajaran harus berubah menjadi pembelajaran daring dan \\npara murid harus membiasakan diri dengan suasana belajar yang baru. \\nmencari materi pun akan sullit dan jika ingin berlangganan aplikasi \\nbelajar online akan mahal harganya. di situasi seperti ini lah Polaris \\nmuncul\\n\\nPolaris adalah aplikasi pembelajaran online khusus SMA yang berfokus \\npada 3 mata pelajaran, yaitu matematika, bahasa indonesia, dan bahasa \\ninggris. aplikasi ini dibuat sedemikian rupa sehingga dapat dipahami \\noleh semua orang dan aplikasi ini bebas biaya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Polaris.jpeg', 'https://youtu.be/vhaHWBw4IeU', 'https://www.figma.com/proto/f8RSAXtYTurM8bXywGbjgG/POLARIS?node-id=5%3A11&scaling=scale-down&page-id=0%3A1&starting-point-node-id=5%3A11', 'https://api.informatics-expo.id/Polaris.jpeg', 374, 4, 2, '2022-01-01 12:42:18', '2022-01-01 12:42:18'),
(228, 'Escape The Cave', '{\"blocks\":[{\"key\":\"8oc34\",\"text\":\"Di bawah kota Rex City terdapat sebuah gua tersembunyi yang tidak pernah diketahui sebelumnya. Gua tersebut sebelumnya dibuat oleh seorang ilmuwan gila yang melakukan penelitian di dalam gua dan ia menyembunyikan penemuannya  tersebut. Gua tersebut berisi labirin-labirin yang terkunci dan dipenuhi oleh teka-teki. Apabila seseorang memasuki gua tersebut maka harus menyelesaikan labirin-labirin tersebut untuk keluar.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Escape The Cave.jpeg', 'https://youtu.be/tvHiE_JahbQ', '', 'https://api.informatics-expo.id/Escape The Cave.jpeg', 252, 4, 2, '2022-01-01 12:47:30', '2022-01-01 12:47:30'),
(229, 'Funden', '{\"blocks\":[{\"key\":\"7f7oo\",\"text\":\"Funden adalah sebuah aplikasi berbasis web untuk membantu para pelaku UKM untuk mendapatkan donasi/dana dari investor.   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":118,\"style\":\"fontfamily-Helvetica Neue\"},{\"offset\":0,\"length\":121,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Funden.jpeg', 'https://www.youtube.com/watch?v=5msHN1Zfpi0', '', 'https://api.informatics-expo.id/Funden.jpeg', 259, 8, 2, '2022-01-01 12:49:50', '2022-01-01 12:49:50'),
(230, ' KaUM', '{\"blocks\":[{\"key\":\"bvhqo\",\"text\":\"KaUM adalah sebuah aplikasi dibidang pencatatan keuangan dan pengeluaran UMKM yang dimana membantu para usaha kecil dan menengah dalam mengelola pengeluaran dan pemasukan keuangan setiap harinya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', ' KaUM.png', 'https://youtu.be/yI2iUd-YH1Q', '', 'https://api.informatics-expo.id/ KaUM.png', 311, 8, 2, '2022-01-01 12:54:32', '2022-01-01 21:47:42'),
(231, 'Pirate Of Nirvana', '{\"blocks\":[{\"key\":\"d75ib\",\"text\":\"Di sebuah pulau terdapat seorang bajak laut yang bernama Nirvana. Pada suatu hari bajak laut bajak laut Nirvana datang ke sebuah pulau untuk mencari harta Karun yang ada di pulau tersebut. Di dalam perjalanannya Nirvana bertemu dengan monster - monster serta perangkap yangdapat mengganggu perjalanannya untuk mencari harta karun. Untuk berhasil mendapatkan harta karun itu Nirvana harus menghindari perangkap serta melawan serangan monster itu terlebih dahulu.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":462,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":462,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":462,\"style\":\"fontfamily-Calibri\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pirate Of Nirvana.png', 'https://youtu.be/i4qYZRXUK04', '', 'https://api.informatics-expo.id/Pirate Of Nirvana.png', 314, 9, 2, '2022-01-01 13:27:26', '2022-01-01 13:27:26'),
(232, 'Your Trainer', '{\"blocks\":[{\"key\":\"bgb43\",\"text\":\"Your Trainer merupakan aplikasi pendamping workout dan olahraga anda. Pandemi seperti saat ini seharusnya tidak menjadi sebuah halangan untuk kita tetap berolahraga dan menerapkan gaya hidup sehat. Namun, karena pandemi ini juga banyak fasilitas kesehatan yang ditutup serta masyarakat banyak menghabiskan waktunya dirumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1ap5c\",\"text\":\"Your Trainer hadir menjawab permasalahan ini, dengan mengusung konsep 3in1, aplikasi ini membungkus tiga fitur utama yang biasanya terpisah kini menjadi satu dalam aplikasi ini. Fitur yang pertama adalah video workout yang dapat anda gunakan sebagai asisten pribadi anda dari balik layar untuk melakukan olahraga, tersedia ratusan video dan jenis olahraga yang dapat anda pilih agar stay fit walau dari rumah. Fitur \\\"Meal Plan\\\" berisikan palnning makan dan minum anda yang dapt mengatur pola makan sehat yang dapat membantu anda menjaga pola makan, pada fitur ini anda dapat menemukan ratusan resep makan sehat. Dan yang terakhir adalah \\\"Health Center\\\" dan \\\"Schedule\\\", dalam fitur ini anda dapat melihat progres olahraga anda, mengatur jadwal dan melihat banyak tips kesehatan lainnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7u9jj\",\"text\":\"Your Trainer hadir memudahkan hidup anda, tunggu apalagi nantikan kehadiran kami. Teruslah bergerak!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Your Trainer.png', 'https://youtu.be/GtY4cxkaP-Y', 'https://www.figma.com/proto/2tC5mfPCuVs5Gi4VaanVnl/Prototype-Design-Thinking?node-id=304%3A10&scaling=scale-down&page-id=0%3A1&starting-point-node-id=304%3A10', 'https://api.informatics-expo.id/Your Trainer.png', 318, 3, 2, '2022-01-01 13:35:09', '2022-01-01 13:35:09'),
(233, 'Inflow', '{\"blocks\":[{\"key\":\"9chns\",\"text\":\"INFLOW adalah sebuah aplikasi mobile (mobile app) yang berisi tentang perkembangan seputar dunia entertainment khususnya video game. Dengan INFLOW pengguna dapat membaca dan menulis review video game, dan juga berinteraksi dengan review tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Inflow.png', 'https://rebrand.ly/inflowVideo', '', 'https://api.informatics-expo.id/Inflow.png', 388, 9, 2, '2022-01-01 13:59:10', '2022-01-02 23:31:27'),
(234, 'Start Up', '{\"blocks\":[{\"key\":\"ddff7\",\"text\":\"Start Up merupakan sebuah program yang melayani investasi berbasis website. Dalam perkembangan jaman saat ini teknologi makin hari semakin menggila atau bisa dikatakan semakin canggih, salah satunya adalah dalam berinvestasi. Dan Start Up hadir dan fokus kepada investasi UKM. investor dapat berinvetasi dengan sangat mudah, karena hal tersebut bisa dilakukan secara daring atau online.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Start Up.png', 'https://youtu.be/YVKAXI4TZ58', 'https://docs.google.com/presentation/d/1zK5UxIWEeDYhIEO871DtTZhj-TdtU7L8N8SD0eh5J6E/edit#slide=id.g10b595daf6e_0_109', 'https://api.informatics-expo.id/Start Up.png', 389, 9, 2, '2022-01-01 14:10:24', '2022-01-02 21:00:07'),
(235, 'PENKU', '{\"blocks\":[{\"key\":\"f8ka\",\"text\":\"Masyarakat di Indonesia sangat banyak yang bergantung pada pekerjaan UKM, tetapi terdapat masalah yang banyak dialami oleh pelaku UKM. Salah satu masalah utama pelaku UKM yaitu kesulitan dalam mengatur keuangan seperti, mengatur pengeluaran, pendapatan, keuntungan dan kerugian penjualan produk para UKM dan juga banyak ukm yang mengalami kehilangan data dikarenakan masih menggunakan pencatatan manual.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":403,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":403,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":403,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":403,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"42hg8\",\"text\":\"Maka dari itu PENKU hadir untuk Anda!!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b43f8\",\"text\":\"PENKU atau Pengatur Keuangan adalah aplikasi berbasis website untuk melakukan pencatatan keuangan seperti mencatat pendapatan dan pengeluaran bagi pelaku ukm di Yogyakarta agar memudahkan dalam menunjang usaha kedepannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":221,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":221,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":221,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":221,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PENKU.png', 'https://youtu.be/ao05CB6oEFM', '', 'https://api.informatics-expo.id/PENKU.png', 387, 8, 2, '2022-01-01 14:13:20', '2022-01-01 14:13:20'),
(236, 'BISA (Business Idea Sharing Application)', '{\"blocks\":[{\"key\":\"92sf4\",\"text\":\"Sebuah platform untuk  mempertemukan masyarakat yang memiliki ide bisnis dengan masyarakat luar yang sedang mencari ide bisnis dan juga memungkinkan masyarakat luar untuk melakukan kerja sama dengan pemilik ide dalam bentuk franchise.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISA (Business Idea Sharing Application).png', 'https://youtu.be/KUooCLwgxZs', '', 'https://api.informatics-expo.id/BISA (Business Idea Sharing Application).png', 390, 8, 2, '2022-01-01 14:56:14', '2022-01-01 14:56:14'),
(237, 'FlagQuizz', '{\"blocks\":[{\"key\":\"9tjs2\",\"text\":\"Aplikasi ini merupakan aplikasi quiz mengenai bendera-bendera untuk siswa Sekolah Dasar dari 4-6 yang masih bingung bentuk bendera negara di dunia ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FlagQuizz.png', 'https://youtu.be/U1Rxq1V8Yjk', '', 'https://api.informatics-expo.id/FlagQuizz.png', 373, 4, 2, '2022-01-01 14:56:18', '2022-01-01 14:56:18'),
(238, '2nd\'Chance', '{\"blocks\":[{\"key\":\"3en2t\",\"text\":\"Kita saat ini berada pada \\\"Kode Merah\\\" untuk umat manusia di bumi, karenanya UN (United Nations) menggagas SDG ( Sustainable Development Goals) yang memiliki 17 Goals, dan pada proyek ini kami mengambil goal nomor 13 yaitu Climate Action. Dengan majunya teknologi dan semakin banyaknya informasi yang tersedia di internet. Kedua kemajuan di aspek ini dapat memberi dampak baik dan buruk juga. Saat ini dengan banyaknya informasi yang bersebaran di internet, pengguna internet dapat menemukan banyak informasi juga seputar perubahan iklim, namun karena banyaknya informasi juga dapat membuat seseorang kewalahan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"442gf\",\"text\":\"2nd\'Chance adalah aplikasi untuk membantu seseorang mengetahui tindakan apa saja yang dapat dilakukan individu dengan mudah untuk mengurangi dampak perubahan iklim, serta menambah teman yang memiliki keinginan yang sama. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"bqvm5\",\"text\":\"Aplikasi Kami pun memiliki beberapa fitur yang bisa digunakan oleh para pengguna kami:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"b0cbf\",\"text\":\"-\\tFitur Lonceng\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"f8266\",\"text\":\"Fitur Lonceng memungkin pengguna untuk mendapatkan pengingat/alarm dari aksi yang telah dipilih oleh pengguna setelah melihat keterangan dari aksi dan melihat tips bagaimana cara untuk melakukan tindakan tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"3dnlg\",\"text\":\"-\\tFitur Peringkat Mingguan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"b87do\",\"text\":\"Fitur Peringkat Mingguan memungkinkan pengguna untuk mendapatkan motivasi dan semangat yang lebih untuk melakukan aksi yang tertera pada aplikasi kami. Kami juga memberikan 3 peringkat spesial untuk para pengguna yaitu jika pengguna berada di posisi pertama pengguna akan mendapatkan gold medal, jika pengguna berada di posisi kedua pengguna akan mendapatkan silver medal, dan jika pengguna berada di posisi ketiga pengguna akan mendapatkan bronze medal.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"459ju\",\"text\":\"-\\tFitur Eksplorasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"8uvji\",\"text\":\"Fitur Eksplorasi memungkinkan pengguna untuk melihat apa yang dikatakan pengguna lainnya dengan topik yang luas karena kami tidak membatasi ruang diskusi yang ada.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5o0jh\",\"text\":\"-\\tFitur Tambah Teman\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"e0q01\",\"text\":\"Fitur Tambah Teman memungkinkan pengguna untuk menambahkan teman dari berbagai macam level dan peringkat. Jika pengguna sudah menambah teman, pengguna bisa melihat peringkat apa saja yang telah dicapai oleh pengguna tersebut \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5bmdi\",\"text\":\"-\\tFitur Berdasarkan Kategori\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5o0sn\",\"text\":\"Fitur Berdasarkan Kategori memungkinkan pengguna untuk mensortir aksi yang ingin dilihat berdasarkan kategori yang ada yaitu makanan, transportasi, sumber daya, Luar Ruangan, dan komunitas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"divp6\",\"text\":\"-\\tFitur Kostumisasi Profil\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"4u6da\",\"text\":\"Fitur Kostumisasi Profil memungkinkan pengguna untuk mengkostumisasi profilnya sesuai keinginan pengguna seperti info/bio dan gambar profil.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"6q1j\",\"text\":\"-\\tFitur XP (experience point)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"710m3\",\"text\":\"Fitur XP (experience point) memungkinkan pengguna untuk mendapatkan poin disetiap aksi yang sudah dilakukan oleh pengguna itu sendiri. Poin ini juga akan direpresentasikan oleh level yang dimiliki pengguna itu sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', '2nd\'Chance.png', 'https://youtu.be/zSAe87HRUUU', 'https://www.figma.com/proto/AKJ16hVXRRnGub4NxRU0Jx/2nd\'Chance?node-id=15%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=15%3A2', 'https://api.informatics-expo.id/2nd\'Chance.png', 397, 13, 2, '2022-01-01 15:11:33', '2022-01-01 16:01:34'),
(239, 'GYM Care', '{\"blocks\":[{\"key\":\"39tgr\",\"text\":\"Sebuah aplikasi yang bisa memberikan reminder untuk melakukan aktivitas olahraga bagi pengguna. Kita juga dapat melakukan konsultasi dengan instruktur olahraga guna menemukan pola olahraga yang sesuai dengan aktivitas harian kita. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":230,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":230,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":230,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":230,\"style\":\"fontfamily-Calibri, sans-serif\"},{\"offset\":37,\"length\":8,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GYM Care.jpeg', 'https://youtu.be/k3KB5fbLyZw', '', 'https://api.informatics-expo.id/GYM Care.jpeg', 398, 18, 2, '2022-01-01 15:15:49', '2022-01-02 14:57:24'),
(240, 'SCHEFOC', '{\"blocks\":[{\"key\":\"7m170\",\"text\":\"Pada masa pandemi ini kegiatan pembelajaran mulai dilaksanakan secara online atau daring. Banyak sekali masalah yang dihadapi dalam pembelajaran daring ini salah satunya adalah terlambat, seperti terlambat dalam masuk pertemuan sinkron, terlambat dalam mengumpulkan tugas, dan terlambat dalam ujian.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"21ljp\",\"text\":\"Oleh karena itu kami membuat aplikasi yaitu SCHEFOC yang dapat membantu mengatasi permasalahan tersebut. SCHEFOC merupakan aplikasi penjadwalan yang dikhususkan untuk menjadwalkan kegiatan pembelajaran online mulai dari pertemuan sinkron dari google meet, zoom, dan sebagainya. Juga membantu menjadwalkan untuk pengumpulan tugas dan quiz dan pelaksanaan ujian. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fndn7\",\"text\":\"Aplikasi ini menghadirkan beberapa fitur seperti scheduler. Scheduler merupakan fitur utama yang ada diaplikasi kami. fitur ini membantu kita untuk membuat jadwal dan menampilkan jadwal tersebut. Selanjutnya adalah Reminder, fitur ini dapat membantu kita untuk mengingatkan jadwal yang sudah kita buat. Aplikasi ini tidak seperti Google Kalender atau Kalender pada umumnya karena aplikasi ini dibuat khusus pembelajaran online sehingga tampilannya lebih sederhana dan mudah untuk digunakan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SCHEFOC.png', 'https://youtu.be/SyeWkpUICIE', 'https://www.figma.com/proto/oddU78k5ReyVOSsVuc9Vew/Schefoc-(Scheduler-for-online-class)?page-id=0%3A1&node-id=1%3A41&viewport=241%2C48%2C0.5&scaling=scale-down&starting-point-node-id=1%3A41&hotspot-hints=0', 'https://api.informatics-expo.id/SCHEFOC.png', 308, 4, 2, '2022-01-01 15:34:01', '2022-01-01 15:34:01'),
(241, 'BuyMe', '{\"blocks\":[{\"key\":\"5aacu\",\"text\":\"BuyMe, aplikasi jual beli produk UKM berbasis web merupakan aplikasi yang memiliki tujuan untuk menciptakan media yang dapat memperkenalkan produk-produk UKM, termasuk memfasilitasi masyarakat untuk membeli produk-produk ini karena para Usaha Kecil dan Menengah masih kurang dilirik oleh masyarakat, padahal UKM atau Usaha Kecil dan Menengah dapat menjadi salah satu sektor bisnis yang menggerakkan roda perekonomian masyarakat dan secara kualitas, produk-produk luaran UKM ini memiliki banyak keunggulan, termasuk dari sisi harga yang tentunya lebih terjangkau dibandingkan produk yang dihasilkan oleh usaha-usaha besar. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7i2ct\",\"text\":\"BuyMe memiliki beberapa fitur yang diharapkan dapat membantu para pengusaha UKM untuk mengembangkan produk-produknya serta memudahkan para pelanggan untuk dapat berbelanja dengan aman dan nyaman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BuyMe.png', 'https://youtu.be/pBtL1i1Na0U', 'https://youtu.be/pBtL1i1Na0U?t=68', 'https://api.informatics-expo.id/BuyMe.png', 400, 8, 2, '2022-01-01 15:42:01', '2022-01-01 15:42:01'),
(242, 'Koma,', '{\"blocks\":[{\"key\":\"d6121\",\"text\":\"Sistem KOMA adalag sebuah platform marketplace untuk jual beli khusus produk bahan bangunan. Fokus utama UTAMA disamping sistem jual belinya adalah mendorong kompetisi antar penjual melalui fitur leaderboard dan badge berbasis ulasan dari pembeli.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dj3ov\",\"text\":\"Leaderboard adalah sebuah fitur untuk mengurutkan nilai ulasan toko untuk setiap kategori. Kategori yang diberikan meliputi : tingkat kecepatan respon pesan, keramahan, kualitas pengemasan, serta kesesuain deskripsi dan foto terhadap produk yang sudah dibeli. Sedangkan badge adalah penanda bagi setiap toko apabila toko tersebut memiliki nilai yang bagus pada kategori penilaian yang ada. Diharapkan dengan adanya kedua fitur tersebut dapat mendorong penjual untuk selalu meningkatkan layanan dan produk yang diberikan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Koma,.jpeg', 'https://youtu.be/lLWWiXmbEuE', 'https://github.com/farizbaiquni/marketplace-to-buy-and-sell-building-materials', 'https://api.informatics-expo.id/Koma,.jpeg', 365, 17, 2, '2022-01-01 16:03:17', '2022-01-01 16:03:17');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(244, 'MyOcean', '{\"blocks\":[{\"key\":\"1dei3\",\"text\":\"MyOcean adalah Aplikasi yang berguna dalam upaya membantu melestarikan kebersihan laut yang berbasis edukasi serta pemasaran produk-produk daur ulang dari limbah pesisir. Dari pada membuang dan membiarkan sampah berserakan di pantai, Anda dapat memanfaatkannya kembali lalu menjualnya. \\n\\nUntuk mendapatkan inspirasi mengenai produk yang akan dijual, Anda dapat menonton video-video edukasi dari aplikasi ini. Lalu, Anda bisa menjual hasil karya/kerajinan yang dibuat di aplikasi ini juga. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":490,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2af3o\",\"text\":\"HOME/BERANDA \\n\\nPada beranda terdapat fitur-fitur: \\n\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":51,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"frsbh\",\"text\":\"Pasar : untuk jual beli produk daur ulang sampah pesisir ataupun sampah pesisir itu sendiri yang masih bisa dimanfaatkan.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":121,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fr4o1\",\"text\":\"Video Edukasi : berisi video-video edukasi tentang cara melestarikan laut serta pengelolaan dan pemanfaatan sampah pesisir. Anda dapat mencari ide bisnis produk kerajinan dari video-video yang tersedia. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":203,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"e2ck1\",\"text\":\"History : berisi riwayat pembelian, penjualan, dan tontonan video. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":67,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"cm6st\",\"text\":\"Berita : berisi berita terkini tentang kelautan/kemaritiman. \\n\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":62,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b085\",\"text\":\"INBOX : \\n\\nPada Inbox terdapat fitur-fitur: \\n\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":44,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"do6uj\",\"text\":\"Chat : terdapat dua fitur yaitu percakapan pengguna sebagai pembeli dan percakapan pengguna sebagai penjual. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":109,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bruia\",\"text\":\"Notification : berisi notifikasi yang dikirimkan kepada pengguna sebagai pembeli dan juga penjual. \",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":99,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3o5ru\",\"text\":\"MENU UTAMA : \\n\\nPada Menu Utama  terdapat fitur-fitur:\\n \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":55,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7eg3\",\"text\":\"Akun : untuk melihat dan mengubah informasi akun.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":49,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"1e3qh\",\"text\":\"Toko Saya : untuk membuat toko dan menjual produk daur ulang/kerajinan dari sampah pesisir.\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":91,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6d1se\",\"text\":\"Log Out : untuk keluar dari aplikasi\",\"type\":\"unordered-list-item\",\"depth\":1,\"inlineStyleRanges\":[{\"offset\":0,\"length\":36,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MyOcean.jpeg', 'https://youtu.be/Wx31oaHfAHE', 'https://www.figma.com/proto/HstJEMn7r5sm1deraD609l/Project-LINUX?node-id=65%3A188&scaling=scale-down&page-id=3%3A25&starting-point-node-id=65%3A188', 'https://api.informatics-expo.id/MyOcean.jpeg', 401, 14, 2, '2022-01-01 16:09:36', '2022-01-01 20:01:37'),
(248, 'FunMath', '{\"blocks\":[{\"key\":\"9rq24\",\"text\":\"Funmath adalah sebuah game edukasi yang asik, tidak membosankan, dan dapat membantu anak meningkatkan kemampuannya dalam mengasah keterampilan menghitung operasi dasar matematika seperti bilangan penjumlahan, pengurangan, perkalian, pembagian.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FunMath.jpeg', 'https://youtu.be/D_lFaC6Z11U', 'https://youtu.be/iNmw4RpwYAA', 'https://api.informatics-expo.id/FunMath.jpeg', 391, 4, 2, '2022-01-01 16:52:56', '2022-01-01 16:52:56'),
(249, 'Mari Kerja ', '{\"blocks\":[{\"key\":\"drbvb\",\"text\":\"Mari Kerja merupakan aplikasi untuk mencari lowongan pekerjaan dengan mudah. Tersedia berbagai fitur seperti jenis pekerjaan yang dipilih,gaji dan riwayat pekerjaan yang di lamar. Aplikasi ini juga menyediakan fitur untuk orang orang yang sedang mencari karyawan. Semoga aplikasi ini dapat membantu dan mempermudah anda untuk mencari pekerjaan dan mencari karyawan \",\"type\":\"code\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'Mari Kerja .png', 'https://youtu.be/EE42MYH99dw', 'https://www.figma.com/proto/4nOh2voEoQcplXLl5VbnMS/Project-Satam-Stone-1-Final?node-id=1%3A2&scaling=scale-down&page-https://www.figma.com/proto/4nOh2voEoQcplXLl5VbnMS/Project-Satam-Stone-1-Final?node-id=1%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Mari Kerja .png', 403, 8, 2, '2022-01-01 16:56:31', '2022-01-01 16:56:31'),
(250, 'SCHOOLARIA', '{\"blocks\":[{\"key\":\"3unk9\",\"text\":\"Di era teknologi yang serba canggih ini, dimana kita dapat dengan mudah untuk mendapatkan informasi dan akses belajar. Salah satunya untuk kebutuhan mahasiswa dalam hal kelancaran proses belajar dan mengajar.\\n\\nMelihat masalah tersebut, kami Voyager Spacecraft menciptakan Schoolaria dengan tujuan untuk mendukung kegiatan belajar dan mengajar mahasiswa di kampus maupun diluar kampus, memperkenalkan kualitas teknologi dalam pendidikan, dan membantu proses belajar mahasiwa tanpa batasan ruang dan waktu.\\n\\nSchoolaria menggunakan konsep yang semenarik mungkin yang bisa membuat suasana yang menyenangkan, dan tanpa kejenuhan.\\n\\nTim kami berharap dapat membantu pengguna untuk tumbuh dan berkembang dengan wawasan lingkungan yang berdimensi kosmologis, sosiologis dan teologis. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":774,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":774,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":774,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":774,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SCHOOLARIA.jpeg', 'https://youtu.be/pOGUb8eV_Tc', 'https://www.figma.com/proto/CbQHoikdN4bUs601C3dUa6/VoyagerSpaceCraft?node-id=365%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A3', 'https://api.informatics-expo.id/SCHOOLARIA.jpeg', 411, 4, 2, '2022-01-01 17:01:11', '2022-01-01 17:01:11'),
(251, 'dr.Nabah the story of kampung singa', '{\"blocks\":[{\"key\":\"8rt54\",\"text\":\"Seorang dokter muda mendedikasikan hidupnya untuk membantu mengobati warga di sebuah kampung bernama kampung singa , dikampung ini masi mempercayai hubungan penyakit dengan mistis akibat pengaruh dari seorang dukun yang ada di desa itu.nabah datang untuk memperkenalkan pengobatan sains modern dan membebaskan warga desa dari pengaruh yang tidak baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'dr.Nabah the story of kampung singa.jpeg', 'https://youtu.be/WCfCPhLpcsk', 'https://drive.google.com/file/d/1pb1baM5Wjjfd35O0x-rNHz7JePla0iNC/view?usp=sharing', 'https://api.informatics-expo.id/dr.Nabah the story of kampung singa.jpeg', 412, 18, 2, '2022-01-01 17:04:19', '2022-01-02 17:04:35'),
(252, 'Invest Saiki', '{\"blocks\":[{\"key\":\"e6d64\",\"text\":\"Invest Saiki adalah aplikasi berbasis web yang berguna untuk memfasilitasi masyarakat untuk berinvestasi ke usaha kecil atau menengah(UKM).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Invest Saiki.png', 'https://www.youtube.com/watch?v=g5ZzrX522qY', '', 'https://api.informatics-expo.id/Invest Saiki.png', 415, 1, 2, '2022-01-01 17:24:37', '2022-01-01 17:24:37'),
(253, 'e-WalletQ', '{\"blocks\":[{\"key\":\"6vcl6\",\"text\":\"e-WalletQ adalah platform berbasis mobile app untuk membantu pengguna dalam melakukan manajemen keuangannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7legv\",\"text\":\"Platform ini berfungsi dalam membantu manajemen keuangan. Membantu dalam menabung dan juga membantu pengguna dalam mewujudkan pembelian barang yang ingin dibeli. Akan ada rekomendasi pilihan yang diberikan kepada pengguna untuk opsi jangka waktu dan juga nominal repetitif tabungan agar barang yang diinginkan dapat dibeli. Ketika barang yang diinginkan dapat dibeli aplikasi akan memberikan reward seperti voucher yang dapat ditukarkan saat pembelian barang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":459,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":459,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":459,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":459,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e-WalletQ.png', 'https://www.youtube.com/watch?v=KKwpWtU6YzE', 'https://www.youtube.com/watch?v=VSIOQEJcUgY&t=9s', 'https://api.informatics-expo.id/e-WalletQ.png', 417, 17, 2, '2022-01-01 17:28:20', '2022-01-01 17:37:02'),
(254, 'JiwaKu', '{\"blocks\":[{\"key\":\"d7uee\",\"text\":\"JiwaKu adalah platform edukasi dan konsultasi yang bertujuan untuk meningkatkan akses publik terhadap layanan kesehatan mental. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6cs1p\",\"text\":\"1. All in one app : Dengan fitur utama edukasi dan konseling, JiwaKu memiliki fitur tambahan lainnya, seperti nomor darurat konseling pencegahan bunuh diri, meditasi, rumah sakit terdekat, tantangan, dan catatan kebaikan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4toqb\",\"text\":\"2. Layanan konseling gratis: Untuk berpartisipasi dalam mengurangi ketimpangan akses layanan kesehatan mental, JiwaKu menyediakan fitur konseling gratis yang akan didampingi oleh tenaga profesional berpengalaman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"40hd0\",\"text\":\"3. Pusat informasi yang up to date: Segala informasi yang ada pada aplikasi JiwaKu akan diupdate secara berkala, jadi jangan khawatir tertinggal informasi seputar kesehatan mental, ya!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JiwaKu.png', 'https://youtu.be/MRwy9cpYgf4', 'https://www.figma.com/proto/CHz0Vt2bZoDnZiQZaRZhnK/JiwaKu?page-id=0%3A1&node-id=52%3A77&viewport=241%2C48%2C0.5&scaling=scale-down&starting-point-node-id=240%3A165', 'https://api.informatics-expo.id/JiwaKu.png', 414, 3, 2, '2022-01-01 17:32:56', '2022-01-01 17:32:56'),
(255, 'BisnisYuk', '{\"blocks\":[{\"key\":\"8k9vj\",\"text\":\"Sebuah media bagi para peminat bisnis untuk saling berdiskusi seputar dunia bisnis, dan untuk mempermudah para pebisnis untuk menjalin kerjasama dengan investor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BisnisYuk.jpeg', 'https://youtu.be/xPdHKUy3044', '', 'https://api.informatics-expo.id/BisnisYuk.jpeg', 416, 8, 2, '2022-01-01 17:47:31', '2022-01-01 17:52:34'),
(256, 'Hewanku ', '{\"blocks\":[{\"key\":\"292rv\",\"text\":\"\\n\\nDalam mengelola kesehatan hewan piaraan Anda, penting untuk tetap terinformasi dan teratur. Aplikasi \\\"HEWANKU\\\" mengatur piaraan Anda tetap sehat dengan menaruh semua informasi yang dibutuhkan di satu tempat. Ini alat yang bagus untuk siapa saja dengan satu hewan peliharaan, beberapa hewan peliharaan, dan mereka yang memiliki banyak perawatan hewan peliharaan penyedia termasuk dokter hewan, groomer, walker, pengasuh, dan banyak lagi.\\n\\nkami menerapkan beberapa fitur yaitu:\\n\\nCEK KONDISI HEWAN\\nidentifikasi penyakit dan gejala hewan jadi lebih mudah, menyediakan beberapa produk makanan hewan terpilih supaya kondisi hewan peliharaan tetap terjaga.\\n\\nINFORMASI KLINIK HEWAN DAN RUMAH SAKIT HEWAN \\npara user bisa mengetahui informasi seputar klinik hewan dan rumah sakit hewan terdekat jadi pengguna bisa ketempat dimana hewan Anda bisa dirawat. Para user bisa berkonsultasi secara daring dengan dokter hewan, atau membuat jadwal pertemuan dengan dokter hewan sesuai hari dan tanggal yang kita inginkan.\\n\\nEKSPLOR DAN BERGABUNG DENGAN SEBUAH KOMUNITAS\\nbangun sebuah komunitas dimana para user bisa bebas berekspresi, dan berbagi momen-momen yang menarik seputar hewan peliharaan Anda, dll.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hewanku .jpeg', 'https://www.youtube.com/watch?v=5dXo1URG3TI&t=23s', 'https://www.figma.com/proto/lsb8WwBh7Rl41RJNlO5ygi/Animaru-UI-(Community)?page-id=0%3A1&node-id=1%3A363&viewport=241%2C48%2C1.12&scaling=scale-down&starting-point-node-id=1%3A363', 'https://api.informatics-expo.id/Hewanku .jpeg', 421, 18, 2, '2022-01-01 17:54:49', '2022-01-01 17:54:49'),
(257, 'E-nake', '{\"blocks\":[{\"key\":\"ddv47\",\"text\":\"E-nake adalah sebuah social media dengan memiliki tujuan untuk masyarakat bisa dengan mudah menemukan, hidden gem atau tempat makan kaki lima yang murah dan enak\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-nake.png', 'https://youtu.be/5xvG3h8Sg_U', '', 'https://api.informatics-expo.id/E-nake.png', 420, 12, 2, '2022-01-01 17:58:36', '2022-01-01 17:58:36'),
(258, 'Celana Kotak-Run', '{\"blocks\":[{\"key\":\"e2pq3\",\"text\":\"Game yang terinspirasi dari kartun Nickelodeon yaitu spongebob, game ini bercerita tentang spongebob yang harus berlari ketempat kerja dengan menghindari beberapa obstacle dan juga harus mendapatkan skore setinggi-tingginya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Celana Kotak-Run.jpeg', 'https://youtu.be/wvxWE2Lki6w', '', 'https://api.informatics-expo.id/Celana Kotak-Run.jpeg', 422, 14, 2, '2022-01-01 18:12:19', '2022-01-01 18:12:19'),
(259, 'Donasi Disini', '{\"blocks\":[{\"key\":\"91bnk\",\"text\":\"Dasi merupakan aplikasi online berbasis mobile yang bertujuan untuk membantu dalam kegiatan donasi terutama dalam keadaan pandemi yang mengharuskan melakukan kegiatan dari rumah atau online. Selain itu dasi juga bertujuan untuk mempermudah dalam pengajuan donasi dan pengiriman donasi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Donasi Disini.png', 'https://youtu.be/eYv03hgk780', 'https://github.com/KKP21/PAB.git', 'https://api.informatics-expo.id/Donasi Disini.png', 246, 17, 2, '2022-01-01 18:26:43', '2022-01-02 22:22:45'),
(261, 'Disc Geek', '{\"blocks\":[{\"key\":\"ekjjs\",\"text\":\"Disk Geeks Store adalah suatu website untuk mempermudah konsumen dalam mencari dan membeli CD musik album agar dapat dilihat oleh masyarakat luas.Produk yang dijual biasanya berwujud gambar yang disertai segala bentuk keterangan barang yang interaksi penjual dan pembelinya dilakukan secara tertulis di forum virtual dalam situs terkait dan pembayarannya dilakukan dengan cara mentransfer sejumlah uang dalam rekening penjual. Melalui online shop pembelian dapat dilakukan tanpa terbatas oleh tempat. Seseorang yang berada di salah satu negara dapat melakukan pembelian barang yang berada di negara lain dengan mudah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Disc Geek.jpeg', 'https://youtu.be/A9-vZ6AUGLg', 'https://github.com/abdulzzm/Disc-Geek', 'https://api.informatics-expo.id/Disc Geek.jpeg', 298, 8, 2, '2022-01-01 18:55:47', '2022-01-01 18:55:47'),
(262, 'Restoran Binjai', '{\"blocks\":[{\"key\":\"9arei\",\"text\":\"Restoran Binjai adalah aplikasi E-Commmerce berbasis web untuk melakukan pembelian dan penjualan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Binjai, penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat dan para pembeli yang menginginkan suatu makanan bisa memesannya dari mana saja dan kapan saja. Dan untuk pelaku UKM sendiri bisa memperluas jangkauan customer yang selama ini terhalan oleh jarak dan waktu\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Binjai.png', 'https://youtu.be/CX5Z8ZtxKpc', 'https://www.canva.com/design/DAEzEG6P9gQ/NMpotMdnelTlC2bVn085kQ/view?utm_content=DAEzEG6P9gQ&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/Restoran Binjai.png', 344, 9, 2, '2022-01-01 19:01:29', '2022-01-01 19:01:29'),
(263, 'GROW UP', '{\"blocks\":[{\"key\":\"7r81m\",\"text\":\"Project ini akan mengembangkan sebuah aplikasi dengan nama Grow Up. Grow Up\\nmerupakan aplikasi berbagi ide bisnis yang terbuka untuk siapa saja. Di Dalam aplikasi\\npengguna dapat mencurahkan ide bisnisnya sehingga di kemudian waktu ide bisnis tersebut\\ndilihat oleh investor yang juga merupakan bagian dari pengguna. Nantinya penyumbang ide\\nakan bernegosiasi dengan investor untuk tindak lanjut ide yang sudah disepakati. Pengguna\\njuga dapat berdiskusi dengan komunitas untuk mematangkan ide bisnis. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GROW UP.png', 'https://youtu.be/lYYYRiYy-t4', '', 'https://api.informatics-expo.id/GROW UP.png', 425, 8, 2, '2022-01-01 19:09:38', '2022-01-01 19:09:38'),
(264, 'TRASH - IN', '{\"blocks\":[{\"key\":\"2iqer\",\"text\":\"TRASH-IN adalah platform untuk penjemputan sampah terpilah berbasis teknologi yang diimplementasikan dalam bentuk aplikasi digital menggunakan smartphone. Aplikasi TRASH-IN juga memuat berbagai informasi terkait masalah sampah atau masalah kebersihan lingkungan, juga sebagai tempat untuk mengajukan sebuah fasilitas kebersihan kepada pihak terkait. Aplikasi ini bertujuan untuk membantu masyarakat agar dapat menghemat waktunya ketika akan membuang sampah tanpa harus keluar rumah, menjaga keseimbangan lingkungan akibat pembuangan sampah sembarangan dan untuk peningkatan kualitas kebersihan lingkungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":9,\"style\":\"BOLD\"},{\"offset\":164,\"length\":8,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TRASH - IN.jpeg', 'https://youtu.be/HvX6EdHLUIk', 'https://www.figma.com/proto/dQeV7ah3kJZQl8d5u6Cp8N/RYZEN?node-id=18%3A6&scaling=scale-down&page-id=18%3A4&starting-point-node-id=18%3A6&show-proto-sidebar=1', 'https://api.informatics-expo.id/TRASH - IN.jpeg', 413, 12, 2, '2022-01-01 19:34:46', '2022-01-02 15:54:34'),
(266, 'Edulock', '{\"blocks\":[{\"key\":\"ah91f\",\"text\":\"Edulock merupakan aplikasi yang ditujukan untuk mengurangi kecanduan anak dengan membatasi penggunaan smartphone dengan cara yang unik yaitu aplikasi edulock akan dapat disetel untuk mengunci aplikasi yang diinginkan oleh orang tua dan anak harus mengerjakan soal-soal edukasi untuk membuka aplikasi yang terkunci.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Edulock.png', 'https://youtu.be/wmfzO6S_gvc', 'https://drive.google.com/file/d/1oMMktLsDXkRJWxr0gCzxca6Mnty2g-QO/view?usp=sharing', 'https://api.informatics-expo.id/Edulock.png', 372, 4, 2, '2022-01-01 19:50:15', '2022-01-01 19:50:15'),
(267, 'Fets - Animal Care', '{\"blocks\":[{\"key\":\"152vn\",\"text\":\"Everything necessary to take care of your animal is here. For farm animals and companion animals.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96if2\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"46oog\",\"text\":\"Taking care for the needs and health of our animals can be difficult sometimes. With our most complete animal-care digital platform, Fets will help you take better care for your animals in a more convenient way.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8uki2\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5bpqp\",\"text\":\"Fets\' features are specifically designed to help you with everything you might need for your animals:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f3pko\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"77jel\",\"text\":\"1. Grooming\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9hcf2\",\"text\":\"2. Pet Adoption\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"89l0m\",\"text\":\"3. Vaccination\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3983s\",\"text\":\"4. Reminders for medication, food and appointments\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2sbi1\",\"text\":\"5. Online/Face-to-face consultation\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bl8g5\",\"text\":\"6. Pet profile that you can share to your veterinarian or pet-sitter\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"317ed\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"btu44\",\"text\":\"And many more! We know that caring for your animals has never been so easy. That\'s why we from Paradigm Shifter have developed the best application to help you with that. Come join us with more than 100 petshops and veterinarians partnered with our application.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fets - Animal Care.png', 'https://youtu.be/ug8U0sJIhho', 'https://www.figma.com/proto/4eU6Eg9uXlyGuETZYkaloK/GROUP-6---Design-Thinking-Project?page-id=0%3A1&node-id=24%3A58&viewport=281%2C48%2C0.2&scaling=scale-down&starting-point-node-id=10%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Fets - Animal Care.png', 436, 8, 2, '2022-01-01 19:55:52', '2022-01-01 20:07:23'),
(268, 'Emilio', '{\"blocks\":[{\"key\":\"dhjlf\",\"text\":\"Aplikasi Emilio merupakan aplikasi untuk meningkatkan technical dan soft skill di berbagai bidang yang dipersembahkan bagi para pelajar dan mahasiswa. Karena di era revolusi industri 4.0 di mana merupakan era yang menuntut kita untuk memiliki berbagai macam skill maupun softskill yang kini sangat diperlukan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2eqq\",\"text\":\"Emilo memiliki fitur unggulan yakni Study Stream, seperti sebuah komunitas belajar yang memberikan ruang bagi user Emilio untuk belajar bersama dan bertukar pikiran dengan user lain melalui platform Zoom dan Discord.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":36,\"length\":12,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5esdk\",\"text\":\"Emilio juga memberikan akses live session mentoring pribadi eksklusif dan beberapa exam serta self asessment. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2prq\",\"text\":\"Dengan menggunakan aplikasi ini, diharapkan dapat membantu para pengguna untuk memenuhi dan mengetahui kebutuhan serta passion mereka. Selain itu, juga dapat membantu dalam proses pengembangan self awareness, kemampuan serta potensi dalam dirinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Emilio.png', 'https://youtu.be/GfKTP1ohtAU', 'https://www.figma.com/file/mbWxg8VbXq2O8oEv4hErKR/JSON-BERRA?node-id=0%3A1&t=IfSoU1k4FKcAmUV3-1', 'https://api.informatics-expo.id/Emilio.png', 433, 4, 2, '2022-01-01 20:06:37', '2022-12-14 20:01:57'),
(269, 'REZERVA', '{\"blocks\":[{\"key\":\"em7mf\",\"text\":\"Rezerva merupakan sebuah sistem informasi reservasi restoran yang berfungsi untuk memanajemen pengelolaan restoran Dengan berbagai fitur.Pembuatan Rezerva dilatarbelakangi oleh keinginan dari tim rezerva untuk membantu berbagai restoran di indonesia dalam mengelola proses pemesanan,pembayaran hingga pengelolaan restoran itu sendiri seperti pengelolaan keuangan,pendapatan, makanan dan sejenisnya.Target aplikasi Rezerva adalah untuk restoran restoran yang kesulitan dalam mengelola restorannya dikarenakan semakin berkembangnya restoran yang menyebabkan semakin banyaknya pelanggan dan karyawan sehingga menyebabkan kesulitan dalam pengelolaanya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9v7qe\",\"text\":\"Rezerva sendiri terdiri dari dua subsistem yaitu sistem untuk Customer dan sistem untuk admin. Untuk Customer terdapat Fitur Seperti memilih Pesanan/menu, pembayaran pesanan, memberikan rating, dan Keranjang. Disisi lain Admin memiliki Fitur yang cukup superior yaitu Dashboard,Pengelolaan daftar pesanan,Laporan Pendapatan,Laporan Menu,Kelola Menu,Kelola Kategori , dan Kelola Admin. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"341bg\",\"text\":\"Dengan Adanya aplikasi Rezerva ini diharapkan dapat memudahkan sistem pengelolaan pada restoran sehingga meningkatkan kemungkinan pendapatan dan produktivitas pada restoran yang menggunakan aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'REZERVA.jpeg', 'https://www.youtube.com/watch?v=in1XfDB1pnI', 'https://rezerva.my.id/', 'https://api.informatics-expo.id/REZERVA.jpeg', 386, 2, 2, '2022-01-01 20:20:33', '2022-01-03 19:54:07'),
(270, 'U-Kaeem', '{\"blocks\":[{\"key\":\"btjei\",\"text\":\"Proyek U-Kaeem merupakan proyek Berbasis Web yang digunakan untuk memfasilitasi UMKM untuk memasarkan produk nya. selain untuk memfasilitasi UMKM, tujuan dibuat proyek ini adalah untuk membranding pola pemikiran mengenai produk dalam negri yang tidak kalah saing dengan produk luar negri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":31,\"style\":\"color-rgb(17,60,97)\"},{\"offset\":32,\"length\":128,\"style\":\"color-rgb(17,60,97)\"},{\"offset\":161,\"length\":127,\"style\":\"color-rgb(17,60,97)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'U-Kaeem.jpeg', 'https://youtu.be/iO0LkJukgM0', '', 'https://api.informatics-expo.id/U-Kaeem.jpeg', 438, 8, 2, '2022-01-01 20:23:52', '2022-01-01 20:26:23'),
(271, 'Seluncur', '{\"blocks\":[{\"key\":\"7km5s\",\"text\":\"Seluncur adalah platform funding untuk pelaku usaha pakaian di Daerah Istimewa Yogyakarta.\\n\\nSetiap pelaku usaha dapat membagikan desain pakaian ciptaannya dan mengatur target dan batas waktu urunan dana, durasi produksi dan durasi pengiriman.\\n\\nApabila pengunjung web menyukai desainnya, mereka dapat memesan pakaian tersebut dengan melakukan pre-order sebagai bentuk urunan dana.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":90,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Seluncur.jpeg', 'https://youtu.be/-rvGtWHC9-c', '', 'https://api.informatics-expo.id/Seluncur.jpeg', 427, 8, 2, '2022-01-01 20:27:48', '2022-01-02 23:31:22'),
(272, 'easyBuy', '{\"blocks\":[{\"key\":\"5tfjn\",\"text\":\"easyBuy adalah sistem perangkat lunak berbasis website untuk pengelolaan system informasi e-commerce dengan fokus penjualan tanaman hias dan berbagai jenis bunga\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5f03c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'easyBuy.jpeg', 'https://youtu.be/Lh7GVK4P6KM', 'https://youtu.be/Lh7GVK4P6KM', 'https://api.informatics-expo.id/easyBuy.jpeg', 444, 8, 2, '2022-01-01 20:28:38', '2022-01-01 20:28:38'),
(273, 'K-TICKET', '{\"blocks\":[{\"key\":\"1tt8j\",\"text\":\"Platform untuk para wisatawan yang ingin memasuki tempat wisata tanpa perlu menggunakan tiket kertas melainkan beralih menjadi tiket digital atau paperless. Melalui platform ini, pengunjung dapat dengan mudah memperoleh tiket tanpa harus ada kontak dengan pegawai tiket.  Hanya dengan memindai QR-code wisatawan dapat masuk ke tempat wisata dengan mudah.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":355,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":355,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":355,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":355,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"},{\"offset\":146,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'K-TICKET.png', 'https://www.youtube.com/watch?v=nsClz3l0hVM', '', 'https://api.informatics-expo.id/K-TICKET.png', 289, 9, 2, '2022-01-01 20:29:01', '2022-01-05 01:06:40'),
(275, 'FLIPCARD', '{\"blocks\":[{\"key\":\"27m1j\",\"text\":\"Flipcard adalah permainan memori kartu. Klik salah satu kartu untuk melihat simbol apa yang ditemukan dan membuka kartu lain untuk menemukan simbol yang cocok di bawah kartu lainnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":182,\"style\":\"color-rgb(14,36,51)\"},{\"offset\":0,\"length\":182,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":182,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":182,\"style\":\"fontfamily-Maven Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"dkooi\",\"text\":\"Temukan dua simbol yang cocok sekaligus untuk memenangkan permainan. Dalam game ini tersedia berbagai fitur yang menarik serta memberikan level atau tingkat kesulitan permainan sehingga dapat memberikan tantangan bagi para pemainnya.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":233,\"style\":\"color-rgb(14,36,51)\"},{\"offset\":0,\"length\":233,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":233,\"style\":\"fontsize-14pt\"},{\"offset\":0,\"length\":233,\"style\":\"fontfamily-Maven Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'FLIPCARD.png', '', '', 'https://api.informatics-expo.id/FLIPCARD.png', 447, 9, 2, '2022-01-01 20:41:54', '2022-01-01 20:41:54'),
(276, 'BISAKERJA.ID', '{\"blocks\":[{\"key\":\"726kb\",\"text\":\"Semenjak masuknya virus Covid-19 ke Indonesia, banyak perusahaan yang mengalami penurunan pendapatan. Mereka harus melakukan Pemutusan Hubungan Kerja (PHK) pada sebagian pekerjanya, untuk mengurangi pengeluaran perusahaan. Sehingga banyak masyarakat yang kehilangan pekerjaannya. Maka dari itu, kita berfikir untuk membuat aplikasi yang bisa memudahkan mereka, yang kami beri nama BISAKERJA.ID.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":394,\"style\":\"fontsize-14\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d5s4i\",\"text\":\"BISAKERJA.ID adalah platform yang berguna untuk menyediakan informasi mengenai lowongan pekerjaan yang sedang dibuka dan memudahkan masyarakat dalam melamar pekerjaan. Aplikasi ini dapat menghubungkan antara pencari tenaga kerja dengan pencari pekerjaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":254,\"style\":\"fontsize-14\"},{\"offset\":143,\"length\":5,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":143,\"length\":5,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BISAKERJA.ID.jpeg', 'https://youtu.be/6mdoijLmYKs', 'https://www.figma.com/proto/BOhrNHfkq5iWyHWjwt1puc/desain-bisaKerja.id?node-id=1%3A473&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A528', 'https://api.informatics-expo.id/BISAKERJA.ID.jpeg', 299, 8, 2, '2022-01-01 20:45:54', '2022-01-02 08:32:06'),
(278, 'SHADES', '{\"blocks\":[{\"key\":\"8l54g\",\"text\":\"SHADES adalah aplikasi berbasis web, yang dapat membantu orang untuk memiliki bisnis melalui franchise-franchise yang sudah ada. Disisi lain, Shades juga membantu para pengusaha(franchisor) untuk mempromosikan bisnis mereka yang sudah berhasil.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"aga7l\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SHADES.png', 'https://youtu.be/B1LW9J9KNMo', '', 'https://api.informatics-expo.id/SHADES.png', 439, 9, 2, '2022-01-01 20:48:56', '2022-01-01 21:00:33'),
(280, 'Fit Mass', '{\"blocks\":[{\"key\":\"atrlq\",\"text\":\"Fit Mass adalah sebuah aplikasi berbasis android dengan tema Kesehatan. Fit Mass memiliki fitur utama yaitu Calorie Calculator dan Body Mass Index (BMI) Calculator dimana sistem dapat menghitung kalori dalam tubuh dan berat masa ideal user melalui data berat badan, tinggi badan, jenis kegiatan, dan umur. \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":306,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":306,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":306,\"style\":\"fontsize-25pt\"},{\"offset\":0,\"length\":306,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":108,\"length\":19,\"style\":\"ITALIC\"},{\"offset\":131,\"length\":16,\"style\":\"ITALIC\"},{\"offset\":153,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Fit Mass.png', 'https://youtu.be/ORxSHwPLRFg', 'https://github.com/wahyucandra30/FitMass', 'https://api.informatics-expo.id/Fit Mass.png', 253, 3, 2, '2022-01-01 20:57:02', '2022-01-02 01:01:29'),
(281, 'Lethal Virus', '{\"blocks\":[{\"key\":\"79dnb\",\"text\":\"Virus telah menyerang kawasan pemukiman manusia. Virus ini dapat menyerang dan membunuh membunuh manusia dengan menempel/menyentuh ke inangnya (manusia), oleh karena itu, manusia harus membela dirinya sebaik mungkin agar dapat melawan dan terhindar dari serangan virus tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lethal Virus.jpeg', 'https://youtu.be/EUPTyjit-3o', 'https://drive.google.com/file/d/1hjyLOFYeRqKgG_4EiGpHqsD6qJYGXipf/view?usp=sharing', 'https://api.informatics-expo.id/Lethal Virus.jpeg', 431, 19, 2, '2022-01-01 21:00:34', '2022-01-03 07:01:38'),
(282, 'Nakia', '{\"blocks\":[{\"key\":\"23v6f\",\"text\":\"Kekerasan seksual seringkali diabaikan oleh sebagian orang. Salah satu sebabnya adalah adanya rasa malu ketika ingin melapor bahkan sulitnya seseorang mendapat ruang untuk mengungkapkannya. Nakia hadir sebagai aplikasi yang digunakan untuk mempermudah pelaporan ketika seseorang mengalami kekerasan seksual. Selain dapat diakses oleh siapa saja dan dimana saja, aplikasi ini terintegrasi dengan pihak berwajib sehingga nantinya akan mempermudah sistem. Melalui aplikasi Nakia ini kami berharap pelecehan seksual dapat dicegah hingga ditindak secara tegas untuk memberikan efek jera bagi para pelakunya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3fmlb\",\"text\":\"Bersama Nakia, wujudkan dunia yang setara!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nakia.jpeg', 'https://youtu.be/MBVJKX7XGGU', 'https://www.figma.com/proto/Fw3GxvFsTRDQmh4RhqaoEk?node-id=', 'https://api.informatics-expo.id/Nakia.jpeg', 351, 5, 2, '2022-01-01 21:01:38', '2022-01-01 22:28:12'),
(283, 'GO-LEARN', '{\"blocks\":[{\"key\":\"eg41v\",\"text\":\"Go-Learn adalah aplikasi pembelajaran yang ditujukan untuk siswa yang sedang mempersiapkan diri untuk menghadapi UTBK, dengan fitur fitur yang beragam dan menarik tentunya membuat pembelajaran tidak membosankan, ditambah lagi terdapat fitur permainan untuk mengasah otak, dimana para siswa bisa bermain dengan siswa lain yang membuat para siswa mempunyai jiwa kompetitif dan semangat yang tinggi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GO-LEARN.png', 'https://youtu.be/0FWksnWa-Fs', 'https://www.figma.com/proto/3Gl30zco0wTsAFEmAw4ihI/Sebuah-Mahakarya?node-id=5%3A7&scaling=scale-down&page-id=0%3A1&starting-point-node-id=5%3A7', 'https://api.informatics-expo.id/GO-LEARN.png', 442, 4, 2, '2022-01-01 21:05:33', '2022-01-01 21:05:33'),
(284, 'UKM Bahagia', '{\"blocks\":[{\"key\":\"7uqa9\",\"text\":\"UKM Bahagia adalah aplikasi berbasis web yang berfungsi mengelola pencatatan keuangan bagi para pelaku UKM. Setiap pelaku UKM dapat membuat akun dan login ke aplikasi ini untuk mengakses fitur yang terdapat di dalamnya, seperti dashboard untuk menampilkan keuntungan atau kerugian tiap bulannya, pencatatan pemasukan maupun pengeluaran tiap transaksi berdasarkan kategorinya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":375,\"style\":\"color-rgb(255,255,255)\"},{\"offset\":0,\"length\":375,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":0,\"length\":375,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":375,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UKM Bahagia.jpeg', 'https://www.youtube.com/watch?v=r7AO7SLXnKg', 'https://github.com/Ramz09/UKMBahagia2', 'https://api.informatics-expo.id/UKM Bahagia.jpeg', 452, 8, 2, '2022-01-01 21:05:56', '2022-01-02 21:50:20'),
(285, 'LIMITATORE', '{\"blocks\":[{\"key\":\"d037c\",\"text\":\"Limitatore merupakan aplikasi yang membatasi penggunaan smartphone bagi masyarakat. Aplikasi ini bertujuan agar pengguna dapat mengurangi kecanduan akan suatu aplikasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LIMITATORE.png', 'https://youtu.be/1u3HbWAAj8A', 'https://www.canva.com/design/DAE0YNKsARY/cKxBkoP5XWQC6dvf4oCypw/view?utm_content=DAE0YNKsARY&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/LIMITATORE.png', 285, 3, 2, '2022-01-01 21:12:35', '2022-01-07 22:54:33'),
(286, 'Parazzle', '{\"blocks\":[{\"key\":\"acahf\",\"text\":\"Parazzle adalah game bertemakan teka-teki untuk anak yang mengambil alphabet sebagai media pembelajaran dalam bermain game, anak dituntut untuk mengingat urutan dan pola gambar yang sesuai dengan huruf, metode ini diharapkan dapat membantu pembelajaran anak terkait alphabet dengan mudah & menyenangkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'Parazzle.png', 'https://youtu.be/aZlLuv_3VFM', '', 'https://api.informatics-expo.id/Parazzle.png', 458, 4, 2, '2022-01-01 21:35:35', '2022-01-01 21:35:35'),
(287, 'TopJob', '{\"blocks\":[{\"key\":\"9rfrf\",\"text\":\"TopJob is an application that helps someone in finding a job. TopJob has many job fields you can choose according to your expertise. You can download TopJob on your platform. With us making TopJob we hope to help many people who are in need of work\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TopJob.png', 'https://youtu.be/rQaN0Dbd_Bc', '', 'https://api.informatics-expo.id/TopJob.png', 462, 8, 2, '2022-01-01 21:36:36', '2022-01-01 21:36:36'),
(288, 'Water Goo', '{\"blocks\":[{\"key\":\"8lp3p\",\"text\":\"\\\"Water Goo\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fn5ar\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"98ngh\",\"text\":\"Aplikasi ini dibuat untuk membantu masyarakat yang terdampak kekurangan air bersih, isi dalam aplikasi ini yaitu penyediaan pembelian air bersih dan pembangunan sumur bor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Water Goo.jpeg', 'https://youtu.be/oVXSM4wqJik', 'https://www.figma.com/proto/eW49EWoy20Zbaj12xdpBXo/Andromeda?node-id=166%3A277&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A26&show-proto-sidebar=1', 'https://api.informatics-expo.id/Water Goo.jpeg', 461, 6, 2, '2022-01-01 21:37:32', '2022-01-01 22:44:04'),
(289, 'IMMUNITY', '{\"blocks\":[{\"key\":\"gefb\",\"text\":\"Immunity adalah aplikasi yang dipergunakan dalam mendukung pelaksanaan vaksinasi covid 19 oleh Pemerintah Republik Indonesia dalam rangka menangani penyebaran covid 19. Aplikasi immunity memiliki fungsi utama yaitu mengetahui jadwal dan tempat vaksinasi covid. Pengguna aplikasi immunity terutama yang belum melaksanakan vaksinasi dapat dengan mudah melaksanakan vaksinasi covid dalam upaya menghentikan penyebaran covid.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IMMUNITY.jpeg', 'https://youtu.be/Jcw5gy0E-Pc', 'https://www.figma.com/proto/RlTvg7mBBbBkZcaBiGG9MP/Untitled?node-id=47%3A111&scaling=scale-down&page-id=32%3A2&starting-point-node-id=47%3A111', 'https://api.informatics-expo.id/IMMUNITY.jpeg', 455, 18, 2, '2022-01-01 21:40:49', '2022-01-02 13:48:50'),
(290, 'SURE APP', '{\"blocks\":[{\"key\":\"11tk3\",\"text\":\"Aplikasi Sure adalah aplikasi yang berperan sebagai jembatan antara penyelenggara acara yang membutuhkan volunteer dengan pengguna yang ingin menjadi volunteer, selain itu proyek aplikasi Sure ini juga akan bisa digunakan untuk penggalangan dana yang bersifat kemanusian\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SURE APP.jpeg', 'https://youtu.be/QqU7VUpQ2I4', '', 'https://api.informatics-expo.id/SURE APP.jpeg', 460, 11, 2, '2022-01-01 21:41:57', '2022-01-03 16:07:00'),
(291, 'JOBSKUY', '{\"blocks\":[{\"key\":\"dvi5s\",\"text\":\"Jobskuy adalah website yang berfungsi untuk mempermudah masyarakat khususnya pengguna dalam memberi dan mencari pekerjaan.\",\"type\":\"header-four\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":122,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}},{\"key\":\"9hhgt\",\"text\":\"Explore more : https://jobskuy.rf.gd/ \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":15,\"style\":\"fontsize-18\"},{\"offset\":15,\"length\":22,\"style\":\"color-var(--yt-endpoint-color,var(--yt-spec-call-to-action))\"},{\"offset\":15,\"length\":22,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":15,\"length\":22,\"style\":\"fontsize-14\"},{\"offset\":15,\"length\":22,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":15,\"length\":23,\"style\":\"BOLD\"}],\"entityRanges\":[{\"offset\":15,\"length\":22,\"key\":0}],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbF81eHNmc2wzYjJHV0gxNGJjYnRoYnpQdHVQZ3xBQ3Jtc0tudVRTMUlaZDREc0lQRWxhcVV6aTBZQ1Jzd1ZHT3F3Y18wSUZZczh3bHVyZ1pZMHBDT0YwVXpOTzYwUlpJMDhYanJmMl81WHNxYjFOWnp2dERrTjBHWjlEZnV4TEFYTEhZSjY4Tmk1anotN1VVZml0UQ&q=https%3A%2F%2Fjobskuy.rf.gd%2F\",\"title\":\"https://jobskuy.rf.gd/\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbF81eHNmc2wzYjJHV0gxNGJjYnRoYnpQdHVQZ3xBQ3Jtc0tudVRTMUlaZDREc0lQRWxhcVV6aTBZQ1Jzd1ZHT3F3Y18wSUZZczh3bHVyZ1pZMHBDT0YwVXpOTzYwUlpJMDhYanJmMl81WHNxYjFOWnp2dERrTjBHWjlEZnV4TEFYTEhZSjY4Tmk1anotN1VVZml0UQ&q=https%3A%2F%2Fjobskuy.rf.gd%2F\",\"title\":\"https://jobskuy.rf.gd/\",\"targetOption\":\"_blank\"}}}}}}', 'JOBSKUY.jpeg', 'https://www.youtube.com/watch?v=IdRUewF57nU', 'https://github.com/FaishalAlbadri/jobskuy', 'https://api.informatics-expo.id/JOBSKUY.jpeg', 441, 8, 2, '2022-01-01 21:47:45', '2022-01-02 20:56:23'),
(292, 'Hunting Pusaka', '{\"blocks\":[{\"key\":\"aeq52\",\"text\":\"Indonesia merupakan salah satu negara dengan budaya yang sangat beragam. Salah satu budaya yang berkembang di masyarakat khususnya di wilayah Jawa yaitu keberadaan dukun atau paranormal. Maka dari itu, kami berinisiatif membuat gim menggunakan karakter dukun serta keris sebagai bentuk upaya untuk memperkenalkan budaya Indonesia ke masyarakat indonesia hingga mancanegara. Gim 2D ini dioperasikan di platform PC yang dimainkan dengan keyboard. Menggunakan beberapa tampilan background serta tingkat kesulitan yang disesuaikan dengan level yang sedang dimainkan sebagai perubahan untuk pendukung suasana. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":604,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Hunting Pusaka.png', 'https://youtu.be/bkM-eCUBnlM', '', 'https://api.informatics-expo.id/Hunting Pusaka.png', 297, 16, 2, '2022-01-01 21:55:05', '2022-01-01 21:55:05'),
(293, 'Go-Gath', '{\"blocks\":[{\"key\":\"8tq5k\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"margin-left\":\"-4pt\"}},{\"key\":\"3t0uh\",\"text\":\"Platform untuk mahasiswa informatika UII. Melalui platform ini mahasiswa dapat membentuk solidaritas tim  sesama mahasiswa informatika UII melalui kegiatan olahraga yang diselenggarakan di informatika antara lain futsal, badminton, dan basket. Di platform ini, mahasiswa dapat membentuk tim dan memilih jadwal bermain yang tertera serta dimana tempat bermainnya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":362,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":362,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":362,\"style\":\"fontsize-10pt\"},{\"offset\":0,\"length\":362,\"style\":\"fontfamily-Helvetica Neue\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"-0.1pt\"}}],\"entityMap\":{}}', 'Go-Gath.png', 'https://youtu.be/CKEZWlLnm-Y', '', 'https://api.informatics-expo.id/Go-Gath.png', 393, 9, 2, '2022-01-01 22:09:28', '2022-01-01 22:09:28'),
(294, 'Genkin itōbo', '{\"blocks\":[{\"key\":\"1gaks\",\"text\":\"Proyek ini dibuat karena banyak pelaku usaha kesulitan dalam merekap catatan akhir keuangan usaha mereka, sehingga kami menciptakan aplikasi berbasis web yang kegunaannya untuk mencatat keuangan. Aplikasi ini diberi nama Genkin itōbo, guna membantu pelaku UKM dalam mencatat dan merekap catatan akhir keuangan dan meminimalisasi kesalahan dalam perekapan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a85mq\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Genkin itōbo.png', 'https://youtu.be/to_jBpkYxYA', '', 'https://api.informatics-expo.id/Genkin itōbo.png', 466, 8, 2, '2022-01-01 22:32:58', '2022-01-01 22:32:58');
