(295, 'Belanja-In', '{\"blocks\":[{\"key\":\"bbo0o\",\"text\":\"Belanja-In adalah sebuah aplikasi yang mengangkat masalah \\\"Decent Work and Economic Growth\\\" yang terinspirasi dari keadaan pandemic yang sedang terjadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"djihu\",\"text\":\".\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2ecl2\",\"text\":\".\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4bhtl\",\"text\":\"Belanja-In menghadirkan solusi untuk pengguna agar tetap di rumah dan menekan angka penyebaran Covid-19. Belanja-In memudahkan pengguna untuk memesan bahan pokok atau kebutuhan sehari-hari tanpa keluar rumah. Belanja-In menghadirkan fitur untuk berinteraksi langsung dengan penjual untuk memudahkan pencarian bahan pokok. Belanja-In bisa disebut pasar virtual. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Belanja-In.png', 'https://youtu.be/27f7eKZCjG4', 'https://www.figma.com/proto/aP1feClvdJ83N2QXnfqPKP/Kura-kura?node-id=65%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=65%3A2', 'https://api.informatics-expo.id/Belanja-In.png', 269, 8, 2, '2022-01-01 22:53:00', '2022-01-01 22:54:56'),
(296, 'DONASIKU', '{\"blocks\":[{\"key\":\"2v8v\",\"text\":\"    Sumbangan atau donasi merupakan kegiatan memberikan secara suka rela terhadap orang lain yang pada umumnya sedang dalam kondisi membutuhkan. kegiatan tersebut sangat berkaitan erat dengan kontak langsung antara penerima dan pemberi sumbangan. Akan tetapi kegiatan tersebut masih banyak yang terbilang konvensional dan kurang praktis. Masalah lain muncul saat di masa pendemi yang diharuskan untuk menjaga jarak sehingga mempersulit melakukan kegiatan donasi. akibatnya bermunculan banyak aplikasi donasi yang tidak jelas asal usulnya dan belum terjamin keamanannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":569,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":569,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":569,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":569,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"85o17\",\"text\":\"     Dari kondisi tersebut, untuk mengubah ekonomi salah oleh aplikasi yang dapat membantu meratakan ekonomi seperti aplikasi yang dapat membantu kegiatan donasi. Salah satu kondisi terkini yang terjadi yaitu sulitnya akses untuk mendapatkan akses mengenai kegiatan donasi ditambah lagi dengan banyaknya penyalur donasi yang tidak aman dan tidak dapat dipercaya.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":364,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":364,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":364,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":364,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"cu0u9\",\"text\":\"     DONASIKU merupakan sebuah aplikasi yang bertujuan untuk memudahkan kegiatan pengumpulkan donasi kepada orang yang membutuhkan secara digital dan instan dengan berbagai macam platfom pembayaran yang sudah terjamin keamanannya oleh berbagai pihak ketiga. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":258,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":258,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":258,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":258,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"1ojbk\",\"text\":\"Fitur-fitur aplikasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":20,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":20,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":20,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"c8s38\",\"text\":\"- Inbox\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":7,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"845eo\",\"text\":\"     Pada fitur ini akan memberi tahu user berbagai macam info mulai dari promo, status akun, hingga notifikasi seputar donasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":127,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":127,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":127,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":127,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"39msu\",\"text\":\"- News and tips of the day\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":26,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":26,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":26,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":26,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7ij25\",\"text\":\"     Fitur ini merupakan sebuah cara kami untuk saling berkomunikasi pada user dengan menampilkan berbagai informasi dan hal yang menarik yang berbeda setiap harinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":166,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":166,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":166,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":166,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dr9gb\",\"text\":\"- Riwayat donasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":16,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":16,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":16,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":16,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"drauc\",\"text\":\"     Fitur yang digunakan untuk melihat status donasi yang anda lakukan, jika donasi sudah diterima oleh pihak yang membutuhkan maka anda bisa melihat bukti berupa surat, video dan bukti receipt(tanda terima).\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":209,\"style\":\"color-rgb(17,17,17)\"},{\"offset\":0,\"length\":209,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":209,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":209,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DONASIKU.png', 'https://www.youtube.com/watch?v=k9KI3IfTdMg&ab_channel=BINTANGRAHMATULLAH', 'https://www.figma.com/proto/H0Z3SsIUlol93Oi3CU4Ukx/VACANCY?node-id=152%3A36&scaling=scale-down&page-id=0%3A1&starting-point-node-id=152%3A36', 'https://api.informatics-expo.id/DONASIKU.png', 251, 1, 2, '2022-01-02 01:24:44', '2022-01-02 01:25:25'),
(297, 'Foodie Buddy', '{\"blocks\":[{\"key\":\"fuunj\",\"text\":\"Foodie Buddy merupakan sebuah aplikasi untuk mengakses destinasi kuliner di Yogyakarta serta menyediakan kumpulan ulasan restoran yang dapat diakses oleh pengguna. Pengguna dapat melihat restoran terpopuler, memberikan ulasan untuk restoran yang telah dikunjungi, serta nantinya pengguna pun bisa mendapatkan reward berupa poin. So, let\'s share your review with Foodie Buddy! \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":375,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":375,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":375,\"style\":\"fontsize-12.5pt\"},{\"offset\":0,\"length\":375,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":378,\"style\":\"fontsize-18\"},{\"offset\":329,\"length\":47,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Foodie Buddy.png', 'https://youtu.be/g465o0tzu5U', '', 'https://api.informatics-expo.id/Foodie Buddy.png', 296, 9, 2, '2022-01-02 11:40:47', '2022-01-02 11:40:47'),
(298, 'Rumah Kinclong', '{\"blocks\":[{\"key\":\"4j89v\",\"text\":\"Rumah Kinclong adalah sebuah aplikasi yang mengangkat masalah \\\"Decent Work and Economic Growth\\\" yang sangat dibutuhkan pada masa saat ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":138,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":138,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":138,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":138,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":138,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"do2bn\",\"text\":\"Dalam kondisi pandemi saat ini, banyak pegawai kantoran yang di PHK dan lapangan pekerjaan saat ini sangatlah sedikit, untuk itulah kami menghadirkan Rumah Kinclong yang dapat membantu orang - orang mendapatkan pekerjaan yang layak dan juga dapat membantu pegawai kantoran yang sibuk agar tetap dapat merawat rumah.Disini  tidak cuma menyediakan jasa pembersih namun disini juga ada terdapat jasa tukang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":404,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":404,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":404,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":404,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":404,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"cbl11\",\"text\":\"Berikut adalah beberapa contoh fitur yang ada di Rumah Kinclong:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":64,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":64,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":64,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":64,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":64,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"fvqd7\",\"text\":\"Pemeliharaan Rumah\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":18,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":18,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":18,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":18,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"aevn4\",\"text\":\"Berfungsi untuk memperbaiki atau memperindah rumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":51,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":51,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":51,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":51,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":51,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"27sq2\",\"text\":\"Pembersihan Rumah\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"5i9gi\",\"text\":\" Berfungsi untuk membersihkan dalam serta halaman rumah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":56,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":56,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":56,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":56,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":56,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"583sp\",\"text\":\"Bangun dan Renovasi\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":19,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":19,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":19,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":19,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":19,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"b0dog\",\"text\":\"Berfungsi untuk membangun rumah atau ingin membuat suatu bangunan sesuai keinginan pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":92,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":92,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":92,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":92,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":92,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'Rumah Kinclong.jpeg', 'https://youtu.be/2OCeO8RTUyM', 'https://www.figma.com/proto/0B200VTHjThZLpf9Zk3oGw/Bill-Gates?page-id=0%3A1&node-id=925%3A2871&viewport=241%2C48%2C0.25&scaling=scale-down&starting-point-node-id=925%3A2871', 'https://api.informatics-expo.id/Rumah Kinclong.jpeg', 475, 8, 2, '2022-01-02 12:52:26', '2022-01-02 12:52:26'),
(299, 'World Goodnes', '{\"blocks\":[{\"key\":\"fbc24\",\"text\":\"World Goodness is a help-based application by helping our less fortunate brothers and sisters \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'World Goodnes.png', 'https://youtu.be/m7n3MuCfJug', 'https://www.figma.com/proto/fkVR1aVIkHmkAPoY9YPuI9/World-goodness?node-id=316%3A1235&scaling=scale-down&page-id=0%3A1&starting-point-node-id=219%3A1454', 'https://api.informatics-expo.id/World Goodnes.png', 476, 2, 2, '2022-01-02 15:09:11', '2022-01-02 15:09:11'),
(300, 'Adventure Of Azura', '{\"blocks\":[{\"key\":\"1c0lq\",\"text\":\"Petualangan Azura dimulai ketika ia ingin menemukan benda pusaka untuk menyelamatkan hutan sekitar. Ia pun berjalan semakin dalam dan ternyata ia tersesat dan harus bertahan hidup di hutan. Ketika Azura sudah lama tersesat, Azura pun merasa lapar dan mulai mencari makanan di dalam hutan. Dihutan ada banyak buah-buahan yang bisa ia makan, ketika ia mengumpulkan buah-buahan tiba-tiba Azura bertemu monster yang bernama Ducky, Azura harus melawan monster tersebut agar bisa bertahan hidup dihutan. Ketika Azura telah mengalahkan monster Ducky, Azura melanjutkan petualangannya dan tiba-tiba ia bertemu sebuah monster yang besar dan lebih kuat dibandingkan monster Ducky yaitu Ducking ternyata dia adalah pemimpin di hutan yang jahat karena suka menyiksa makhluk hidup yang ada di hutan. Oleh karena itu, Azura harus melawannya agar dapat menyelamatkan hutan serta dapat keluar dari hutan. Ayo bantu Azura melawan bebek! \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":920,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":920,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":920,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":920,\"style\":\"fontfamily-Arial\"},{\"offset\":889,\"length\":31,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Adventure Of Azura.png', 'https://youtu.be/ysdMtOCwNbQ', 'https://drive.google.com/file/d/1FnXHWsl_GN046NVRoOpad8VHQ789_Drs/view?usp=sharing', 'https://api.informatics-expo.id/Adventure Of Azura.png', 472, 17, 2, '2022-01-02 15:59:14', '2022-01-02 21:36:45'),
(301, 'Covid Fighter', '{\"blocks\":[{\"key\":\"jhp5\",\"text\":\"Assallamualaikum, rekan-rekan kampus perjuangan.                 \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6bj3m\",\"text\":\"             Kami dari Team Pandemia menperkenalkan dan mengembangkan aplikasi gim bernama Covid Fighter. Aplikasi gim ini bertema covid-19, dimana hari ini masih menjadi momok bagi umat manusia di seluruh muka bumi. Anda akan menjadi seorang dokter yang setiap harinya bekerja di sebuah rumah sakit dan bertahan dari serangan virus Covid-19 yang berbahaya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":28,\"length\":8,\"style\":\"ITALIC\"},{\"offset\":91,\"length\":13,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bqa33\",\"text\":\"                Dengan memanfaatkan gim ini, developer menyajikan gim yang membawa player untuk mengenal lebih jauh berbagai jenis virus covid-19 yang berada saat ini. Dengan gaya penyuluhan yang asik dan berbeda, gim Covid Fighter menyasar anak-anak sebagai target pasar karena diketahui anak-anak masih minim pengetahuan virus Covid-19. Lets go mencoba pengalaman bermain bersama Pandemia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Covid Fighter.jpeg', 'https://www.youtube.com/watch?v=MSR0uc3Z3og', 'https://drive.google.com/file/d/1_k9nP0aVq8MctYYL2x263rYzbkYOOSPF/view?usp=sharing', 'https://api.informatics-expo.id/Covid Fighter.jpeg', 295, 18, 2, '2022-01-02 17:04:05', '2022-01-08 23:23:57'),
(302, 'ZING!', '{\"blocks\":[{\"key\":\"cb7sm\",\"text\":\"Pernahkah kalian memikirkan bagaimana rasanya berperang?\\n\\nApakah kamu takut? Penasaran?\\n\\nKalian dapat menemukannya disini, Seorang Ninja yang ingin menyelamatkan Dunia.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'ZING!.png', 'https://youtu.be/szX6Z-bZ0ls', '', 'https://api.informatics-expo.id/ZING!.png', 479, 1, 2, '2022-01-02 17:34:04', '2022-01-02 17:34:04'),
(303, 'Diet Healthy', '{\"blocks\":[{\"key\":\"crdtu\",\"text\":\"Aplikasi diet yang ramah buat bagi segala aspek masyarakat umum dengan berbagai fitur yang menarik \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":98,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":98,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":98,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Diet Healthy.jpeg', '', '', 'https://api.informatics-expo.id/Diet Healthy.jpeg', 481, 18, 2, '2022-01-02 18:18:57', '2022-01-02 18:18:57'),
(304, 'Fantasy Realm', '{\"blocks\":[{\"key\":\"evolp\",\"text\":\"Fantasy Realm adalah game berjenis 2D Platformer Game, yang berceritakan tentang suatu kota yang bernama kizek dan terjadi perperangan antara bangsa Minatour dan Satyr, dan perperangan itu dimenangkan oleh satyr dan menyesikan satu minatour kecil yang berhasil kabur dari perperangan tersebut, dan seiring berjalannya waktu minatour ini tumbuh serta berlatih untuk membalaskan dendamnya kepada bangsa satyr seorang diri, apakah dia akan berhasil?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":446,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":446,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":446,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"3jbq5\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fantasy Realm.jpeg', 'https://youtu.be/rUzVFRdUfj4', 'https://drive.google.com/drive/u/1/folders/1j5BRpRQijbAgWTaL9EK0s9UJgaAUE4k2', 'https://api.informatics-expo.id/Fantasy Realm.jpeg', 483, 16, 2, '2022-01-02 18:28:25', '2022-01-04 02:38:50'),
(305, 'Kas-Len', '{\"blocks\":[{\"key\":\"s171\",\"text\":\"Proyek ini bernama Kas-Len dimana memiliki tujuan untuk mengatur segala pemasukan dan pengeluaran uang kas yang terjadi pada karang taruna sebagai pelaku UMKM.Proyek ini sangat penting bagi pelaku UMKM karena mengingat pentingnya dalam mengelola keuangan dan dapat mengelolanya sebuah keunggulan bagi pelaku bisnis agar dapat memprediksi langkah yang akan dilakukan oleh pelaku bisnis pada masa mendatang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kas-Len.png', 'https://youtu.be/jDCtdb3Bb6k', '', 'https://api.informatics-expo.id/Kas-Len.png', 478, 9, 2, '2022-01-02 18:51:24', '2022-01-02 18:51:24'),
(306, 'Beasiswa Kita', '{\"blocks\":[{\"key\":\"8i7pg\",\"text\":\"Beasiswa Kita merupakan aplikasi yang dikembangakan untuk membantu pelajar dalam mencari beasiswa di dalam negeri. Pelajar dapat mencari daftar beasiswa yang tersedia pada waktu tertentu. Informasi terkait beasiswa akan ditampilkan secara lengkap melalui aplikasi dan menyediakan forum pertanyaan untuk pelajar.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":311,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":311,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":311,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":311,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Beasiswa Kita.jpeg', 'https://youtu.be/nrg3IeTUYK4', '', 'https://api.informatics-expo.id/Beasiswa Kita.jpeg', 291, 4, 2, '2022-01-02 19:17:17', '2022-01-02 19:17:17'),
(307, 'JOB.FIND', '{\"blocks\":[{\"key\":\"1bhtb\",\"text\":\"Di era yang serba digital membawa perubahan besar bagi manusia dalam mengakses berbagai macam informasi dengan sangat mudah termasuk mencari informasi lowongan pekerjaan yang dapat dengan mudah diakses hanya dengan melalui website atau aplikasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dern\",\"text\":\"JOB.FIND merupakan salah satu aplikasi penyedia lapangan pekerjaan yang dapat dengan mudah diakses dimana saja & kapan saja. JOB.FIND dapat menampilkan informasi lowongan pekerjaan dari berbagai jenjang pendidikan, karir, perusahaan, dan agen rekrutmen, sehingga dapat memudahkan pengguna dalam mencari pekerjaan sesuai dengan kriteria pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JOB.FIND: Find Your Job Here!.png', 'https://youtu.be/T3OMc4HFhJc', 'https://www.figma.com/proto/PbGxZvdDP9Y56gpbrKmXBy/JOB.FIND?node-id=129%3A1688&starting-point-node-id=3%3A159', 'https://api.informatics-expo.id/JOB.FIND: Find Your Job Here!.png', 360, 8, 2, '2022-01-02 19:37:40', '2022-01-02 22:52:04'),
(308, 'HandMade', '{\"blocks\":[{\"key\":\"8nt2v\",\"text\":\"HandMade adalah aplikasi Penjualan Hasil Kerajinan Tangan Berbasis Web yang nantinya akan digunakan oleh para UKM. Dimana disini kami berikan solusi permasalahan berupa aplikasi web dimana penjual dan peminat kerajinan tangan dapat melakukan proses jual beli hasil kerajinan tangan, dengan mengandalkan chat dimana pembeli dapat mengkustom sendiri kerajinan tangan yang diinginkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HandMade.png', 'https://youtu.be/pzmJMYOxHcI', 'https://github.com/Fauzantriananta/HandMade.git', 'https://api.informatics-expo.id/HandMade.png', 287, 9, 2, '2022-01-02 19:53:22', '2022-01-02 19:53:22'),
(309, 'Bird Hunter', '{\"blocks\":[{\"key\":\"a1ksu\",\"text\":\"bird hunter adalah sebuah game yang menyunsung tema game jadul tentang perburuan burung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bird Hunter.png', 'https://youtu.be/1RqIU3PmBzQ', '', 'https://api.informatics-expo.id/Bird Hunter.png', 486, 2, 2, '2022-01-02 20:11:44', '2022-01-06 14:49:33'),
(310, 'Mental Care', '{\"blocks\":[{\"key\":\"bkbkt\",\"text\":\"mental care ialah sebuah aplikasi yang berguna untuk membantu masyarakat dalam mengatasi gangguan kecemasan berlebih.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Mental Care.png', 'https://youtu.be/4QJckxsP0To', '', 'https://api.informatics-expo.id/Mental Care.png', 487, 3, 2, '2022-01-02 20:15:54', '2022-01-03 09:58:18'),
(311, 'HungHelp', '{\"blocks\":[{\"key\":\"dqmnc\",\"text\":\"Our application solves one of the biggest problems facing the world, which is hunger. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5aemd\",\"text\":\"Some people do not know how to volunteer or how to donate or where, so we made this application because it will be:  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e1rcu\",\"text\":\"1. It is run by charities. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5u3ij\",\"text\":\"2. Easy to use, one-click to donate or volunteer. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cvn42\",\"text\":\"You can donate and be a volunteer in a case. You can also post a a case if someone near you need help. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a820o\",\"text\":\"What\'s featured in the app? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"edo7f\",\"text\":\"1. You can be a volunteer and a donator at the same time \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cd1u5\",\"text\":\"2. Easy to use and find cases quickly \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dltql\",\"text\":\"3. It\'s easy to communicate with other volunteers without the need for a personal account \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"354pk\",\"text\":\"4. Easy to do a payments, you can pay when you are at home without any hassle   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HungHelp.jpeg', 'https://youtu.be/TfTxyiJSffE', 'https://www.figma.com/proto/942kvgtfxn2P1hSXweSlZa/Untitled?page-id=0%3A1&node-id=373%3A377&viewport=241%2C48%2C0.54&scaling=scale-down&starting-point-node-id=373%3A377', 'https://api.informatics-expo.id/HungHelp.jpeg', 488, 2, 2, '2022-01-02 20:33:38', '2022-01-02 20:33:38'),
(312, 'Body Secret', '{\"blocks\":[{\"key\":\"9lv4c\",\"text\":\"Aplikasi BodySecret membantu dan mempermudah seseorang untuk mengetahui berat badan idealnya, Aplikasi ini dapat dijadikan ukuran yang digunakan seseorang untuk membantu mengetahui berat badan seseorang ideal atau tidak, serta membantu untuk mencapai berat badan idealnya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Body Secret.jpeg', '', '', 'https://api.informatics-expo.id/Body Secret.jpeg', 275, 3, 2, '2022-01-02 21:03:39', '2022-01-02 21:03:39'),
(313, 'One Goal', '{\"blocks\":[{\"key\":\"1vki\",\"text\":\"Aplikasi berbasis web yang ditujukan untuk orang orang yang ingin membangun bisnis. One Goal mampu menjadi media penghubung antara pemilik ide bisnis dan orang orang yang ingin membangun bisnis bersama\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'One Goal.jpeg', 'https://youtu.be/w1f73Q4ncaQ', 'http://onegoal.great-site.net/index2.html', 'https://api.informatics-expo.id/One Goal.jpeg', 470, 8, 2, '2022-01-02 21:03:45', '2022-01-02 21:03:45'),
(314, 'ATIKAN', '{\"blocks\":[{\"key\":\"6ruim\",\"text\":\"ATIKAN merupakan aplikasi belajar yang menyediakan berbagai macam materi pembelajaran. Tidak hanya materi, di dalam aplikasi ini juga disediakan video dan latihan soal. Aplikasi ini khususnya dibuat untuk para pelajar SD-SMA di daerah pedalaman yang dimana mereka kesulitan untuk mendapatkan buku pelajaran. Tujuan dari pembuatan aplikasi ini adalah kami berharap masalah pelajar di daerah pedalaman yang kesulitan dalam mendapatkan buku pelajaran dapat terselesaikan sehingga kualitas pendidikan di indonesia jadi merata.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'ATIKAN.png', 'https://youtu.be/bJx5ejsCRXQ', 'https://www.figma.com/proto/RRJQdnKnynRCg9B3EhUoSl/Annanova?node-id=30%3A6&scaling=scale-down&page-id=0%3A1&starting-point-node-id=30%3A6', 'https://api.informatics-expo.id/ATIKAN.png', 485, 4, 2, '2022-01-02 21:30:45', '2022-01-02 21:30:45'),
(315, 'Pendekar Nusantara', '{\"blocks\":[{\"key\":\"fugc4\",\"text\":\"Pendekar Nusantara adalah sebuah game platformer yang mengandung unsur play & learn. Memiliki unsur cerita asli sejarah perjuangan bangsa Indonesia. Bermainlah sebagai tokoh pahlawan perjuangan, pilih satu dari banyak tokoh pahlawan dan berjuanglah demi kemerdekaan bangsa Indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pendekar Nusantara.jpeg', 'https://youtu.be/prejfDEA82Y', '', 'https://api.informatics-expo.id/Pendekar Nusantara.jpeg', 489, 4, 2, '2022-01-02 21:30:55', '2022-01-02 21:30:55'),
(316, 'Jual.in', '{\"blocks\":[{\"key\":\"agdi2\",\"text\":\"Jual.in merupakan aplikasi berbasis web yang bertujuan untuk mengembangkan UKM dan memberikan kesempatan bagi orang yang baru memulai bisnis atau yang ingin mengembangkan bisnisnya lebih luas lagi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Jual.in.jpeg', 'https://youtu.be/lTeAnmmCz0E', 'https://github.com/twentyone07/Informatics-Expo', 'https://api.informatics-expo.id/Jual.in.jpeg', 418, 8, 2, '2022-01-02 21:40:35', '2022-01-02 21:40:35'),
(317, 'Fishy Fish', '{\"blocks\":[{\"key\":\"85elf\",\"text\":\"Fishy Fish adalah aplikasi digital wellbeing yang bertujuan untuk mengurangi penggunaan gadget berlebih pada pelajar SD dan SMP. Penggunaan gadget berlebih dapat menyebabkan ketergantungan dan gangguan kesehatan, terutama di jaman pandemi ini yang mana gadget dan internet dimanfaatkan sebagai pengganti pertemuan tatap muka.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Fishy Fish.png', 'https://youtu.be/GiJhYRs19WY', '', 'https://api.informatics-expo.id/Fishy Fish.png', 490, 3, 2, '2022-01-02 21:51:09', '2022-01-02 21:51:09'),
(318, 'Nutrition.Edu', '{\"blocks\":[{\"key\":\"1fboh\",\"text\":\"Seperti yang kita tahu masyarakat di Indonesia seringkali mengabaikan kesehatan diri sendiri seperti jarang beraktivitas makan makanan yang tinggi kalori maupun kekurangan sumber gizi pada anak anak mereka, yang dimana kekurangan gizi pada anak sendiri akan berdampak serius kedepannya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":46,\"length\":61,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":108,\"length\":75,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":184,\"length\":73,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":258,\"length\":29,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":46,\"length\":61,\"style\":\"fontsize-16\"},{\"offset\":108,\"length\":75,\"style\":\"fontsize-16\"},{\"offset\":184,\"length\":73,\"style\":\"fontsize-16\"},{\"offset\":258,\"length\":29,\"style\":\"fontsize-16\"},{\"offset\":46,\"length\":61,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":108,\"length\":75,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":184,\"length\":73,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":258,\"length\":29,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"aqbk2\",\"text\":\"Nutrition.edu adalah aplikasi yang bertujuan untuk mengedukasi pengguna supaya lebih mengetahui tentang gizi yang ada dalam makanan dan minuman sehari-hari. Alasan kami membuat aplikasi seperti ini agar dapat membantu masyarakat awam yang belum memahami lebih dalam apa itu gizi serta manfaatnya di dalam kehidupan sehari – hari. Dengan adanya aplikasi ini kami berharap dapat menciptakan lingkungan masyarakat yang sehat secara jasmani\\nmaupun rohani.    \\n\\n\\n\\n\\n\\n\\n\\n\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":62,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":63,\"length\":72,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":136,\"length\":72,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":209,\"length\":75,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":285,\"length\":168,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":455,\"length\":1,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":62,\"style\":\"fontsize-16\"},{\"offset\":63,\"length\":72,\"style\":\"fontsize-16\"},{\"offset\":136,\"length\":72,\"style\":\"fontsize-16\"},{\"offset\":209,\"length\":75,\"style\":\"fontsize-16\"},{\"offset\":285,\"length\":168,\"style\":\"fontsize-16\"},{\"offset\":455,\"length\":1,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":62,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":63,\"length\":72,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":136,\"length\":72,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":209,\"length\":75,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":285,\"length\":168,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":455,\"length\":1,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":362,\"length\":91,\"style\":\"fontsize-inherit\"},{\"offset\":362,\"length\":91,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nutrition.Edu.png', 'https://youtu.be/vxUlei0dOMo', 'https://www.figma.com/proto/xirUG2Ihy4TrMCdiVs9Izw/Nutrition.edu?node-id=114%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=20%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Nutrition.Edu.png', 492, 4, 2, '2022-01-02 22:24:09', '2022-01-02 22:40:09'),
(319, 'Hidrasee', '{\"blocks\":[{\"key\":\"dn2jf\",\"text\":\"At first, we want to do a project that could help the poor people who are in a shortage of\\nsupplies, such as food, clean water and so on. We want to focus on just one problem, in which\\nwe took a theme from Sustainable Development Goals (SDG) by the United Nations, which is 6.\\nClean Water and Sanitation. Funny story, at first there was a misunderstanding that we thought\\nwe were told to create a device and almost actually took that idea much further, until we were\\ntold that the assignment is to develop an application project. Despite that sudden realization and\\nfollowing the assignment due, we still took the idea for our application. Our first idea to that is to\\nhelp the communities who are in a clean water shortage, and currently still using dirty\\nunhygienic water for their daily basis. But to come up with enough budget to do such a project,\\nwe decided to do water deliveries and took inspiration from Gojek, Grab to come up with the\\nidea and a few designs for an application. This water delivery application will sent water\\nproducts such as gallons, boxes, ice cubes, etc. from our partnerships with stores and water\\ndepots to make water deliveries much easier. We then call this project “Project Hidrasee” with\\nthe vision to help and support small water depots, help the community with an easier water\\naccess and also to help those people who were in need of clean water.\\n     \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1385,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":1385,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":1385,\"style\":\"fontfamily-ArialMT\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Hidrasee.png', 'https://youtu.be/GeMV1hX0MDE', 'https://www.figma.com/proto/2fAv0Dq6hHXQBHVpETWi5N/HIDRASEE?page-id=0%3A1&node-id=208%3A2&viewport=241%2C48%2C0.09&scaling=scale-down&starting-point-node-id=208%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/Hidrasee.png', 469, 6, 2, '2022-01-02 22:31:08', '2022-01-02 22:31:08'),
(320, 'DokterKu : Your Personal Health Care', '{\"blocks\":[{\"key\":\"1mh0e\",\"text\":\"Aplikasi Dokterku merupakan aplikasi berbasis kesehatan jarak jauh yang dapat membantu pengguna dalam mencegah dan mengobati berbagai penyakit. Aplikasi ini juga dilengkapi dengan fitur konsultasi dokter yang dapat memudahkan pengguna untuk mengidentifikasi penyakit dan proses pengobatan dilakukan dengan lebih praktis dan efisien.  kemudian ada fitur identifikasi obat, yang berguna untuk mencari berbagai jenis obat serta dilengkapi dengan kegunaan dan cara penggunaan. Aplikasi ini dibuat untuk membantu mempermudah pengguna dalam bidang kesehatan, maka dari itu kami menambahkan vitur pengumpulan point yang dapat di tukarkan menjadi voucher potongan harga, sehingga aplikasi ini bisa meringankan biaya pengobatan dan konsultasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DokterKu : Your Personal Heatlh Care.png', 'https://youtu.be/voCMnCMly3Q', 'https://www.figma.com/proto/Qg2RQqioC99qpRQp4LGuaQ/Calon-Masa-Depanmu?node-id=587%3A3388&scaling=scale-down&page-id=0%3A1&starting-point-node-id=587%3A3388', 'https://api.informatics-expo.id/DokterKu : Your Personal Heatlh Care.png', 493, 18, 2, '2022-01-02 22:36:07', '2022-01-02 23:43:12'),
(321, 'TemuEdu', '{\"blocks\":[{\"key\":\"9gs8f\",\"text\":\"TemuEdu adalah Aplikasi yang diciptakan untuk menunjang pendidikan di Indonesia dimana semua anak di Indonesia bisa merasakan pendidikan secara mudah dan gratis\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"59n6q\",\"text\":\"Didalam aplikasi ini juga seorang relawan pengajar dapat membuat event untuk menunjang pendidikan di Indonesia contohnya kegiatan pergi ke daerah dengan kualitas pendidikan yang tertinggal\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dcak9\",\"text\":\"Dan di aplikasi ini juga kita dapat melakukan donasi yang dimana donasi ini akan di gunakan untuk membantu kegiatan serta kebutuhan untuk pendidikan di Indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TemuEdu.png', 'https://youtu.be/fSDx2EeZor4', 'https://www.figma.com/proto/kuQ55Xj3u4nnzxqcWrcQeL/Apple?node-id=262%3A974&scaling=scale-down&page-id=0%3A1&starting-point-node-id=262%3A974&show-proto-sidebar=1', 'https://api.informatics-expo.id/TemuEdu.png', 494, 4, 2, '2022-01-02 22:38:16', '2022-01-02 22:38:16'),
(322, 'e-Kampung', '{\"blocks\":[{\"key\":\"6lv4t\",\"text\":\"e-Kampung merupakan aplikasi berbasis android yang dapat menolong pemerintahan RW/RT dalam meningkatkan kualitas dan kuantitas sosial di lingkungannya. Aplikasi ini mengizinkan RW untuk mengadakan challenge yang dilakukan oleh warga. Sehingga nantinya warga akan melaksanakan challenge tersebut dan RT akan mengirimkan bukti kegiatan challenge sebagai pertimbangan penilaian untuk memunculkan pemenang challenge. Pemenang challenge akan mendapatkan hadiah sesuai dengan ketentuan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4fl52\",\"text\":\"Kotak kritik saran lapor diperuntukkan untuk warga agar dapat menyampaikan ide atau perasaan yang dialaminya di lingkungan tersebut kepada perangkat RT/RW. Hal ini dimaksudkan agar pemerintahan berjalan dengan lebih baik.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dfc3n\",\"text\":\"Warga tentu juga bisa mendapatkan informasi ter-up to date dari RT/RW  secara akurat dan real-time sehingga dapat mengurangi miskomunikasi antar pemerintahan dan warga.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eaf50\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2p3ig\",\"text\":\"e-Kampung memungkinkan Anda untuk:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":9,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fb7ls\",\"text\":\"1. Melakukan challenge dan menjadi pemenang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4gpta\",\"text\":\"2. Melaporkan hal yang terjadi di lingkungan sekitar\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8hpsi\",\"text\":\"3. Memberi kritik/saran kepada pemerintahan yang bersangkutan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9j1oe\",\"text\":\"4. Mendapat informasi secara realtime dan akurat dari perangkat RT/RW\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e-Kampung.png', 'https://youtu.be/__1pvYjoY0k', '', 'https://api.informatics-expo.id/e-Kampung.png', 484, 11, 2, '2022-01-02 23:26:26', '2022-01-02 23:26:26'),
(323, 'IDEAFY', '{\"blocks\":[{\"key\":\"3ntt5\",\"text\":\"Website jual beli ide bisnis dengan metode frachise\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IDEAFY.jpeg', 'https://youtu.be/nIsE2abI_m4', '', 'https://api.informatics-expo.id/IDEAFY.jpeg', 496, 8, 2, '2022-01-02 23:35:08', '2022-01-02 23:35:08'),
(324, 'Mobius Trip', '{\"blocks\":[{\"key\":\"c4sa5\",\"text\":\"Lead a group of travelers on a cross-country road trip in a world full of deadly robots in this turn based action strategy game. Swing, kick, shoot, and hack your way trough an army of killer robots to reach the east coast.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Mobius Trip.png', 'https://youtu.be/kjHq7XtYU5E', 'https://wahyu-candra.itch.io/mobius-trip', 'https://api.informatics-expo.id/Mobius Trip.png', 257, 19, 2, '2022-01-02 23:35:35', '2022-01-03 00:11:13'),
(325, 'DONT WASTE', '{\"blocks\":[{\"key\":\"93p13\",\"text\":\" Kami melihat banyak pebisnis kuliner khususnya di bidang\\nbakery dan fast food yang memproduksi makanan untuk dijual tetapi masih banyak\\nyang belum laku yang kemudian dibuang (sudah kadaluarsa). Saat kami ditugaskan\\nuntuk menentukan SDGs sebagai tema dari aplikasi yang akan dibuat, kami melalui\\nbanyak riset baik internet maupun sosial media, terdapat salah satu masalah\\nyang menarik perhatian kami yaitu seputar dunia kuliner. Jika melihat usaha\\nbakery atau fast food, banyak dari pelaku usaha tersebut membuang\\nmakanan-makanan yang masih layak konsumsi karena tidak mencapai target\\npenjualan produk, yang di mana hal ini sangat disayangkan karena masih\\nbanyaknya orang-orang yang membutuhkan makanan tersebut tetapi terkendala\\nsecara finansial. Maka dari itu kami memutuskan untuk mengambil SDGs No 2 (Zero\\nHunger). Setelah itu, kami melakukan pertemuan dan berdiskusi sembari\\nmengerjakan lembar tugas yang diberikan seperti menentukan permasalahan yang\\ndiberikan dan solusi tepat yang harus kami pikirkan dengan matang. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":1,\"length\":1022,\"style\":\"fontsize-12pt\"},{\"offset\":1,\"length\":1022,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"190v1\",\"text\":\"Proses yang kami lalui guna menemukan solusi yang dibutuhkan\\noleh masyarakat tidaklah singkat, wawancara secara langsung dengan masyarakat\\nsangat diperlukan. Jika bertumpu hanya berdasar informasi internet yang ada,\\ntidaklah begitu relevan. Solusi muncul atas masalah atau keresahan yang dialami\\noleh masyarakat. Berhubung prototipe aplikasi kami bergerak di bidang kuliner,\\nmaka kami mulai melakukan wawancara terhadap calon pengguna terkait aplikasi\\nkami. Pertanyaan yang kami berikan kepada calon pengguna seputar pendapat\\nmereka terkait produk makanan yang terbuang karena tidak laku terjual, selain\\nitu kami juga meminta pendapat mereka tentang aplikasi kami, fitur yang\\ndibutuhkan, dan juga saran serta masukan dari mereka. Sembari menghimpun saran\\ndan masukan dari para calon user, kami juga secara langsung mendatangi\\ntoko-toko bakery dan menanyai mereka dengan pertanyaan yang kami berikan kepada\\ncalon pengguna. Diharapkan para pebisnis bakery ingin bekerja sama dengan kami\\njika aplikasi kami dapat terealisasikan. Setelah memahami semua pendapat yang\\nada, kami menyimpulkan bahwa aplikasi kami merupakan salash satu solusi yang\\ndibutuhkan oleh masyarakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1167,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":1167,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"bvlct\",\"text\":\"Maka\\ndari itu kami berinisiatif untuk membuat sebuah aplikasi yang bertujuan\\nmembantu pebisnis kuliner untuk mengurangi makanan yang masih layak dikonsumsi\\ntetapi dibuang.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":171,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":171,\"style\":\"fontfamily-Times New Roman\\\", serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'DONT WASTE.jpeg', 'https://www.youtube.com/watch?v=bg1tydOAsBk', '', 'https://api.informatics-expo.id/DONT WASTE.jpeg', 498, 2, 2, '2022-01-02 23:40:23', '2022-01-02 23:40:23'),
(326, 'e - SmartGov', '{\"blocks\":[{\"key\":\"7n7mt\",\"text\":\"e - SmartGov merupakan sebuah aplikasi yang berbasis andorid.Hadirnya aplikasi ini bertujuan untuk memudahkan masyarakat dalam pembuatan KTP secara efektif dan efisien tanpa  harus datang ke kantor pelayanan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'e - SmartGov.png', 'https://youtu.be/GJ4ixWB4FRY', '', 'https://api.informatics-expo.id/e - SmartGov.png', 380, 11, 2, '2022-01-02 23:46:21', '2022-01-03 14:46:16'),
(327, 'Aplikasi Sehat Bergizi', '{\"blocks\":[{\"key\":\"3n45u\",\"text\":\"Aplikasi sehat bergizi berguna supaya masyarakat sadar betapa pentingnya mengatur dan menjaga pola kesehatan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Aplikasi Sehat Bergizi.png', 'https://youtu.be/TaYfDJpkAWU', '', 'https://api.informatics-expo.id/Aplikasi Sehat Bergizi.png', 467, 3, 2, '2022-01-03 10:01:30', '2022-01-08 11:32:24'),
(328, 'DASIDU', '{\"blocks\":[{\"key\":\"1aimh\",\"text\":\"Dasidu merupakan aplikasi dakwah yang memiliki berbagai macam fitur menarik, yang akan menambah wawasan seputar agama islam. Aplikasi ini juga diawasi oleh lembaga khusus sehingga apapun yang disebarkan merupakan berita yang sudah pasti benar kebenarannya.  \",\"type\":\"header-one\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":256,\"style\":\"color-rgb(37,37,37)\"},{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-24\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DASIDU.png', 'https://youtu.be/jeG7ek49yZ8', '', 'https://api.informatics-expo.id/DASIDU.png', 499, 4, 2, '2022-01-06 22:03:57', '2022-01-06 22:03:57'),
(330, 'Catatkeun ', '{\"blocks\":[{\"key\":\"3gi2r\",\"text\":\"Catatkeun merupakan sistem informasi akuntansi pencatat keuangan untuk UKM. Aplikasi ini dapat menyimpan data transaksi untuk banyak toko untuk satu akun pemilik. Selain itu aplikasi ini dapat menampilkan grafik persentase pendapatan setiap toko, grafik pendapatan dan pengeluaran perbulan serta grafik keuntungan disetiap bulannya. Aplikasi ini juga membantu pemilik UKM untuk mengelola akun karyawannya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Catatkeun .png', 'https://youtu.be/fU3_Qk4GBU8', '', 'https://api.informatics-expo.id/Catatkeun .png', 509, 8, 3, '2022-07-22 20:52:22', '2022-07-22 20:52:22');
INSERT INTO `projects` (`id`, `name`, `description`, `poster`, `videoLink`, `demoLink`, `gdriveLink`, `teamId`, `categoryId`, `expoDateId`, `created_at`, `updated_at`) VALUES
(331, 'Rent a Car', '{\"blocks\":[{\"key\":\"er1e3\",\"text\":\"Rent a Car adalah sistem informasi berbasis web untuk rental mobil. Sistem ini dibangun untuk mempermudah perusahaan dalam menganalisis data demi membantu manajemen perusahaan untuk membuat keputusan dan pengolahan data. Sistem yang akan di bangun termasuk kepada Management Level System karena dirancang untuk melayani pengamatan, pengendalian, pembuatan keputusan, dan aktivitas administratif dalam level manager menengah. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":424,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":424,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":424,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":424,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":264,\"length\":23,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Rent a Car.png', 'https://youtu.be/fuPXJvkv0B8', 'https://github.com/zanafiii/rentalmobil', 'https://api.informatics-expo.id/Rent a Car.png', 511, 17, 3, '2022-07-22 21:55:23', '2022-07-22 21:55:23'),
(332, 'Bajuju', '{\"blocks\":[{\"key\":\"399ak\",\"text\":\"Bajuju merupakan aplikasi berbasis web. Aplikasi ini merupakan aplikasi jual beli baju yang diperuntukan oleh UMKM penjual baju lokal. Aplikasi ini dapat membantu mereka untuk memasarkan produknya sehingga dapat lebih dikenal oleh publik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bajuju.jpeg', 'https://youtu.be/G0vR7UXUVmg', 'https://github.com/gabriel-tama/tubes_psi', 'https://api.informatics-expo.id/Bajuju.jpeg', 510, 8, 3, '2022-07-22 22:12:45', '2022-07-22 22:12:45'),
(333, 'GoTIk Marketplace', '{\"blocks\":[{\"key\":\"bnqcc\",\"text\":\"Go Batik (GoTik) merupakan sebuah marketplace yang menjual produk kerajinan batik. GoTIk memiliki tujuan untuk membantu pengusaha UMKM khususnya dibidang pengrajin batik untuk mendapat jangkauan pasar yang lebih luas serta lingkungan bisnis yang lebih suportif. GoTik diharapkan menjadi salah satu sarana untuk membangkitkan perekonomian masyarakat. Ada beragam cara untuk mendukung produk buatan Indonesia. Yuk jadikan produk lokal sebagai tuan rumah di negri sendiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":469,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":469,\"style\":\"fontsize-medium\"},{\"offset\":0,\"length\":469,\"style\":\"fontfamily-Poppins, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GoTIk Marketplace.jpeg', 'https://youtu.be/bQGxWViNEJ4', '', 'https://api.informatics-expo.id/GoTIk Marketplace.jpeg', 513, 8, 3, '2022-07-23 03:08:05', '2022-07-23 03:08:05'),
(334, 'NgemilSini', '{\"blocks\":[{\"key\":\"124m6\",\"text\":\"NgemilSini merupakan platform jual beli produk UMKM berbasis web yang menjual berbagai jenis camilan, baik berupa camilan kering, camilan basah, camilan instan, permen, cokelat, dan masih banyak lagi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"BOLD\"},{\"offset\":61,\"length\":3,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d7tp1\",\"text\":\"Apabila selama ini penjualan produk camilan hanya dilakukan secara tradisional, maka platform ini menghadirkan penjualan produk tidak terbatas di mana pembeli tidak harus datang ke toko untuk membeli produk dan penjual tidak harus memiliki toko untuk memasarkan produk-produknya. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"11d74\",\"text\":\"Melalui NgemilSini, pembeli dapat memesan produk dengan mudah dan penjual dapat memasarkan produk-produknya ke ranah yang lebih luas. NgemilSini juga memiliki fitur-fitur yang memudahkan penjual dalam me-manage produk-produknya dan memantau perkembangan usahanya yang dapat disajikan melalui grafik maupun tabel.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":8,\"length\":10,\"style\":\"BOLD\"},{\"offset\":134,\"length\":10,\"style\":\"BOLD\"},{\"offset\":204,\"length\":6,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'NgemilSini.png', 'https://youtu.be/oZPc0IhAF3s', 'https://youtu.be/oZPc0IhAF3s?t=48', 'https://api.informatics-expo.id/NgemilSini.png', 508, 8, 3, '2022-07-23 08:01:39', '2022-07-23 08:07:07'),
(335, 'DeCraft', '{\"blocks\":[{\"key\":\"7crr7\",\"text\":\"Pada saat ini banyak UMKM yang berkembang. Namun, untuk mencapai\\nperkembangan yang pesat, usaha kecil menghadapi komplikasi hambatan,\\nseperti: sistem produksi yang kurang efisien, strategi pemasaran yang kurang\\njitu, minimnya teknologi yang digunakan, dan lain sebagainya. Oleh karena itu,\\nDeCraft hadir untuk dapat membantu UMKM untuk berkembang pesat dengan cara\\nmemasarkan produknya, khususnya pada UMKM kerajinan tangan yang berada\\ndi Yogyakarta. \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":290,\"length\":7,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DeCraft.jpeg', 'https://youtu.be/CeZCEqzhq_s', '', 'https://api.informatics-expo.id/DeCraft.jpeg', 515, 8, 3, '2022-07-23 13:21:54', '2022-07-23 13:21:54'),
(336, 'LUCAS RENT', '{\"blocks\":[{\"key\":\"avoca\",\"text\":\"LUCAS RENT merupakan sistem informasi rental Sepeda dan Skuter. Aplikasi ini dapat menyewa skuter ataupun sepeda. Selain itu aplikasi ini dapat menampilkan grafik Stok yang ada pada gudang penyimpanan yang dimana akan selalu diupdate setiap harinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LUCAS RENT.jpeg', 'https://youtu.be/RMP7OK9UWGM', '', 'https://api.informatics-expo.id/LUCAS RENT.jpeg', 518, 8, 3, '2022-07-25 16:57:38', '2022-07-25 16:57:38'),
(338, 'Nony.ku', '{\"blocks\":[{\"key\":\"85aps\",\"text\":\"Nony.Ku adalah aplikasi berbasis web yang akan dikembangkan sebagai aplikasi pencatatan keuangan UKM. Tujuan aplikasi yang akan dikembangkan bisa digunakan untuk mencatat pengeluaran, pemasukan. Aplikasi ini juga dapat menyajikan data tersebut dengan grafik sehingga memudahkan untuk dibaca pengguna. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":300,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":300,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":300,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":300,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nony.ku.jpeg', 'https://youtu.be/CfORT-Md-9k', 'https://github.com/rasyad777/TubesPsi', 'https://api.informatics-expo.id/Nony.ku.jpeg', 504, 9, 3, '2022-07-25 18:40:50', '2022-07-26 15:00:36'),
(339, 'InstaDrive', '{\"blocks\":[{\"key\":\"9hk4e\",\"text\":\"InstaDrive MIS merupakan Management Information System (MIS) berbasis web yang bertujuan untuk menunjang usaha sewa kendaraan. InstaDrive MIS bertujuan untuk memperluas jangkauan pasar dan mempermudah manajemen ketersediaan kendaraan sewa.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'InstaDrive.png', 'https://youtu.be/-BJR-qoD4Hc', '', 'https://api.informatics-expo.id/InstaDrive.png', 521, 9, 3, '2022-07-26 20:12:51', '2022-07-26 21:01:31'),
(340, 'CoffeeKu', '{\"blocks\":[{\"key\":\"5pvkk\",\"text\":\"CoffeeKu adalah sistem informasi yang diperuntukan kepada pelaku UKM di sektor perkopian untuk mempermudah mereka dalam penjualan dan pencatatan hasil penjualan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CoffeeKu.png', 'https://www.youtube.com/watch?v=pv8Q8rQjtJo', '', 'https://api.informatics-expo.id/CoffeeKu.png', 525, 8, 3, '2022-07-27 22:50:37', '2022-07-27 23:39:11'),
(341, 'KasLen', '{\"blocks\":[{\"key\":\"cgdn\",\"text\":\"Proyek ini bernama Kas-Len dimana memiliki tujuan untuk mengatur segala pemasukan dan pengeluaran uang kas yang terjadi pada pelaku UMKM. Proyek ini sangat penting bagi pelaku UMKM karena mengingat pentingnya dalam mengelola keuangan dan dapat mengelolanya dengan baik merupakan sebuah keunggulan bagi pelaku bisnis agar dapat memprediksi langkah yang akan dilakukan oleh pelaku bisnis pada masa mendatang. Sistem ini juga menyediakan laporan keuangan dan laporan riwayat keuangan.\\n \\n \\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":481,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":481,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":481,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":481,\"style\":\"fontfamily-Arial\"},{\"offset\":19,\"length\":7,\"style\":\"BOLD\"},{\"offset\":176,\"length\":4,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'KasLen.png', 'https://youtu.be/87NsUSuspeg', '', 'https://api.informatics-expo.id/KasLen.png', 530, 8, 3, '2022-07-28 01:02:21', '2022-07-28 01:02:21'),
(342, 'NyatatJO', '{\"blocks\":[{\"key\":\"5ora6\",\"text\":\"NyatatJO adalah sebuah sistem perangkat lunak yang dibuat dan dirancang untuk memudahkan pelaku usaha Burjo dalam mengelola data yang ada sehingga mampu menjalakan bisnis dengan efektif dan efisien.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":198,\"style\":\"color-rgb(23,22,28)\"},{\"offset\":0,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"a6nc1\",\"text\":\"Dengan aplikasi NyatatJO dapat mengelola setiap kegiatan transaksi bisnis yang terkait menginput proses pemasukan dan pengeluaran, memonitor stok bahan baku, hingga laporan yang manfaatnya sangat membantu sebuah Burjo untuk berkembang lebih cepat. Dengan demikian penggunaan alat seperti NyatatJO akan sangat besar dampak baiknya bagi perjalanan suatu bisnis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":359,\"style\":\"color-rgb(23,22,28)\"},{\"offset\":0,\"length\":359,\"style\":\"fontfamily-YACgEQNAr7w 0\\\", _fb_, auto\"},{\"offset\":16,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":288,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[{\"offset\":288,\"length\":1,\"key\":0}],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"5vblr\",\"text\":\" \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.jurnal.id/id/software-accounting-indonesia-untuk-akunting/\",\"title\":\"N\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.jurnal.id/id/software-accounting-indonesia-untuk-akunting/\",\"title\":\"N\",\"targetOption\":\"_blank\"}}}}}}', 'NyatatJO.png', 'https://www.youtube.com/watch?v=wWyGzKmxED8', '', 'https://api.informatics-expo.id/NyatatJO.png', 531, 17, 3, '2022-07-28 03:18:38', '2022-07-28 03:18:38'),
(343, 'APEM (Aplikasi Pengelolaan Masjid)', '{\"blocks\":[{\"key\":\"6db09\",\"text\":\"APEM adalah sistem perangkat lunak untuk pengelolaan informasi antara pengurus dan jamaah, khususnya untuk menyebarkan kegiatan yang akan dilaksanakan masjid. Tujuan dari adanya aplikasi ini adalah untuk memudahkan pengurus masjid dalam menyebarkan informasi kegiatan juga dalam mengelola anggaran masjid.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":305,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":305,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":305,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":305,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6kqj0\",\"text\":\"Dengan adanya aplikasi ini, penyebaran informasi antara pengurus dan jamaah bisa lebih mudah dan tidak memakan banyak biaya.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":124,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":124,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":124,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":124,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'APEM (Aplikasi Pengelolaan Masjid).png', 'https://youtu.be/vW_75gcvauI', 'https://drive.google.com/file/d/1aCUrgZ9vxV25HollWSDMC4ccm64oxOj_/view?usp=sharing', 'https://api.informatics-expo.id/APEM (Aplikasi Pengelolaan Masjid).png', 532, 8, 3, '2022-07-28 12:42:51', '2022-07-28 12:42:51'),
(344, 'Gobooks', '{\"blocks\":[{\"key\":\"7hmoh\",\"text\":\"sistem informasi Perpustakaan ini didasari kesulitan petugas dalam mengelola perpustakaan seperti ketersediaan buku, jumlah peminjam buku, dll. Serta mempermudah anggota perpustakaan dalam meminjam buku.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Gobooks.png', 'https://www.youtube.com/watch?v=NkNtbNfg5JI', '', 'https://api.informatics-expo.id/Gobooks.png', 537, 4, 3, '2022-07-28 21:22:29', '2022-07-28 21:22:29'),
(345, 'PenKu X Azka Roti', '{\"blocks\":[{\"key\":\"aivg1\",\"text\":\"Salah satu aspek penting bagi kemajuan usaha adalah adanya catatan dan laporan keuangan. Catatan dan laporan keuangan dapat dilakukan dengan akutansi di mana akutansi ini nantinya akan menghasilkan informasi keuangan yang mampu menjadi gambaran bagi pelaku UMKM dalam mengambil keputusan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8f3d\",\"text\":\"Penku X Azka Roti merupakan sistem informasi pencatatan keuangan berbasis web yang dikhususkan untuk UMKM Azka Roti dengan tujuan membantu Azka Roti dalam melakukan penctatan keuangan dan pelaporan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":18,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PenKu X Azka Roti.jpeg', 'https://youtu.be/Khp7qZmWo2o', '', 'https://api.informatics-expo.id/PenKu X Azka Roti.jpeg', 526, 9, 3, '2022-07-28 21:35:43', '2022-07-29 11:55:15'),
(347, 'Saman', '{\"blocks\":[{\"key\":\"3qsfc\",\"text\":\"Tugas Besar matakuliah Grafika dan Multimedia membuat animasi. Animasi ini bertema budaya dimana kita mengambil budaya Tari Saman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Saman.png', 'https://youtu.be/28yfuRxJu0c', '', 'https://api.informatics-expo.id/Saman.png', 556, 4, 3, '2022-07-29 14:05:59', '2022-07-29 14:09:44'),
(368, 'MariBantu', '{\"blocks\":[{\"key\":\"b27k8\",\"text\":\"MariBantu adalah aplikasi berbasis website yang ditujukan untuk masyarakat umum, aplikasi ini bertujuan untuk membantu masyarakat dalam kegiatan berdonasi. Tidak hanya berdonasi, MariBantu juga memiliki fitur Galang Dana dan Zakat. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":231,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":231,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":231,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e38f53d7d53_227801Poster Paling Baru.png', '', 'https://www.canva.com/design/DAFHxnELQW4/n280za3EMRYo73j2tX2zEg/view?utm_content=DAFHxnELQW4&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', 'https://api.informatics-expo.id/62e38f53d7d53_227801Poster Paling Baru.png', 553, 1, 3, '2022-07-29 14:42:12', '2022-07-29 21:28:26'),
(369, 'ANIMASI MUDIK', '{\"blocks\":[{\"key\":\"ebmv8\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e3905f562fd_73157poster.png', 'https://youtu.be/TxP9cMyu9nE', '', 'https://api.informatics-expo.id/62e3905f562fd_73157poster.png', 560, 1, 3, '2022-07-29 14:46:39', '2022-07-29 14:46:39'),
(370, 'Bu-Comp', '{\"blocks\":[{\"key\":\"748i1\",\"text\":\"Bu-Comp adalah sebuah website jual beli online seputar aksesoris dan perangkat dari pc dan laptop. Dari website ini harapannya bisa memudahkan pengguna dalam membeli barang seputar pc dan laptop serta bisa menambahkan kepercayaan pelanggan untuk bertransaksi dalam website kami \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":98,\"style\":\"color-rgb(18,18,18)\"},{\"offset\":99,\"length\":178,\"style\":\"color-rgb(18,18,18)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Bu-Comp.jpeg', 'https://youtu.be/4OdMtsX5PSw', '', 'https://api.informatics-expo.id/Bu-Comp.jpeg', 562, 8, 3, '2022-07-29 14:55:07', '2022-07-29 14:55:07'),
(371, 'De\'kost', '{\"blocks\":[{\"key\":\"1i9rc\",\"text\":\"De’Kost merupakan aplikasi berbasis web yang secara fungsionalitas terbagi ke dalam dua fungsi, yaitu De’Kost sebagai Transaction Processing System (TPS) dan De’Kost sebagai Management Information System (MIS). Sebagai TPS, De’Kost merupakan sebuah aplikasi berbasis web yang diperuntukkan untuk membantu masyarakat umum terkhususnya mahasiswa dalam mencari tempat tinggal yang nyaman secara daring tanpa perlu mendatangi tempatnya secara langsung. Sementara sebagai MIS, De’Kost merupakan sebuah sistem informasi kos berbasis web yang menyajikan informasi aktual kepada pemilik kos terkait kos yang dimilikinya, serta informasi-informasi terkait yang dapat membantu pemilik kos meningkatkan kualitas kos miliknya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":714,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":714,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":714,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":714,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":0,\"length\":714,\"style\":\"fontsize-18\"},{\"offset\":118,\"length\":29,\"style\":\"ITALIC\"},{\"offset\":174,\"length\":29,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e3945e00db7_902450De\'Kost [POSTER].png', 'https://youtu.be/4EXjhEvtnFQ', 'https://github.com/ilham-2001/dekost', 'https://api.informatics-expo.id/62e3945e00db7_902450De\'Kost [POSTER].png', 539, 9, 3, '2022-07-29 15:03:42', '2022-07-29 15:09:59'),
(375, 'Asal Usul Reog Ponorogo', '{\"blocks\":[{\"key\":\"eq2i2\",\"text\":\"Kisah perjuangan Kelana Sewandana menaklukan Singo Barong untuk mendapatkan sang pujaan hati Putri Kediri Dewi Dyah Ayu Sangga Langit.  Apakah ia akan berhasil?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Asal Usul Reog Ponorogo.png', 'https://youtu.be/Xrpt7SVyvpM', '', 'https://api.informatics-expo.id/Asal Usul Reog Ponorogo.png', 572, 4, 3, '2022-07-29 16:35:13', '2022-07-29 16:35:13'),
(376, 'IHC (Intergreted Health Center) ', '{\"blocks\":[{\"key\":\"1begj\",\"text\":\"IHC/ Intergreted Health Center adalah suatu sistem perangkat lunak untuk saranan posyandu bagi bidan ata kader bidan. Bertujuan untuk memudahkan dalam memasukan data dan membuat laporan kesehatan.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Intergreted Health Center .png', 'https://youtu.be/AuGKHDzwBGc', 'https://www.figma.com/file/jLWEU4UbS05gmkz7OpCY7P/Vanof?node-id=0%3A1', 'https://api.informatics-expo.id/Intergreted Health Center .png', 546, 18, 3, '2022-07-29 16:37:18', '2022-07-29 19:26:52'),
(377, 'EasyBuy - Sistem Informasi Manajemen Stok Barang', '{\"blocks\":[{\"key\":\"qui9\",\"text\":\"EasyBuy adalah sistem ini dikhususkan untuk admin dengan tujuan mempermudah dalam mengurus dan mengelola stok barang yang tersedia di gudang.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":141,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'EasyBuy - Sistem Informasi Manajemen Stok Barang.png', 'https://youtu.be/i2gXY1nLqPM', '', 'https://api.informatics-expo.id/EasyBuy - Sistem Informasi Manajemen Stok Barang.png', 574, 8, 3, '2022-07-29 16:44:02', '2022-08-01 07:42:14'),
(378, 'Melestarikan Lagu Daerah', '{\"blocks\":[{\"key\":\"7095p\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Melestarikan Lagu Daerah.png', 'https://youtu.be/UsAN40LrAkE', '', 'https://api.informatics-expo.id/Melestarikan Lagu Daerah.png', 577, 4, 3, '2022-07-29 17:01:12', '2022-07-30 00:00:05'),
(379, 'Jobskuy', '{\"blocks\":[{\"key\":\"8oqu7\",\"text\":\"Jobskuy adalah website yang berfungsi untuk mempermudah masyarakat khususnya pengguna dalam memberi dan mencari pekerjaan.\",\"type\":\"header-four\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":122,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":122,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":122,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":122,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":122,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":122,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}},{\"key\":\"87j71\",\"text\":\"Explore more : https://jobskuy.rf.gd/ \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":15,\"length\":22,\"style\":\"bgcolor-rgb(24,24,24)\"},{\"offset\":15,\"length\":22,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":37,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":37,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":15,\"style\":\"fontsize-18\"},{\"offset\":15,\"length\":22,\"style\":\"BOLD\"},{\"offset\":15,\"length\":22,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":15,\"length\":22,\"style\":\"color-var(--yt-endpoint-color,var(--yt-spec-call-to-action))\"},{\"offset\":0,\"length\":37,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":37,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":37,\"style\":\"fontsize-inherit\"}],\"entityRanges\":[{\"offset\":15,\"length\":22,\"key\":0}],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://www.youtube.com/redirect?event=video_description&redir_token=QUFFLUhqbF81eHNmc2wzYjJHV0gxNGJjYnRoYnpQdHVQZ3xBQ3Jtc0tudVRTMUlaZDREc0lQRWxhcVV6aTBZQ1Jzd1ZHT3F3Y18wSUZZczh3bHVyZ1pZMHBDT0YwVXpOTzYwUlpJMDhYanJmMl81WHNxYjFOWnp2dERrTjBHWjlEZnV4TEFYTEhZSjY4Tmk1anotN1VVZml0UQ&q=htt