(380, 'GOVJOB', '{\"blocks\":[{\"key\":\"fe8bb\",\"text\":\"Govjob adalah website yang berfungsi untuk mempermudah masyarakat\\nkhususnya pengguna dalam memberi dan mencari pekerjaan. Selain itu, website\\nini juga langsung menampilkan list pekerjaan yang masih tersedia dan kisaran\\npendapatan yang akan diberikan secara langsung saat pekerjaan sudah selesai.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GOVJOB.jpeg', 'https://youtu.be/7tGVJdYwrJk', '', 'https://api.informatics-expo.id/GOVJOB.jpeg', 578, 8, 3, '2022-07-29 17:12:43', '2022-07-30 08:35:16'),
(381, 'Goldarium', '{\"blocks\":[{\"key\":\"5040h\",\"text\":\"Goldarium adalah aplikasi pengumpul informasi golongan darah yang bertujuan untuk memudahkan masyarakat dan penyedia layanan kesehatan dalam mencari calon pendonor saat keadaan darurat.\\n\\nFitur Goldarium Admin:\\n1. Cari Data: Telusuri data berdasarkan domisili atau golongan darah\\n2. Kelola Data:  Tambah, hapus, dan perbaharui data calon pendonor sesuai kebutuhan\\n3. Statistik: Memetakan jumlah calon pendonor berdasarkan golongan darahnya dalam bentuk chart.\\n4. Konfirmasi Permintaan: Meneruskan permintaan pencarian donor darah melalui pesan siaran ke seluruh pengguna Goldarium yang bergolongan darah sama.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":609,\"style\":\"color-rgb(3,3,3)\"},{\"offset\":0,\"length\":609,\"style\":\"bgcolor-rgb(249,249,249)\"},{\"offset\":0,\"length\":609,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":609,\"style\":\"fontfamily-Roboto, Arial, sans-serif\"},{\"offset\":0,\"length\":9,\"style\":\"BOLD\"},{\"offset\":186,\"length\":23,\"style\":\"BOLD\"},{\"offset\":210,\"length\":13,\"style\":\"BOLD\"},{\"offset\":279,\"length\":15,\"style\":\"BOLD\"},{\"offset\":363,\"length\":14,\"style\":\"BOLD\"},{\"offset\":459,\"length\":25,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Goldarium.png', 'https://youtu.be/BznmrDnEiQk', 'https://www.canva.com/design/DAFGOWq9tkQ/w3hPY-LIlnT0N6wLOIFXPQ/view?utm_content=DAFGOWq9tkQ&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/Goldarium.png', 579, 3, 3, '2022-07-29 17:16:14', '2022-07-29 17:16:14'),
(382, 'SIPER (Sistem Informasi Pekerjaan)', '{\"blocks\":[{\"key\":\"a3224\",\"text\":\"Apa itu SIPER ? SIPER adalah sebuah layanan masyarakat yang bergerak di bidang pekerjaan dan dibuat untuk membantu masyarakat menemukan pekerjaan yang sesuai dengan kemampuannya\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":8,\"length\":6,\"style\":\"BOLD\"},{\"offset\":16,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SIPER (Sistem Informasi Pekerjaan).jpeg', 'https://youtu.be/9xDTbSjMFu8', 'https://drive.google.com/file/d/1JH38VTWUXFf1w7sgSmzj71FLBKJbYihX/view?usp=sharing', 'https://api.informatics-expo.id/SIPER (Sistem Informasi Pekerjaan).jpeg', 580, 8, 3, '2022-07-29 18:29:55', '2022-07-30 17:13:59'),
(383, 'Animasi Lomba Lari 17 Agustus', '{\"blocks\":[{\"key\":\"98sm8\",\"text\":\"\\nTugas Besar matakuliah Grafika dan Multimedia Animasi Budaya Lomba Lari 17 Agustus\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":1,\"length\":82,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":1,\"length\":82,\"style\":\"fontsize-16\"},{\"offset\":1,\"length\":82,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Lomba Lari 17 Agustus.jpeg', 'https://www.youtube.com/watch?v=CZduIbnbCfw&t=3s', '', 'https://api.informatics-expo.id/Animasi Lomba Lari 17 Agustus.jpeg', 587, 17, 3, '2022-07-29 19:48:06', '2022-07-29 19:48:06'),
(384, 'Tes project', '{\"blocks\":[{\"key\":\"vkig\",\"text\":\"Tes project\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HTTP/1.0 500 Internal Server Error\nCache-Control: no-cache, private\nContent-Type:  application/json\nDate:          Fri, 29 Jul 2022 13:12:18 GMT\n\n{\"error\":{\"description\":\"Undefined offset: 1\"}}', 'https://www.youtube.com/', 'https://github.com/', 'https://api.informatics-expo.id/HTTP/1.0 500 Internal Server Error\nCache-Control: no-cache, private\nContent-Type:  application/json\nDate:          Fri, 29 Jul 2022 13:12:18 GMT\n\n{\"error\":{\"description\":\"Undefined offset: 1\"}}', 590, 2, 3, '2022-07-29 20:08:31', '2022-07-29 20:12:18'),
(386, 'Master Rent Car Yogyakarta', '{\"blocks\":[{\"key\":\"75kha\",\"text\":\"Master Rent Car adalah sistem yang dikhususkan untuk admin dalam mengelola pedapatan harian, bulanan, serta tahunan. Admin dapat mengetahui jumlah dan jenis mobil yang banyak  disewa setiap bulan nya. Selain itu sistem ini mempermudah admin dalam mencatat laporan penyewaan dan transaksi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Master Rent Car Yogyakarta.png', 'https://youtu.be/BrmXWa1xg2Y', '', 'https://api.informatics-expo.id/Master Rent Car Yogyakarta.png', 589, 9, 3, '2022-07-29 20:20:27', '2022-07-29 20:20:27'),
(387, 'GAMELANCE', '{\"blocks\":[{\"key\":\"2kerq\",\"text\":\"Aplikasi Gamelance memiliki fungsi utama sebagai media komunikasi antar gamers sehingga mampu mengirimkan pesan berupa teks, suara, gambar, video, maupun file. Pengguna dapat berinteraksi melalui chat (asinkron) ataupun live chat (sinkron), menampilkan game yang sedang dimainkan melalui fitur share screen, mengikuti atau membuat room chat, memilih kategori game, berbagi media, maupun menambah teman.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GAMELANCE(GL).jpeg', '', 'https://github.com/ghaniyyea/GameLance.git', 'https://api.informatics-expo.id/GAMELANCE(GL).jpeg', 594, 11, 3, '2022-07-29 20:28:46', '2022-08-01 19:14:45'),
(390, 'E-Kerja', '{\"blocks\":[{\"key\":\"9pmbf\",\"text\":\"E-kerja merupakan suatu sistem yang membantu pemerintah untuk mempermudah Pegawai memantau bawahan pegawainya dengan melihat laporan kinerja yang di input oleh bawahan pegawai tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-Kerja.jpeg', 'https://youtu.be/uNO6eKs6OIc', '', 'https://api.informatics-expo.id/E-Kerja.jpeg', 593, 9, 3, '2022-07-29 20:33:21', '2022-07-29 20:33:21'),
(395, 'CyberKriminal', '{\"blocks\":[{\"key\":\"1pu9j\",\"text\":\"CyberKriminal adalah sebuah layanan bertujuan mempermudah masyarakat dalam melapor tindakan kriminalitas dan juga pihak layanan darurat mudah mendapatkan laporan sekaligus mudah mendeteksi lokasi terjadinya kriminalitas.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bstuh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CyberKriminal.jpeg', 'https://youtu.be/hUhTvTUuiek', '', 'https://api.informatics-expo.id/CyberKriminal.jpeg', 592, 16, 3, '2022-07-29 20:41:10', '2022-07-31 07:43:02'),
(397, 'Pameran Batik ', '{\"blocks\":[{\"key\":\"6oi4c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pameran Batik .jpeg', 'https://youtu.be/IN40JjSL_NU', '', 'https://api.informatics-expo.id/Pameran Batik .jpeg', 608, 4, 3, '2022-07-29 20:42:31', '2022-07-30 19:44:44'),
(400, 'Ekatepe.', '{\"blocks\":[{\"key\":\"26qj1\",\"text\":\"Proyek yang kami buat ini hasil pertimbangan dari isu masalah yang muncul salah satunya yaitu Pembangunan daerah yang belum merata menyebabkan beberapa akses jalan menuju DISDUKCAPIL yang sulit dijangkau khususnya di daerah pelosok. Oleh karena itu, dengan adanya aplikasi ini kami berharap dapat memberikan kenyamanan kepada masyarakat yang mengalami dampak tersebut. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":368,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":368,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":368,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":368,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Ekatepe..jpeg', 'https://www.youtube.com/watch?v=O79HHFyXwEA', '', 'https://api.informatics-expo.id/Ekatepe..jpeg', 549, 8, 3, '2022-07-29 21:08:00', '2022-07-29 21:08:19'),
(402, 'E-Bako', '{\"blocks\":[{\"key\":\"5esic\",\"text\":\"Sebuah aplikasi bernama E - Bako ini adalah aplikasi jual beli yang menjual khusus bahan bahan sembako. Aplikasi ini dapat membantu masyarakat dan toko kelontong dalam membeli sembako, serta mempermudah penjual sembako dalam memantau penjualan barang, dan mempermudah penjual sembako dalam pengelolaan stock barang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'E-Bako.png', 'https://youtu.be/kvi_2PR7PSA', '', 'https://api.informatics-expo.id/E-Bako.png', 542, 8, 3, '2022-07-29 21:18:20', '2022-07-29 21:18:20'),
(403, 'Cerita Rakyat Candi Prambanan', '{\"blocks\":[{\"key\":\"crjpe\",\"text\":\"Cerita Rakyat tentang bagaimana Sejarah Candi Prambanan dibuat\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cerita Rakyat Candi Prambanan.jpeg', 'https://youtu.be/ZurUozAAzF0', '', 'https://api.informatics-expo.id/Cerita Rakyat Candi Prambanan.jpeg', 571, 4, 3, '2022-07-29 21:29:04', '2022-07-29 21:29:04'),
(404, 'StudioKala', '{\"blocks\":[{\"key\":\"2gtju\",\"text\":\"StudioKala merupakan perangkat lunak berbasis web online sebagai platform untuk menyalurkan hasil karya dibidang seni lukis bagi para seniman. StudioKala diharapkan dapat memberi akses pengguna untuk mengunggah dan memamerkan karya mereka secara online dan juga menyebarkan informasi mengenai pameran yang akan diselenggarakan oleh para seniman dengan tujuan agar lebih banyak khalayak umum yang mengetahui dan\\ndapat mengikuti pameran tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":11,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":21,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":31,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":37,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":46,\"length\":3,\"style\":\"fontsize-11pt\"},{\"offset\":50,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":57,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":65,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":74,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":80,\"length\":17,\"style\":\"fontsize-11pt\"},{\"offset\":98,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":113,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":118,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":124,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":129,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":154,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":165,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":171,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":179,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":185,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":194,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":200,\"length\":14,\"style\":\"fontsize-11pt\"},{\"offset\":215,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":226,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":232,\"length\":13,\"style\":\"fontsize-11pt\"},{\"offset\":246,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":253,\"length\":3,\"style\":\"fontsize-11pt\"},{\"offset\":257,\"length\":16,\"style\":\"fontsize-11pt\"},{\"offset\":274,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":284,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":293,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":301,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":306,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":311,\"length\":52,\"style\":\"fontsize-11pt\"},{\"offset\":364,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":370,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":377,\"length\":8,\"style\":\"fontsize-11pt\"},{\"offset\":386,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":391,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":396,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":407,\"length\":27,\"style\":\"fontsize-11pt\"},{\"offset\":435,\"length\":9,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}},{\"key\":\"dvdou\",\"text\":\"Selain itu, perangkat lunak ini dapat digunakan sebagai wadah agar para  seniman dapat menerima umpan balik mengenai karya mereka, baik dari sesama seniman maupun dari khalayak umum yang menikmati seni lukis. Dengan adanya fitur telah kami sediakan, para seniman dapat mengadakan lelang untuk karya yang ingin diperjual belikan untuk mendapatkan harga terbaik yang ditawarkan, serta dengan mengunggah karya lukis dalam waktu bersamaan pelukis dapat menjadikan bukti hak cipta karya yang mereka ciptakan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":12,\"length\":43,\"style\":\"fontsize-11pt\"},{\"offset\":56,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":62,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":73,\"length\":43,\"style\":\"fontsize-11pt\"},{\"offset\":117,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":123,\"length\":39,\"style\":\"fontsize-11pt\"},{\"offset\":163,\"length\":13,\"style\":\"fontsize-11pt\"},{\"offset\":177,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":182,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":187,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":197,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":202,\"length\":52,\"style\":\"fontsize-11pt\"},{\"offset\":255,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":263,\"length\":16,\"style\":\"fontsize-11pt\"},{\"offset\":280,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":287,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":293,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":299,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":304,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":310,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":320,\"length\":7,\"style\":\"fontsize-11pt\"},{\"offset\":328,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":334,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":346,\"length\":18,\"style\":\"fontsize-11pt\"},{\"offset\":365,\"length\":11,\"style\":\"fontsize-11pt\"},{\"offset\":377,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":383,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":390,\"length\":10,\"style\":\"fontsize-11pt\"},{\"offset\":401,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":407,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":413,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":419,\"length\":15,\"style\":\"fontsize-11pt\"},{\"offset\":435,\"length\":24,\"style\":\"fontsize-11pt\"},{\"offset\":460,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":466,\"length\":9,\"style\":\"fontsize-11pt\"},{\"offset\":476,\"length\":5,\"style\":\"fontsize-11pt\"},{\"offset\":482,\"length\":4,\"style\":\"fontsize-11pt\"},{\"offset\":487,\"length\":6,\"style\":\"fontsize-11pt\"},{\"offset\":494,\"length\":9,\"style\":\"fontsize-11pt\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'StudioKala.png', 'https://youtu.be/hc3JxYio7xs', '', 'https://api.informatics-expo.id/StudioKala.png', 595, 11, 3, '2022-07-29 21:36:08', '2022-07-30 20:16:54'),
(405, 'FundFare', '{\"blocks\":[{\"key\":\"vps1\",\"text\":\"Di masa sekarang, banyak orang yang berprofesi menjadi streamer. Namun, pendapatan yang mereka dapat sekarang sedang menurun dikarenakan iklan yang dipasang sangat sedikit akibat dari pandemi. Di saat seperti ini FundFare muncul.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4d37v\",\"text\":\"FundFare adalah sistem perangkat lunak yang bisa digunakan untuk melakukan sumbangan ke streamer. Penonton bisa melakukan sumbangan ke streamer saat dia sedang melakukan livestream dan mereka bisa mengetik pesan-pesan yang ingin mereka sampaikan ke streamer tersebut. FundFare juga bisa digunakan untuk charity yang dimana semua donasi yang didapat akan langsung disalurkan ke orang yang membutuhkan lewat instansi donasi terkait.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e95uu\",\"text\":\"Dengan adanya FundFare, diharapkan para streamer bisa mendapatkan pendapatan tambahan dan instansi donasi terkait bisa mendapatkan donasi lebih yang bisa digunakan untuk membantu orang-orang yang membutuhkan uang.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FundFare.png', 'https://youtu.be/YUoECtXZUKY', 'https://drive.google.com/file/d/1rfrIAROuWGVDGHLScB26_uaA-oDnYzG0/view?usp=sharing', 'https://api.informatics-expo.id/FundFare.png', 554, 8, 3, '2022-07-29 22:07:39', '2022-07-30 10:10:03'),
(407, 'Alun-alun Yogyakarta', '{\"blocks\":[{\"key\":\"17pp2\",\"text\":\"Ada 2 alun-alun di Yogyakarta, Alun-alun Utara dan Alun-alun Kidul.Alun-alun pada zaman dahulu digunakan prajurit keraton untuk berlatih. Alun-alun juga digunakan  untuk tempat untuk melakukan tradisi daerah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"emm6c\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Alun-alun Yogyakarta.jpeg', 'https://youtu.be/EhJbx3cghQY', '', 'https://api.informatics-expo.id/Alun-alun Yogyakarta.jpeg', 619, 4, 3, '2022-07-29 22:13:26', '2022-07-30 15:46:02'),
(408, 'TraFix', '{\"blocks\":[{\"key\":\"3rvts\",\"text\":\"People usually burn the trash\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fdtj\",\"text\":\"instead of recycling it to\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f49lk\",\"text\":\"reduce it. it will cause air\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"72s57\",\"text\":\"pollution.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5uj8v\",\"text\":\"That’s why we crete Trafix,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bbvll\",\"text\":\"We developed a desktop\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d6u10\",\"text\":\"application that eases the\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8g2kb\",\"text\":\"process of management of\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7d7i8\",\"text\":\"collecting and recycling\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f9up2\",\"text\":\"trash.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TraFix.png', 'https://youtu.be/7ESri_AvQQ8', 'https://www.figma.com/proto/RJM4gXSQ2dlOKmxEsS8m6t/For-Pc?page-id=231%3A921&node-id=231%3A1461&viewport=537%2C789%2C0.13&scaling=scale-down&starting-point-node-id=231%3A1461', 'https://api.informatics-expo.id/TraFix.png', 614, 9, 3, '2022-07-29 22:17:50', '2022-07-29 22:17:50'),
(409, 'IdeaShop', '{\"blocks\":[{\"key\":\"9s7ue\",\"text\":\"Ideashop adalah Sistem penjualan Ide bisnis berupa franchise dalam lingkup usaha UMKM. di mana kami selaku founder aplikasi ini akan menyediakan usaha-usaha yang bisa diikuti/dijalankan oleh masyarakat menengah kebawah dengan harga terjangkau.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4ncq3\",\"text\":\"Tujuan dibuatnya Ideashop ini adalah untuk membantu dan menambah pengetahuan, pengalaman, inisiatif, dan kecerdasan user mengenai ide bisnis yang ada. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":150,\"style\":\"color-rgb(55,55,55)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'IdeaShop.jpeg', 'https://youtu.be/43QoHSuJxlw', '', 'https://api.informatics-expo.id/IdeaShop.jpeg', 564, 8, 3, '2022-07-29 22:20:48', '2022-07-29 22:26:02'),
(410, 'AyoZakat - Layanan Pendataan Zakat', '{\"blocks\":[{\"key\":\"9vhq6\",\"text\":\"AyoZakat merupakan aplikasi yang khusus untuk pelayanan pendataan zakat para muzakki\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AyoZakat - Layanan Pendataan Zakat.png', 'https://youtu.be/UGaiPAXQ4GQ', 'https://www.figma.com/proto/dDoaEiVpj7CIz6i4UBkuIx/Untitled?node-id=17%3A398&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=17%3A398&show-proto-sidebar=1', 'https://api.informatics-expo.id/AyoZakat - Layanan Pendataan Zakat.png', 596, 4, 3, '2022-07-29 22:23:13', '2022-07-29 22:23:13'),
(411, 'MedClick', '{\"blocks\":[{\"key\":\"7mo98\",\"text\":\"MedClick  merupakan aplikasi yang dirancang untuk memudahkan manajemen data klinik anda, serta dalam memberikan pelayanan terhadap pasien. Selain itu aplikasi ini juga bisa digunakan pasien dalam melakukan reservasi untuk berobat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MedClick.jpeg', 'https://youtu.be/dz2VGxQIe2w', 'https://www.canva.com/design/DAFHzzW6jks/9gR8a2G7YLYKT4iFLenOxw/view?utm_content=DAFHzzW6jks&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton', 'https://api.informatics-expo.id/MedClick.jpeg', 621, 3, 3, '2022-07-29 22:43:53', '2022-07-29 22:43:53'),
(412, 'Sistar', '{\"blocks\":[{\"key\":\"4of77\",\"text\":\"Seiring berkembangnya zaman dan teknologi kebutuhan akan penelitian dan pengembangan dalam segala bidang semakin meningkat pesat, terutama dalam bidang platform aplikasi. Hal yang mendasarkan kemajuan teknologi ini adalah semakin dibutuhkannya material baru guna menunjang bidang industri yang lain. Maka dari itu, kami selaku kelompok Beyonder telah membuat aplikasi SISTAR atau SISTEM LAYANAN PENGANTAR SKCK KELURAHAN agar mempermudah masyarakat dalam pengurusan pengantar skck di kelurahan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":368,\"length\":7,\"style\":\"BOLD\"},{\"offset\":380,\"length\":39,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sistar.jpeg', 'https://youtu.be/edwWiz_SfoU', '', 'https://api.informatics-expo.id/Sistar.jpeg', 617, 16, 3, '2022-07-29 22:46:24', '2022-07-29 22:46:24'),
(413, 'FinCo', '{\"blocks\":[{\"key\":\"3tu7p\",\"text\":\"FinCo merupakan aplikasi berbasis website yang akan membantu para pelaku UKM untuk bisa mengatur dan mengelola keuangan dari proses bisnis yang dimiliki. Aplikasi ini diperuntukkan agar pelaku UKM dapat mencatat pengeluaran dan pendapatan keuangan serta mengetahui keuntungan dan kerugian dari pendapatan dan pengeluaran.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'FinCo.png', 'https://youtu.be/oE3Ui9CAxV0', '', 'https://api.informatics-expo.id/FinCo.png', 623, 8, 3, '2022-07-29 22:47:05', '2022-07-29 22:47:05'),
(414, 'Umkm-ku', '{\"blocks\":[{\"key\":\"94smd\",\"text\":\"UMKM-KU adalah sebuah aplikasi yang akan digunakan untuk memantau UMKM yang berada dikawasan Yogyakarta. Aplikasi ini nantinya akan berguna untuk meningkatkan kesejahteraan UMKM sendiri seperti contohnya adalah pemantauan pengunaan modal UMKM, feedback kepada UMKM setelah memberikan laporan dll. Oleh karena itu, kami ingin membuat sistem informasi yang dapat meningkatkan informasi yang ada guna membangun sebuah UMKM yang memiliki kualitas dan mutu yang baik terkhusus dalam yogyakarta sendiri. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":497,\"style\":\"color-rgb(20,17,15)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Umkm-ku.jpeg', 'https://youtu.be/cYmOKfoKJzo', '', 'https://api.informatics-expo.id/Umkm-ku.jpeg', 624, 9, 3, '2022-07-29 22:53:41', '2022-07-29 22:53:41');
