(416, 'Meditor', '{\"blocks\":[{\"key\":\"5jo06\",\"text\":\"Meditor merupakan suatu sistem berbasis web yang membantu pihak rumah sakit dalam mendaftarkan pasiennya, serta membantu bagian manajerial rumah sakit dalam mengelola data data penting yang dibutuhkan untuk operasional rumah sakit.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Meditor.jpeg', 'https://www.youtube.com/watch?v=XtwHtPyQoCQ&t=5s', 'https://www.youtube.com/watch?v=XtwHtPyQoCQ&t=5s', 'https://api.informatics-expo.id/Meditor.jpeg', 524, 18, 3, '2022-07-29 23:06:19', '2022-07-29 23:06:19'),
(418, 'Kepuhunan', '{\"blocks\":[{\"key\":\"10p9c\",\"text\":\"Kepuhunan (bahasa Banjar: Kapuhunan) adalah sebuah mitos masyarakat lokal di Kalimantan, istilah ini digunakan ketika seseorang ingin pergi ditawari makan dan minum tetapi tidak mengindahkan dan akhirnya tertimpa musibah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kepuhunan.jpeg', 'https://youtu.be/7KtdDL18Of0', '', 'https://api.informatics-expo.id/Kepuhunan.jpeg', 534, 4, 3, '2022-07-29 23:07:20', '2022-07-30 18:46:42'),
(419, 'Cuanin', '{\"blocks\":[{\"key\":\"e8j3o\",\"text\":\"Cuanin adalah sistem informasi manajemen akuntansi online dengan fitur terbaik untuk memberikan solusi automasi usaha yang mudah, efisien, kapanpun dan dimanapun. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":162,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":162,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":162,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Cuanin.jpeg', 'https://www.youtube.com/watch?v=5--EJwlj1eo', 'https://www.figma.com/proto/d22MiyQUSMOoJnhpqufZPi/Cuanin-2.0?node-id=35%3A2059&scaling=min-zoom&page-id=35%3A703&starting-point-node-id=35%3A2059', 'https://api.informatics-expo.id/Cuanin.jpeg', 631, 9, 3, '2022-07-29 23:11:34', '2022-07-31 21:15:29'),
(420, 'BuyMe by Skkrr', '{\"blocks\":[{\"key\":\"3qj4\",\"text\":\"Buyme by Skkrr merupakan pengembangan aplikasi pada sistem informasi yang diharapkan dapat memebantu penjual dalam melakukan jual beli\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BuyMe by Skkrr.png', 'https://youtu.be/O1Zlxb6Rqps', 'https://youtu.be/1iIf6sWbkkM', 'https://api.informatics-expo.id/BuyMe by Skkrr.png', 627, 8, 3, '2022-07-29 23:12:07', '2022-07-31 10:28:04'),
(421, 'KOMA (Toko Material)', '{\"blocks\":[{\"key\":\"68c8t\",\"text\":\"KOMA adalah Sistem Informasi  yang difungsikan untuk memudahkan masyarakat yang ingin membeli bahan bangunan tanpa harus keluar rumah, yang tentunya lebih mudah dan praktis.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'KOMA (Toko Material).png', 'https://youtu.be/MEYUxg2RN4w', 'https://komastore-frontend.vercel.app/', 'https://api.informatics-expo.id/KOMA (Toko Material).png', 559, 9, 3, '2022-07-29 23:50:28', '2022-07-29 23:50:28'),
(422, 'Plesiran', '{\"blocks\":[{\"key\":\"7ilsq\",\"text\":\"Plesiran adalah suatu aplikasi yang dapat dijadikan panduan bagi para wisatawan ketika ingin berkunjung ke suatu destinasi wisata. Selain itu, aplikasi ini juga mewadahi para pengelola wisata dan pengelola UMKM lokal agar wisata dan usahanya dapat dikenal luas oleh masyarakat umum. Di dalam aplikasi ini terdapat beberapa fitur seperti tambah wisata, tambah toko, lihat wisata serta lihat toko. Dengan kehadiran fitur - fitur tersebut diharapkan dapat membantu para pengelola wisata dan pengelola UMKM lokal untuk mempromosikan wisata dan usahanya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":508,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":488,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":488,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Plesiran.png', 'https://youtu.be/VbJ1bF-ED60', 'https://www.canva.com/design/DAFGjGGSvuI/QDnF0_F67nUDYAtUGEBKzg/view?utm_content=DAFGjGGSvuI&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton#10', 'https://api.informatics-expo.id/Plesiran.png', 653, 11, 3, '2022-07-30 01:49:51', '2022-07-30 16:14:30'),
(423, 'Restoran Klitih Versi 1.0', '{\"blocks\":[{\"key\":\"18jg7\",\"text\":\"Restoran Klitih adalah Sistem Informasi berbasis web untuk melakukan pencatatan transaksi dan pengkontrolan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Klitih,  penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat, dengan mempermudah manajemen untuk memutuskan dari permasalahan yang sering terjadi yang bisa diambil dari sistem informasi yang Restoran Klitih berikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":488,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"et7pe\",\"text\":\"Email = admin@binjai.com\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":24,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":24,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":24,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":24,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":24,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"b5d9t\",\"text\":\"Pass = 1 \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":8,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":8,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":8,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":8,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Klitih Versi 1.0.jpeg', 'https://yout