(425, 'Restoran Klitih Versi 1.1', '{\"blocks\":[{\"key\":\"3delc\",\"text\":\"Restoran Klitih adalah Sistem Informasi berbasis web untuk melakukan pencatatan transaksi dan pengkontrolan produk UKM di bidang kuliner, sehingga sektor ekonomi di Indonesia dapat lebih berkembang. Dengan adanya website Restoran Klitih,  penjualan produk UKM mejadi semakin berkembang luas dan kesejahteraan pelaku UKM bisa meningkat, dengan mempermudah manajemen untuk memutuskan dari permasalahan yang sering terjadi yang bisa diambil dari sistem informasi yang Restoran Klitih berikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":488,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":488,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":488,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"14tks\",\"text\":\"Email = admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"6ofsl\",\"text\":\"Pass = admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":12,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":12,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":12,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":12,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":12,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"e1uc1\",\"text\":\"https://slbkundur.sch.id/food/admin\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":35,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":35,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":35,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restoran Klitih Versi 1.1.jpeg', '', 'https://slbkundur.sch.id/food/', 'https://api.informatics-expo.id/Restoran Klitih Versi 1.1.jpeg', 667, 9, 3, '2022-07-30 08:10:06', '2022-07-30 14:04:41'),
(426, 'Kebudayaan Yogyakarta', '{\"blocks\":[{\"key\":\"7b0cs\",\"text\":\"Kisah perjalanan 3 orang sahabat ke Yogyakarta untuk mengenal lebih jauh budaya di Yogyakarta bersama seorang ahli budaya Yogyakarta. Ikuti keseruan mereka!!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kebudayaan Yogyakarta.png', 'https://youtu.be/a4apwpGsFDw', 'https://www.canva.com/design/DAFHr7jiwKw/z3UY82hmp8kSFaCjLfHUtA/view?utm_content=DAFHr7jiwKw&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/Kebudayaan Yogyakarta.png', 626, 4, 3, '2022-07-30 08:43:00', '2022-07-30 08:43:00'),
(427, 'Jariyah', '{\"blocks\":[{\"key\":\"arvuo\",\"text\":\"Aplikasi Jariyah merupakan aplikasi manajemen keuangan yang dibuat untuk para pengurus masjid yang memiliki tanggung jawab untuk mengurus keuangan masjid. Dengan menggunakan aplikasi jariyah, admin masjid bisa mencatat pemasukan dan pengeluaran masjid dengan mudah dan efektif. Sebab, proses penginputan data bisa dilakukan dengan cepat dan mudah. Apabila admin masjid melakukan kesalahan input data, admin masjid bisa mengubah/menghapus data tersebut dengan cepat dan mudah. Semua komponen yang menggunakan data yang telah diubah tersebut akan ikut berubah juga. Selain itu, aplikasi Jariyah dilengkapi dengan fitur pencarian data dimana admin masjid bisa mencari data pemasukan dan pengeluaran dengan memasukkan keyword yang berkaitan dengan ID, berita transaksi, nominal transaksi, dan jenis transaksi. Selanjutnya, aplikasi Jariyah juga dilengkapi dengan fitur keamanan berupa verifikasi saat login dan membuat akun baru. Admin masjid hanya bisa login apabila sudah terdaftar di aplikasi Jariyah dan memasukkan username dan password dengan benar. Lalu, admin baru hanya bisa login apabila permintaan pendaftarannya diterima oleh admin utama/yang sudah ada.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1161,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":1161,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":1161,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4a1946462e_757545JARIYAHKU.png', 'https://youtu.be/8YfSJRd-AcQ', 'https://github.com/nabiilNajm26/AplikasiJariyahFinal', 'https://api.informatics-expo.id/62e4a1946462e_757545JARIYAHKU.png', 557, 9, 3, '2022-07-30 10:12:20', '2022-07-30 10:12:20'),
(428, 'Suasana Jogja', '{\"blocks\":[{\"key\":\"50dlf\",\"text\":\"Sebuah Vlog pendek yang berisi tentang asal usul tugu jogja dan suasana angkringan di jogja\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Suasana Jogja.jpeg', 'https://youtu.be/wF_DRJQrG9Q', '', 'https://api.informatics-expo.id/Suasana Jogja.jpeg', 671, 4, 3, '2022-07-30 10:20:19', '2022-07-30 10:20:19'),
(429, 'Pergi ke Festival Seni', '{\"blocks\":[{\"key\":\"buupo\",\"text\":\"Sebuah film animasi pendek tentang pengalaman ke festival seni\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pergi ke Festival Seni.jpeg', 'https://youtu.be/fH_cbLJOA3E', '', 'https://api.informatics-expo.id/Pergi ke Festival Seni.jpeg', 672, 4, 3, '2022-07-30 10:23:55', '2022-07-30 10:23:55'),
(430, 'Nasi Padang', '{\"blocks\":[{\"key\":\"97kkt\",\"text\":\"Sebuah animasi yang membahas budaya kuliner yakni Nasi Padang \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":61,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":61,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":61,\"style\":\"fontsize-medium\"},{\"offset\":0,\"length\":61,\"style\":\"fontfamily-ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, \\\"Segoe UI\\\", Roboto, \\\"Helvetica Neue\\\", Arial, \\\"Noto Sans\\\", sans-serif, \\\"Apple Color Emoji\\\", \\\"Segoe UI Emoji\\\", \\\"Segoe UI Symbol\\\", \\\"Noto Color Emoji\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Nasi Padang.png', 'https://youtu.be/gHjDt-Hy5F8', '', 'https://api.informatics-expo.id/Nasi Padang.png', 673, 4, 3, '2022-07-30 10:47:03', '2022-07-30 10:48:03'),
(431, 'Si Rambut Gimbal', '{\"blocks\":[{\"key\":\"2kndl\",\"text\":\"Kebudayaan unik cukuran anak gimbal merupakan tradisi turun temurun yang dilakukan\\noleh masyarakat dataran tinggi Dieng. Anak-anak tersebut dianggap istimewa di mata penduduk\\nsetempat. Konon anak gimbal dianggap sebagai titisan Kyai Kolo Dete dan Nini Roro Ronce.\\nPasangan asal mataram kuno tersebut ditugaskan memperluas wilayah kekuasaan kerajaan\\nmataram. Karena pada saat ini Kyai Kolo Dete adalah seseorang yang sakti dan pembela rakyat\\nkecil. Selain memperluas wilayah. pasangan ini juga mendapat wahyu dari Nyi Roro Kidul untuk\\nmenjaga kesejahteraan masyarakat dieng. Wangsit tersebut ditandai dengan munculnya anak gimbal\\ndi daerah dieng.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Si Rambut Gimbal.jpeg', 'https://youtu.be/6T9cm7wC-9U', '', 'https://api.informatics-expo.id/Si Rambut Gimbal.jpeg', 676, 4, 3, '2022-07-30 11:01:43', '2022-07-30 11:38:37'),
(432, 'SocialMusic', '{\"blocks\":[{\"key\":\"9ddf5\",\"text\":\"SocialMusic adalah aplikasi sosial media di bidang hobi musik yang bertujuan sebagai wadah untuk mengembangkan minat dalam bermusik bagi para musisi atau komunitas musik seperti band dan tempat untuk mencari teman yang memiliki minat yang sama yaitu bermusik dengan berkomunikasi atau bahkan membentuk band melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9s9ah\",\"text\":\"SocialMusic dibuat karena sulitnya para musisi tunggal untuk membentuk band karena kebanyakan masih sekedar dari kenalan,baik itu teman komunitas atau teman ekstrakulikuler.Maka dari itu,SocialMusic memberikan kemudahan dan kebebasan para musisi untuk dapat menunjukkan bakat musiknya sehingga jika ada teman atau musisi lain yang tertarik terhadap kemampuan musisi tersebut,mereka bisa berkomunikasi dengan aplikasi SocialMusic ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SocialMusic.jpeg', 'https://youtu.be/vfcZnFTJTco', '', 'https://api.informatics-expo.id/SocialMusic.jpeg', 548, 11, 3, '2022-07-30 11:22:10', '2022-07-30 14:55:37'),
(433, 'Wayang Kulit', '{\"blocks\":[{\"key\":\"52qmt\",\"text\":\"Animasi yang mengangkat tema tentang Ragam Budaya Indonesia yang dikemas dengan pertunjukan wayang kulit  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":104,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":104,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":104,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":104,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4b311819d6_1472288png_20220730_110117_0000.png', 'https://youtu.be/XtqfDbXiLA8', '', 'https://api.informatics-expo.id/62e4b311819d6_1472288png_20220730_110117_0000.png', 668, 4, 3, '2022-07-30 11:26:57', '2022-07-30 11:26:57'),
(434, 'Museum Senjata', '{\"blocks\":[{\"key\":\"br28\",\"text\":\"Animasi yang membahas tentang senjata senjata tradisional Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Museum Senjata.jpeg', 'https://www.youtube.com/watch?v=yWw41cHp_9E', '', 'https://api.informatics-expo.id/Museum Senjata.jpeg', 681, 4, 3, '2022-07-30 11:37:31', '2022-07-30 11:41:07'),
(435, 'JOBPEDIA', '{\"blocks\":[{\"key\":\"6k3lb\",\"text\":\"JOBPEDIA adalah sebuah aplikasi pencari lowongan pekerjaan bagi yang membutuhkan pekerjaan, khususnya di kalangan mahasiswa, loker ini mempunyai beberapa fitur yang sangat berguna bagi para user yang ingin mencari pekerjaan, di antaranya fitur pekerjaan berdasarkan tempat, gaji, waktu, pekerjaan apa yang dilakukan, umur dan masih banyak lagi. loker juga mempunyai fitur testimoni yang dibuat oleh user untuk user, testimoni bertujuan untuk menampilkan bagaimana user lain menggunakan aplikasi loker\\ntersebut.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":8,\"style\":\"fontfamily-Times New Roman\\\", \\\"serif\"},{\"offset\":9,\"length\":501,\"style\":\"fontfamily-Times New Roman\\\", \\\"serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'JOBPEDIA.png', 'https://youtu.be/lOEPJNV9MQ4', '', 'https://api.informatics-expo.id/JOBPEDIA.png', 679, 8, 3, '2022-07-30 11:41:38', '2022-07-30 11:41:38'),
(436, 'Sangkuriang', '{\"blocks\":[{\"key\":\"4mht8\",\"text\":\"legenda cerita lokal masyarakat sunda tentang Sangkuriang dan Nyi Dayang Sumbi di wilayah Lembang Jawa Barat. Cerita legenda ini terkenal dari jaman ke jaman mengenai asal usul adanya gunung tangkuban perahu .\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":207,\"style\":\"color-rgb(51,51,51)\"},{\"offset\":0,\"length\":207,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":207,\"style\":\"fontsize-14\"},{\"offset\":0,\"length\":207,\"style\":\"fontfamily-Helvetica Neue\\\", Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sangkuriang.png', 'https://youtu.be/wK2pczZPwMY', '', 'https://api.informatics-expo.id/Sangkuriang.png', 683, 4, 3, '2022-07-30 12:33:37', '2022-08-01 00:04:09'),
(437, 'Cerita Pendek Malin Kundang - Processing', '{\"blocks\":[{\"key\":\"5umtd\",\"text\":\"Animasi Kartun: Malin Kundang dari Tanah Minang, Pulau Sumatera.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":16,\"length\":47,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"15nv9\",\"text\":\"Malin Kundang menolak untuk mengakui ibunya yang miskin dan tua setelah ia menjadi saudagar kaya. Ibunya merasa sangat sedih dan berdoa kepada Tuhan untuk menghukum putranya yang tidak berbakti.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d6sfb\",\"text\":\"Akankah doanya dikabulkan?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8qgfs\",\"text\":\"Sebuah cerita pendek  yang penuh dengan pelajaran moral, untuk segala usia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Cerita Pendek Malin Kundang - Processing.png', 'https://youtu.be/XlG_OdsWijE', '', 'https://api.informatics-expo.id/Cerita Pendek Malin Kundang - Processing.png', 687, 4, 3, '2022-07-30 12:40:28', '2022-07-30 12:40:28'),
(438, 'LEB(Layanan Edukasi Bertani)', '{\"blocks\":[{\"key\":\"a5dbp\",\"text\":\"LEB adalah aplikasi yang menyediakan layanan edukasi mengenai pertanian untuk orang awam yang ingin belajar tentang pertanian namun masih terkendala sulitnya mengakses informasi tersebut.pada aplikasi ini terdapat berbagai informasi yang disusun dalam bentuk materi ataupun berupa video penjelasn yang di gunakan untuk mempermudah penggguna memahami informasi tersebut.Dengan adanya aplikasi ini di harapkan pengguna mampu memecahkan masalah yang di hadapi seputar pertanian \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":474,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":474,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":474,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":474,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":474,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'LEB(Layanan Edukasi Bertani).jpeg', 'https://youtu.be/tEqJyI-bn9M', 'https://www.figma.com/proto/tclEFiI1Ggc8MiW3KBBgfF/LEB---MSI?node-id=1%3A8&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A8', 'https://api.informatics-expo.id/LEB(Layanan Edukasi Bertani).jpeg', 685, 4, 3, '2022-07-30 12:45:59', '2022-07-30 12:45:59'),
(439, 'BANTAL', '{\"blocks\":[{\"key\":\"149g0\",\"text\":\"BANTAL adalah sebuah aplikasi Bantuan Kesehatan Mental  yang membantu pengguna kesehatan mental agar bisa  memdapatkan konseling  secara online dan praktis  , serta  memudahkan pengguna untuk menjadwalkan konsultasi dengan tenaga ahli professional, Selain itu pengguna juga dapat melacak perkembangan mood, gejala kesehatan mental Dan faktor lain yang memengaruhi kesehatan mental seperti durasi tidur.Aplikasi ini juga memiliki beberapa fitur tambahan seperti dapat mengetahui layanan tenaga ahli terdekat serta dapat berbagi pendapat dengan pengguna lain.\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":61,\"length\":105,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":61,\"length\":105,\"style\":\"fontsize-16\"},{\"offset\":61,\"length\":105,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"center\"}}],\"entityMap\":{}}', 'BANTAL.jpeg', 'https://www.youtube.com/watch?v=1H33QjdYAdg', 'https://www.figma.com/proto/jl7XQusPhKMVRWxhdEuMeD/BANTAL?node-id=13%3A50&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=13%3A50', 'https://api.informatics-expo.id/BANTAL.jpeg', 678, 3, 3, '2022-07-30 12:50:16', '2022-07-30 12:50:16'),
(440, 'Siklus', '{\"blocks\":[{\"key\":\"6kies\",\"text\":\"Siklus: Plastik Dibalik Pangan Kita\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c26tu\",\"text\":\"Menggambarkan siklus yang terlahir akibat budaya konsumtif manusia akan plastik dan penyebabnya terhadap pangan kita (microplastic).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Siklus.jpeg', 'https://youtu.be/dmVqogTqGcs', '', 'https://api.informatics-expo.id/Siklus.jpeg', 586, 11, 3, '2022-07-30 12:50:48', '2022-07-31 13:09:15'),
(442, 'AmalBaik', '{\"blocks\":[{\"key\":\"1d4ht\",\"text\":\"AmalBaik merupakan platform zakat & infaq berbasis aplikasi yang dibuat untuk membudahkan kita sebagai seorang muslim dalam menyempurnakan ibadah kita terutama dalam membayar zakat dan berinfaq guna membantu saudaara kita yang membutuhkan bantuan diluar sana\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AmalBaik.png', 'https://youtu.be/eX4_9A79uG4', 'https://www.figma.com/proto/SFnEGg2t3afAughocVZXwH/AmalBaik?node-id=1%3A2&scaling=scale-down&page-id=0%3A1&starting-point-node-id=1%3A2&show-proto-sidebar=1', 'https://api.informatics-expo.id/AmalBaik.png', 502, 2, 3, '2022-07-30 13:15:59', '2022-07-30 13:15:59'),
(443, 'Sejarah Batik Kawung Yogyakarta', '{\"blocks\":[{\"key\":\"isgo\",\"text\":\"Batik dianggap sebagai ikon budaya penting di Indonesia. Batik adalah kerajinan yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"32pjr\",\"text\":\"memiliki nilai seni tinggi dan telah menjadi bagian dari budaya Indonesia (khususnya Pulau\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"efvj1\",\"text\":\"Jawa) sejak lama. Dari sekian banyak motif batik yang ada di Indonesia, salah satu yang sangat\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9k01g\",\"text\":\"terkenal adalah batik Kawung.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"78p7e\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"42hat\",\"text\":\"Dari hal tersebut, kami mengangkat motif Kawung ini sebagai tema budaya dari animasi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dc5qv\",\"text\":\"kami yang menceritakan seorang wisatawan yang berlibur ke Yogyakarta dan bingung terhadap\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"p6cv\",\"text\":\"barang apa yang harus ia beli untuk oleh-oleh. Salah satu warga lokal menghampirinya lalu ia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bsur0\",\"text\":\"memberikan saran yaitu membeli batik Kawung untuk dijadikan oleh-oleh dari Yogyakarta yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"89p50\",\"text\":\"terkenal dengan nilai seni yang tinggi serta sangat menarik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Sejarah Batik Kawung Yogyakarta.png', 'https://youtu.be/YBJt1DvtE1Y', '', 'https://api.informatics-expo.id/Sejarah Batik Kawung Yogyakarta.png', 688, 2, 3, '2022-07-30 13:21:59', '2022-07-30 13:21:59'),
(444, 'ALUR (Aplikasi Administrasi Kelurahan)', '{\"blocks\":[{\"key\":\"fj3gb\",\"text\":\"ALUR (Aplikasi Administrasi Kelurahan) merupakan sebuah aplikasi yang berkaitan dengan pelayanan administrasi kependudukan. Aplikasi ini bertujuan untuk mempermudah masyarakat dalam memproses pembuatan surat-surat penting serta dapat mempermudah penyusunan data administrasi bagi pihak Kelurahan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":296,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":296,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":296,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":296,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":296,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":38,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"mtfb\",\"text\":\"Jenis surat yang dapat diajukan adalah:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"av154\",\"text\":\"Surat Keterangan Kematian\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":25,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":25,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":25,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":25,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":25,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"1sb7i\",\"text\":\"Surat Keterangan Tidak Mampu\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"8bbf3\",\"text\":\"Surat Keterangan Penghasilan \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":28,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":28,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":28,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}}],\"entityMap\":{}}', 'ALUR (Aplikasi Administrasi Kelurahan).jpeg', 'https://youtu.be/0PCDibDNbFY', 'https://www.canva.com/design/DAFHxrFEbVQ/h0gIX64X9hWFoh6b62vyuQ/view?utm_content=DAFHxrFEbVQ&utm_campaign=designshare&utm_medium=link&utm_source=publishpresent', 'https://api.informatics-expo.id/ALUR (Aplikasi Administrasi Kelurahan).jpeg', 613, 9, 3, '2022-07-30 13:36:43', '2022-07-30 19:20:42'),
(446, 'Quondam', '{\"blocks\":[{\"key\":\"5qp5f\",\"text\":\"Quondam merupakan suatu aplikasi Ecommerce yang membantu masyarakat  dalam jual beli secara online dan bisa juga bertemu secara langsung antara penjual dan pembeli dan Quondam menjual barang bekas dan barang baru. Quondam memiliki tujuan yaitu memudahkan masyarakat dalam melakukan kegiatan jula beli produk baru ataupun bekas. Dengan tampilan sederhana yang mudah diakses oleh semua kalangan. Dengan penggunaan yang mudah dalam menggunakan aplikasi ini akan dapat meringankan para penggunanya baik bagi para penjual untuk memasang iklan dan sekaligus bagi pembeli untuk mencari beragam produk barang bekas dan barang baru untuk kebutuhan sehari-hari.     \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":1,\"style\":\"fontsize-24\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"fnrq3\",\"text\":\"- Jual  Beli \",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d4kne\",\"text\":\"Jual beli barang baru maupun barang bekas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5kaem\",\"text\":\"- Jangkauan  Luas\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"fontsize-18\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"eku6m\",\"text\":\"Terjangkau dan mudah  di cari karna tersebar luas ke seluruh indonesia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Quondam.png', 'https://youtu.be/cdDW_g5JUVk', 'https://www.figma.com/proto/mlBlkyZAkjP9ULEMaRuqbu/Quondam?node-id=8%3A7&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=8%3A7', 'https://api.informatics-expo.id/Quondam.png', 670, 8, 3, '2022-07-30 14:17:17', '2022-07-30 14:41:10'),
(447, 'iNFOSHOP', '{\"blocks\":[{\"key\":\"cnnvb\",\"text\":\"iNFOSHOP is an application for buying and selling goods that is easy and simple to apply, you can manage, change, clean, delete the sales items you want, with INFOSHOP you will easily sell the products you need, we provide space for sellers to sell items here , with the system we provide, you will be able to easily sell your products. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"12nj8\",\"text\":\"INFOSHOP, your business marketing information.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'iNFOSHOP.png', 'https://youtu.be/TnrKLqHsXbU', 'https://www.figma.com/proto/uy1c8foPTQx4ko2UN6IFPp/iNFOSHOP?page-id=0%3A1&node-id=5%3A48&viewport=356%2C311%2C0.06&scaling=min-zoom&starting-point-node-id=5%3A48&show-proto-sidebar=1', 'https://api.informatics-expo.id/iNFOSHOP.png', 691, 9, 3, '2022-07-30 14:32:17', '2022-07-30 17:43:18'),
(448, 'Wisata Budaya', '{\"blocks\":[{\"key\":\"7t9br\",\"text\":\"Wisata budaya sendiri adalah perjalanan seorang wisatawan yang didampingi oleh tour guide untuk mempelajari budaya-budaya yang terdapat di Indonesia .\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e4dee3df6f9_84723POSTER WISATA BUDAYA.jpeg', 'https://youtu.be/NZDXg1XJJIk', '', 'https://api.informatics-expo.id/62e4dee3df6f9_84723POSTER WISATA BUDAYA.jpeg', 656, 4, 3, '2022-07-30 14:33:56', '2022-07-30 14:53:32'),
(450, 'EATS.', '{\"blocks\":[{\"key\":\"5njnp\",\"text\":\"EATS. is a restaurant data management application. EATS helps manage your restaurant data flexibility and efficiently.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'EATS..jpeg', 'https://youtu.be/R6VdeJEPaQw', 'https://www.figma.com/file/OHEElqX9vWWfQlcksY3Kt4/NMS?node-id=0%3A1', 'https://api.informatics-expo.id/EATS..jpeg', 669, 9, 3, '2022-07-30 15:36:05', '2022-07-30 15:36:05'),
(451, 'Permainan Sepak Bola Kampung', '{\"blocks\":[{\"key\":\"8tn6u\",\"text\":\"Hasil animasi dari kelompok TDR-3000 yaitu permainan bola kampung sederhana yang mengimplementasikan permainan tradisional anak-anak pada pedesaan. Mekanisme game kami yaitu, akan keluar dari running processing apabila mengenai pemain, out, dan mencetak gol.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Permainan Sepak Bola Kampung.jpeg', 'https://www.youtube.com/watch?v=Gh1_7BUe1D8', '', 'https://api.informatics-expo.id/Permainan Sepak Bola Kampung.jpeg', 702, 11, 3, '2022-07-30 15:52:56', '2022-07-30 15:54:37'),
(452, 'SosTance', '{\"blocks\":[{\"key\":\"s9jg\",\"text\":\"SosTance adalah aplikasi yang memiliki tujuan utama yaitu menyalurkan bantuan sosial dari pemerintah kepada masyarakat yang kurang mampu. Di dalam aplikasi ini pengguna dapat melihat ketersediaan stok bahan pokok dan pengguna dapat langsung menambahkan barang yang diinginkan di kolom tambah list kebutuhan. Di samping itu SosTance juga dapat menyediakan bantuan berupa modal tempat usaha yang dapat digunakan oleh masyarakat untuk memulai usaha nya. Pengguna cukup memasukkan provinsi, kota, dan alamat lengkap pada fitur penyediaan modal tempat usaha.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'SosTance.jpeg', 'https://youtu.be/6ReA0X-b2DY', 'https://www.figma.com/file/mkt5nLz2Ic6DlBb8L75qJD/Untitled', 'https://api.informatics-expo.id/SosTance.jpeg', 682, 3, 3, '2022-07-30 15:56:35', '2022-07-30 16:26:25'),
(453, 'The Return Of Purbasari', '{\"blocks\":[{\"key\":\"5o56j\",\"text\":\"Animasi yang menceritakan tentang turunnya tahta suatu kerajaan. Kisah ini bermula di tanah Pasundan, dimana putri sulung yang cemburu dengan putri bungsu sehingga menimbulkan konflik. Konflik tersebut berakhir dengan makna didalamnya. Penasaran dengan cerita The return of Purbasari? ayoo di tontooonnn!!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'The Return Of Purbasari.png', 'https://youtu.be/IajL2waup0A', '', 'https://api.informatics-expo.id/The Return Of Purbasari.png', 705, 4, 3, '2022-07-30 16:12:05', '2022-07-30 16:15:19'),
(454, 'CukurMas', '{\"blocks\":[{\"key\":\"bebe2\",\"text\":\"CukurMas merupakan Sistem Informasi berbasis web yang diperuntukkan bagi UKM dan UMKM jasa cukur atau yang lebih dikenal luas dengan istilah barbershop. Harapan atas dibuat dan dikembangkan CukurMas ini dapat membantu dan berpengaruh terhadap pelaku usaha barbershop juga customer yang mencari jasa cukur sehingga digitalisasi proses bisnis dan tujuan dari pelayanan barbershop dapat tercapai sebaik mungkin. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CukurMas.png', 'https://www.youtube.com/watch?v=Chenf6UOw5g', 'https://docs.google.com/presentation/d/1GADX4pJJtTQmHR3n5ivoHTc6W-bnjvUGs8UgLATJva4/edit#slide=id.p', 'https://api.informatics-expo.id/CukurMas.png', 507, 3, 3, '2022-07-30 16:16:27', '2022-07-30 16:16:27'),
(455, 'MERIAM KARBIT', '{\"blocks\":[{\"key\":\"27t7f\",\"text\":\"MERIAM KARBIT \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":13,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"b0qab\",\"text\":\"Tradisi Meriam Karbit memiliki sejarah yang menarik. Konon, dahulu Kesultanan Kadriah di Pontianak yang berdiri pada tahun 1771 – 1808 membunyikan meriam untuk mengusir hantu, khususnya kuntilanak yang ada di Kota Pontianak. Karena pada waktu itu, Raja pertama Pontianak yang bernama Syarif Abdurrahman Alkadrie ketika membuka lahan untuk bertempat tinggal di Pontianak sempat diganggu oleh hantu-hantu. Lalu Sultan memerintahkan pasukannya untuk mengusir hantu itu dengan meriam . Pontianak menurut cerita adalah sebuah kota yang memiliki hantu kuntilanak. Karena pada dasarnya Pontianak berasal dari kata bunting dan anak. Selain itu bunyi yang keras dari meriam karbit menandakan waktu azan magrib.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":701,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":701,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":701,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":701,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'MERIAM KARBIT.jpeg', 'https://youtu.be/zhfcS90JzAE', '', 'https://api.informatics-expo.id/MERIAM KARBIT.jpeg', 704, 4, 3, '2022-07-30 16:24:59', '2022-07-30 16:29:36'),
(456, 'Diversity', '{\"blocks\":[{\"key\":\"958up\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Diversity.jpeg', 'https://youtu.be/q8MO56fQqmg', '', 'https://api.informatics-expo.id/Diversity.jpeg', 699, 16, 3, '2022-07-30 16:29:10', '2022-07-30 16:29:10'),
(457, 'CharitAble', '{\"blocks\":[{\"key\":\"5f59o\",\"text\":\"“CharitAble is an app designed as a solution for acquiring transparency in the transaction  of the donation,  reduce the amount of physical donation box or giving money to beggars as  it is prohibited by the law of the nation.”\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6ts99\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96ser\",\"text\":\"- CharitAble’s Creators (2022)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'CharitAble.png', 'https://youtu.be/SpgIj92mhbI', 'https://www.figma.com/proto/IG8KuGz8DGITjbaOWFuRGq/CharitAble-Rev?page-id=0%3A1&node-id=6%3A22&viewport=-517%2C480%2C0.59&scaling=contain&starting-point-node-id=2%3A2', 'https://api.informatics-expo.id/CharitAble.png', 716, 11, 3, '2022-07-30 17:16:58', '2022-07-30 17:20:12'),
(458, 'C\'mon Go Shopping', '{\"blocks\":[{\"key\":\"2tho3\",\"text\":\"C\'mon Go Shopping berupa aplikasi sistem informasi jual beli produk UMKM berbasis web merupakan aplikasi yang memiliki tujuan untuk menciptakan media yang dapat memperkenalkan produk-produk UKM dan memberikan layanan informasi bagi admin dan pembeli mengenai produk UMKM dan jumlah produk terjual dari transaksi tersebut. Sistem informasi manajemen ini dibentuk untuk memenuhi tugas akhir dari matakuliah Sistem Informasi Jurusan Informatika, Fakultas Teknologi Industri, Universitas Islam Indonesia.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'C\'mon Go Shopping.png', 'https://www.youtube.com/watch?v=1CYtvFsz2jg', 'https://github.com/mylnisonya/PSI-CGS', 'https://api.informatics-expo.id/C\'mon Go Shopping.png', 712, 8, 3, '2022-07-30 17:19:20', '2022-07-30 17:20:17'),
(459, 'Tweelogy', '{\"blocks\":[{\"key\":\"9tqm6\",\"text\":\"Sebuah aplikasi berbasis web yang memiliki hubungan timbal balik antara penjual, supplier dan pembeli. Tweelogy memungkinkan penjual (admin) dapat memasarkan barang jualan yang diperoleh dari supplier, sedangkan pembeli dapat memilih dan membeli barang jualan tersebut. Di dalamnya juga terdapat 2 fitur SIM yang dapat membantu admin dalam mengetahui perkembangan, membuat laporan, dan mengambil keputusan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tweelogy.png', 'https://youtu.be/N1RWo_NHOgk', 'https://github.com/Hestri074/Tweelogy', 'https://api.informatics-expo.id/Tweelogy.png', 717, 8, 3, '2022-07-30 17:26:32', '2022-07-30 17:55:51'),
(460, 'Budaya Korupsi', '{\"blocks\":[{\"key\":\"a8oi3\",\"text\":\"Budaya sangatlah beragam, budaya juga mencerminkan bagaimana keunikan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7p4ir\",\"text\":\"suatu daerah atau tempat yang bisa kita lihat, tetapi ada juga budaya yang bisa\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"57adg\",\"text\":\"membuat dampak yang buruk, apalagi kalau bukan budaya korupsi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Budaya Korupsi.png', 'https://youtu.be/mloEeFVWjMk', '', 'https://api.informatics-expo.id/Budaya Korupsi.png', 719, 16, 3, '2022-07-30 17:28:20', '2022-07-30 21:54:44'),
(461, 'Lomba 17 Agustus', '{\"blocks\":[{\"key\":\"9ped7\",\"text\":\"Animasi dengan cerita memperkenalkan perlombaan 17 Agustus kepada turis\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Lomba 17 Agustus.png', 'https://www.youtube.com/watch?v=Nz3svXcSklg', '', 'https://api.informatics-expo.id/Lomba 17 Agustus.png', 625, 4, 3, '2022-07-30 17:42:12', '2022-07-30 17:42:12'),
(462, 'LocalPride', '{\"blocks\":[{\"key\":\"1o3je\",\"text\":\"LocalPride merupakan penyedia lapak online yang akan memberikan tempat untuk brand local yang bergerak di bidang fashion dan memiliki fitur Manajemen Information System. Dalam Manajemen Information System itu sendiri Penjual bisa membaca data yang bisa untuk membantu proses bisnis kedepannya, Seperti data produk terlaris, jumlah pendapatan perbulan, dan promosi penjualan. Tujuan MIS ini untuk memudahkan penjual membuat perencanaan pengendalian proses bisnisnya. Di tampilkan dalam bentuk diagram yang memudahkan penjual untuk membaca data tersebut.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2uf79\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"471jh\",\"text\":\"LocalPride ingin memajukan industri fashion di Indonesia maka dari itu kami memberikan lapak untuk brand local tersebut untuk mempromosikan produk mereka di LocalPride. Karena untuk Platform belanja online sekarang sangat brand local kecil belum bisa mendapatkan panggungnya untuk itu LocalPride menyediakan tempat untuk local brand.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'LocalPride.png', '', 'https://drive.google.com/file/d/1qpL9uSBy7sjyVjQoaupe-nTP_lueELGn/view?usp=sharing', 'https://api.informatics-expo.id/LocalPride.png', 610, 8, 3, '2022-07-30 17:43:22', '2022-07-30 17:43:22'),
(463, 'DONASIA', '{\"blocks\":[{\"key\":\"bkpef\",\"text\":\"Donasia adalah solusi sistem pendonasian dengan targaet medis, bencana alam, dan zakat yang ada di indonesia. Donasia hanya menerima media uang dengan memakai dompet digital agar minim potongan. Uang yang didonasikan oleh donatur akan disampaikan ke penerima tanpa adanya potongan sedikitpun dan biaya tambahan seperti pajak dan laib-lain akan ditanggung oleh kami dengan iklan yang akan pengguna liat di halamna home.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e511fd92626_942272Poster DONASIA.png', 'https://youtu.be/_eAlOdWchtk', 'https://drive.google.com/file/d/1-SYgs23wJh-6uqyn9ShjA50v9TqkOHHY/view?usp=sharing', 'https://api.informatics-expo.id/62e511fd92626_942272Poster DONASIA.png', 720, 11, 3, '2022-07-30 18:11:57', '2022-07-30 18:11:57'),
(465, 'Malin Kundang', '{\"blocks\":[{\"key\":\"ci0b9\",\"text\":\"Malin kundang adalah cerita rakyat yang sangat terkenal di Indonesia dan sudah banyak diketahui oleh masyarakat, kami akan membuat cerita Malin kundang tersebut menjadi animasi 2D yang akan kami buat dengan Processing, selamat menonton\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang.png', 'https://youtu.be/B7NvNQC3onU', '', 'https://api.informatics-expo.id/Malin Kundang.png', 722, 19, 3, '2022-07-30 18:20:33', '2022-07-30 18:20:33'),
(466, 'GoCHAR', '{\"blocks\":[{\"key\":\"c12cv\",\"text\":\"GoCHAR adalah aplikasi donasi dengan sistem gamifikasi, dengan aplikasi ini berdonasi kini lebih fleksibel. Aplikasi ini dilengkapi dengan beberapa fitur yaitu, Donasi yang dapat membantu sesama, Galang Donasi yang dapat terjangkau ke seluruh pengguna, Misi yang dapat dikonversi menjadi poin, dan Peringkat yang didapat dari poin yang telah dikonversi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"BOLD\"},{\"offset\":161,\"length\":6,\"style\":\"BOLD\"},{\"offset\":196,\"length\":13,\"style\":\"BOLD\"},{\"offset\":253,\"length\":5,\"style\":\"BOLD\"},{\"offset\":298,\"length\":9,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'GoCHAR.jpeg', 'https://youtu.be/ERH0eTeKOjk', 'https://www.figma.com/proto/9y3N2pTJ9FYWtMGbLUV43k/Untitled?node-id=13%3A726&scaling=scale-down&page-id=0%3A1&starting-point-node-id=13%3A726', 'https://api.informatics-expo.id/GoCHAR.jpeg', 684, 3, 3, '2022-07-30 18:28:40', '2022-07-31 00:03:14'),
(467, 'REZERVA', '{\"blocks\":[{\"key\":\"3qnmo\",\"text\":\"Banyaknya restoran di Indonesia yang kewalahan dalam mengelola proses pemesanan, pembayaran, hingga pengelolaan restoran itu sendiri. Seperti halnya, pengelolaan keuangan, pendapatan, makanan, dan sejenisnya. Oleh karena itu Rezerva hadir untuk memudahkan restoran dalam pengelolaan hal yang telah disebutkan tadi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8udug\",\"text\":\"Rezerva merupakan sebuah sistem informasi berbasis web untuk reservasi restoran. Dengan cara customer melalukan scanning barcode yang ada di meja restoran lalu akan diarahkan ke halaman rezerva untuk memesan makanan. Tidak hanya itu, customer bisa melakukan pembayaran secara cashless aplikasi ini juga memiliki dua subsistem, yaitu untuk customer dan managerial.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2o135\",\"text\":\"Target audiens yang kita incar, yaitu pemilik restoran yang kesulitan dalam pengelolaan restorannya dan menginginkan sebuah sistem pemesanan secara online dan pemantauan usaha secara berkala. Juga, customer yang tidak ingin repot mengantri di kasir sehingga mereka memesan melalui aplikasi ini.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"36tae\",\"text\":\"Rezerva memiliki beberapa fitur, di antaranya adalah pemesanan dan pembayaran makanan online, sistem keranjang, pengelolaan pesanan, laporan pendapatan, mengelola menu, laporan menu, trend analisis, dan masih banyak lagi.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'REZERVA.png', 'https://www.youtube.com/watch?v=al2Rr170rT4', 'https://github.com/AufaAsmawy19551/psi-rezerva', 'https://api.informatics-expo.id/REZERVA.png', 575, 9, 3, '2022-07-30 18:33:16', '2022-07-30 18:33:16'),
(468, 'Layanan Kelurahan', '{\"blocks\":[{\"key\":\"668as\",\"text\":\"Layanan Kelurahan adalah aplikasi layanan masyarakat, guna membantu mempermudah pendataan pengurusan dokumen dan dapat lebih efisien. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Layanan Kelurahan.png', 'https://youtu.be/E2tQqR2_7F4', '', 'https://api.informatics-expo.id/Layanan Kelurahan.png', 727, 11, 3, '2022-07-30 18:37:55', '2022-07-30 18:37:55');
