(469, 'SCULTOURING', '{\"blocks\":[{\"key\":\"el9q8\",\"text\":\"Kalian tahu Taman Mini Indonesia Indah?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":39,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":39,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":39,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"59emi\",\"text\":\"Walau tidakpernah kesana, setidaknya sebagian besar kita pasti tahu apa itu Taman Mini Indonesia Indah atau TMII.TMII merupakan suatu kawasan taman wisata bertema budaya Indonesia yang berada di Jakarta Timur.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":211,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":211,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":211,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":211,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":211,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"5ddp6\",\"text\":\"Eits, tapi bukan tentang TMII yang akan kita bahas di sini. Melainkan keberagaman budaya Indonesia yang bisa dilihat serta dipelajari disana.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":141,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":141,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":141,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":141,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":141,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"4g51n\",\"text\":\"Scultouring berkisah tentang dua anak SD yang mengunjungi TMII bersama gurunya. Lebih tepatnya, mereka mengunjungi salah satu kawasan di sana yang bernama Anjungan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":165,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":165,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":165,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":165,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":165,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"breqp\",\"text\":\"Apa saja yang mereka lihat di sana? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":36,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":36,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":36,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":36,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":36,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}},{\"key\":\"emipa\",\"text\":\"Yuk, intip keseruan dan kelucuan mereka menjelajahi rekam budaya Indonesia di TMII🙌  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":84,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":84,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":84,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"left\"}}],\"entityMap\":{}}', 'SCULTOURING.png', 'https://www.youtube.com/watch?v=IaggB96rcKc', 'https://github.com/AufaAsmawy19551/grafmul-budaya-nusantara', 'https://api.informatics-expo.id/SCULTOURING.png', 583, 4, 3, '2022-07-30 19:52:22', '2022-07-30 19:52:22'),
(470, 'Lompat Batu Nias', '{\"blocks\":[{\"key\":\"firfg\",\"text\":\"Tradisi lompat batu bisa ditemukan di Desa Bawomataluo Kabupaten Nias Selatan. Tradisi lompat batu ini disebut Fahombo, yang biasanya dilakukan para pemuda dengan cara melompati tumpukan batu yang mencapai setinggi 2 meter dan setebal 40 cm untuk menunjukkan bahwa mereka sudah pantas untuk dianggap secara fisik. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":313,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":313,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":313,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":19,\"style\":\"BOLD\"},{\"offset\":0,\"length\":313,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":313,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"justify\"}}],\"entityMap\":{}}', 'Lompat Batu Nias.jpeg', 'https://youtu.be/oj8CvdKANbk', '', 'https://api.informatics-expo.id/Lompat Batu Nias.jpeg', 734, 4, 3, '2022-07-30 20:12:22', '2022-07-30 20:16:01'),
(471, 'Wisata Budaya', '{\"blocks\":[{\"key\":\"4rppm\",\"text\":\"Bhineka Tunggal Ika. Berbeda-beda, tetapi tetap satu jua. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"sc38\",\"text\":\"Itulah semboyan yang dipegang kuat oleh bangsa Indonesia. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1otqm\",\"text\":\"Semboyan itu menggambarkan bahwa meskipun bangsa Indonesia memiliki beragam budaya, suku bangsa, ras, bahasa, dan agama, \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5gc4q\",\"text\":\"tetapi bangsa ini tetap memegang erat prinsip persatuan dan kesatuan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4nr0o\",\"text\":\"sudahkah kamu mengenal seluruh kekayaan budaya di indonesia? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3poe\",\"text\":\"Yuk, jalan-jalan bareng Yanto dan Joko agar wawasan budaya kamu bisa bertambah ;)\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e52f8d371da_276310posterfix.jpg', 'https://youtu.be/sotsuMVwu1E', '', 'https://api.informatics-expo.id/62e52f8d371da_276310posterfix.jpg', 591, 15, 3, '2022-07-30 20:18:05', '2022-07-30 20:18:05'),
(472, 'Tubes Dadakan, Bingung sampe Taman Mini (Mini Series)', '{\"blocks\":[{\"key\":\"7hn42\",\"text\":\"sebuah cerita mengenai seorang Mahasiswa yang tiba-tiba mendapatkan tugas dadakan dan kebingungan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tubes Dadakan, Bingung sampe Taman Mini (Mini Series).png', 'https://youtu.be/g7NeuBgEGuQ', '', 'https://api.informatics-expo.id/Tubes Dadakan, Bingung sampe Taman Mini (Mini Series).png', 615, 4, 3, '2022-07-30 20:18:59', '2022-07-30 20:18:59'),
(473, 'RUKUN', '{\"blocks\":[{\"key\":\"43rf2\",\"text\":\"Rukun merupakan suatu sistem perangkat lunak untuk pengelolaan komunitas masyarakat.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6bvi1\",\"text\":\"Khususnya mencakup fungsi seperti pelaporan gangguan, transaksi pembayaran, mempromosikan UMKM dan banyak fungsi lainnya. Rukun juga dapat digunakan setiap anggota masyarakat hingga pengurus komunitas setempat, transparansi data keuangan, peminjaman inventaris dan pengajuan dokumen tertentu.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6n40b\",\"text\":\"Kehadiran RUKUN diharapkan dapat meningkatkan efisiensi dalam bermasyarakat. Hal ini didukung dengan fitur-fitur yang hadir untuk memudahkan pengguna dalam bermasyarakat. Dalam setiap fungsinya RUKUN akan tersinkronisasi secara otomatis dengan aplikasi ketiga sebagai pendukung setiap fungsi yang ada.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '62e530f99f808_771157POSTER ANTARES (2).png', 'https://youtu.be/TNvMW2Ph3QI', 'https://github.com/luhihsan/Rukun-App/tree/master', 'https://api.informatics-expo.id/62e530f99f808_771157POSTER ANTARES (2).png', 706, 11, 3, '2022-07-30 20:24:09', '2022-07-30 20:57:26'),
