,\"data\":{}}],\"entityMap\":{}}', '62e530fbe6860_771157POSTER ANTARES (2).png', 'https://youtu.be/TNvMW2Ph3QI', 'https://github.com/luhihsan/Rukun-App/tree/master', 'https://api.informatics-expo.id/62e530fbe6860_771157POSTER ANTARES (2).png', 706, 11, 3, '2022-07-30 20:24:12', '2022-07-30 20:24:12'),
(476, 'PODS - Podcast and Audiobook', '{\"blocks\":[{\"key\":\"dai0m\",\"text\":\"PODS is an audio streaming and media services provider that focuses on podcasts and audiobooks. It is one of the largest podcast streaming service providers that offer an interactive live streaming feature.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"chlrh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7jj6p\",\"text\":\"You can enjoy our high-quality content from verified creators without any distraction from ads.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PODS - Podcast and Audiobook.jpeg', 'https://youtu.be/BGIpqrh-zl0', 'https://www.figma.com/proto/XQaUerPLwVfUcYoutLJDr4/FAD-PODS?node-id=44%3A81&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=44%3A81', 'https://api.informatics-expo.id/PODS - Podcast and Audiobook.jpeg', 743, 9, 3, '2022-07-30 20:29:32', '2022-07-31 08:59:50'),
(477, 'Malin Kundang', '{\"blocks\":[{\"key\":\"7s1db\",\"text\":\"Kisah Malin Kundang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang.jpeg', 'https://youtu.be/au4yXwtFCMs', '', 'https://api.informatics-expo.id/Malin Kundang.jpeg', 744, 4, 3, '2022-07-30 20:37:49', '2022-07-30 22:28:15'),
(478, 'Animasi Legenda Candi Prambanan', '{\"blocks\":[{\"key\":\"druol\",\"text\":\"Ceri singkat legenda terbentuknya Candi Prambanan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Animasi Legenda Candi Prambanan.png', 'https://drive.google.com/file/d/1osNAEkujTbBtt_L_xmGbcMzc7rATKg-2/view?usp=sharing', '', 'https://api.informatics-expo.id/Animasi Legenda Candi Prambanan.png', 746, 4, 3, '2022-07-30 20:52:06', '2022-07-30 20:56:11'),
(479, 'Keliling Indonesia', '{\"blocks\":[{\"key\":\"66lhl\",\"text\":\"Keliling Indonesia bercerita tentang seorang pemuda yang berkunjung kerumah orang tua sambil berjalan-jalan di tempat tersebut menikmati suasana di kota tersebut. Scene di mulai dengan menaiki pesawat kemudian turun di sebuah bandara yang kemudian berkunjung kerumah orang tua. Setelah berkunjung kerumah orang tuanya, pemuda tersebut berjalan-jalan ke salah satu tempat iconic di tempat tersebut. Setelah berjalan-jalan di tempat iconic, pemuda tersebut singgah ke tempat ibadah sebelum menuju ke sebuah pantai untuk menikmati sunset di kota tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Keliling Indonesia.jpeg', 'https://youtu.be/3TsoJjc0kUg', '', 'https://api.informatics-expo.id/Keliling Indonesia.jpeg', 696, 4, 3, '2022-07-30 20:53:36', '2022-07-30 20:53:36'),
(480, 'DESTAL ', '{\"blocks\":[{\"key\":\"51no1\",\"text\":\"Destal (Desa Digital) merupakan layanan pengaduan masyarakat desa untuk memudahkan dalam melaporkan masalah yang terjadi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"am9r9\",\"text\":\"Destal memiliki fitur :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bq364\",\"text\":\"1. Melaporkan permasalahan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"14rju\",\"text\":\"2. Mengedit dan menghapus laporan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ao1qg\",\"text\":\"3. Melihat statistik dari laporan yang telah terkirim berdasarkan kategori\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c1ipq\",\"text\":\"4. Melihat informasi kontak dan lokasi desa yang menggunakan DESTAL\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7c8tm\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'DESTAL (Layanan Pengaduan Masyarakat).png', 'https://youtu.be/Qkerb2mxu1k', 'https://www.figma.com/proto/ozsE5BcbBw42sUunHUAfEx/Destal-by-ZEUS?node-id=72%3A297&scaling=scale-down&page-id=0%3A1&starting-point-node-id=72%3A297&show-proto-sidebar=1', 'https://api.informatics-expo.id/DESTAL (Layanan Pengaduan Masyarakat).png', 732, 11, 3, '2022-07-30 20:55:22', '2022-07-30 21:04:04'),
(482, 'StomousQ', '{\"blocks\":[{\"key\":\"1tqv7\",\"text\":\"Aplikasi desktop yang bertujuan mempermudah masyarakat dalam memberikan sumbangan dan pendataan sumbangan yang diberikan ke masjid sekitar. Dengan adanya StomousQ pencatatan sumbangan menjadi lebih tertata dan tersimpan dengan baik tanpa harus mendata manual yang hanya menghasilkan limbah.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'StomousQ.png', 'https://youtu.be/ujgiztToPCk', '', 'https://api.informatics-expo.id/StomousQ.png', 745, 11, 3, '2022-07-30 21:07:53', '2022-07-30 21:07:53'),
(483, 'Ondel-ondel', '{\"blocks\":[{\"key\":\"frc5h\",\"text\":\"Topik yang diambil dalam project ini adalah kebudayaan. Kebudayaan yang diangkat adalah\\nondel-ondel yang terdiri dari sejarah, filosofi dan keunikan. Karakter ondel-ondel diambil karena sudah\\nterkenal di indonesia bahkan mancanegara. Tetapi, rata-rata tidak dijelaskan mengenai latar belakang\\nondel-ondel \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Ondel-ondel.jpeg', 'https://youtu.be/AJ1Gm4UWYTE', '', 'https://api.informatics-expo.id/Ondel-ondel.jpeg', 751, 4, 3, '2022-07-30 21:12:45', '2022-07-31 00:54:59'),
(484, 'Berkunjung ke Museum Keraton', '{\"blocks\":[{\"key\":\"b8u5r\",\"text\":\"      Bercerita mengenai 2 orang anak yang masih bersekolah bersama mengunjungi sebuah museum untuk mengenal lebih dalam mengenai adat dan budaya Jawa. Bertujuan agar anak keturunan kita bisa mengenal budaya-budaya leluhur kita agar tidak punah dan dilestarikan dan menumbuhkan rasa bangga dan memiliki atas adat budaya tersebut.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Berkunjung ke Museum Keraton.jpeg', '', '', 'https://api.informatics-expo.id/Berkunjung ke Museum Keraton.jpeg', 730, 4, 3, '2022-07-30 21:15:43', '2022-07-30 21:17:27'),
(485, 'Joni dan Joni dengan Pintu Ajaib di Candi Prambanan', '{\"blocks\":[{\"key\":\"ceoqr\",\"text\":\"Animasi ini menceritakan 2 orang pemuda yang sedang berlibur ke candi prambanan. Karena mereka baru pertama kali ke berwisata disana membuat mereka tersesat saat berada di komplek candi. Kemudian mereka melihat sebuah pintu berwarna pink. Saat mereka membuka pintu itu tiba-tiba mereka tersedot ke ruang-waktu. Kebetulan pemandu wisata disana lagi keliling, saat si pemandu melihat 2 pemuda itu tersedot oleh pintu itu, si pemandu segera berlari untuk menyelamatkan kedua pemuda itu, namun alhasil si pemandu pun ikut tersedot oleh pintu itu. Saat mereka tersadar mereka berada di masa lalu, ternyata mereka sadar saat candi prambanan sedang dibangun. Namun mereka bertiga tidak bisa dilihat oleh orang-orang disana seolah-olah mereka tidak ada. Sambil mencari jalan pulang mereka menyaksikan apa yang terjadi disana. Setelah beberapa hari berlalu, saat Roro Jonggrang dikutuk menjadi candi ke 1000. Mereka tiba-tiba melihat pintu pink itu, akhirnya mereka segera membuka pintu tersebut untuk kembali ke dunia mereka. Saat mereka keluar dari pintu, mereka sedang melayang diatas langit, ketika akan jatuh ke tanah, ternyata itu mimpi dari dari si Joni. selesai\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Joni dan Joni dengan Pintu Ajaib di Candi Prambanan.png', 'https://youtu.be/anxqK33Use', '', 'https://api.informatics-expo.id/Joni dan Joni dengan Pintu Ajaib di Candi Prambanan.png', 735, 8, 3, '2022-07-30 21:16:57', '2022-07-30 21:16:57'),
(486, 'COLOSSAL', '{\"blocks\":[{\"key\":\"16o5b\",\"text\":\"COLOSSAL merupakan layanan organisasi kepemudaan untuk memudahkan organisasi atau komunitas yang ada dalam mengatur keuangannya mulai dari pengeluaran, pemasukan, tagihan dan iuran anggota, serta laporan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d63bo\",\"text\":\"Keunggulan yang di miliki COLOSSAL ialah :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8n5m\",\"text\":\"Pengelolaan data yang akurat, dan risiko kesalahan dapat diminimalisir\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6a78b\",\"text\":\"Adanya perbandingan update data keuangan organisasi terkini dengan diagram\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6jsg1\",\"text\":\"Adanya update status anggota tentang tagihan iuran setiap bulan atau iuran harian dengan menampilkan status lunas dan atau belum lunas\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'COLOSSAL.jpeg', 'https://youtu.be/TsLGrIzbttA', 'https://linktr.ee/colossal_by_capella', 'https://api.informatics-expo.id/COLOSSAL.jpeg', 750, 8, 3, '2022-07-30 21:17:46', '2022-08-02 01:14:32'),
(487, 'Budaya Gotong Royong', '{\"blocks\":[{\"key\":\"9shdv\",\"text\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":653,\"style\":\"color-rgb(20,20,20)\"},{\"offset\":0,\"length\":653,\"style\":\"fontfamily-YAD1bxogMz4 0\\\", _fb_, auto\"}],\"entityRanges\":[{\"offset\":0,\"length\":653,\"key\":0},{\"offset\":653,\"length\":1,\"key\":1}],\"data\":{}},{\"key\":\"9s6p0\",\"text\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan “bhinneka tunggal ika” yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":335,\"style\":\"color-rgb(20,20,20)\"},{\"offset\":0,\"length\":335,\"style\":\"fontfamily-YAD1bxogMz4 0\\\", _fb_, auto\"}],\"entityRanges\":[{\"offset\":0,\"length\":335,\"key\":2},{\"offset\":335,\"length\":1,\"key\":3}],\"data\":{}},{\"key\":\"dv07e\",\"text\":\"Dari ratusan budaya yang mengakar pada diri generasi-generasi mudanya, budaya gotong-royong dan tolong menolong adalah salah satu dari budaya yang masih dilestarikan hingga saat ini. Gotong-royong sendiri merupakan salah satu asas dalam Pancasila. Secara makna gotong royong adalah sebuah kegiatan yang dilaksanakan secara bersama-sama dan memiliki sifat sukarela. Supaya kegiatan yang dilakukan bisa berjalan dengan lancar, ringan, dan juga mudah. Salah satu contoh kegiatan yang bisa dilakukan secara gotong royong ialah pembangunan fasilitas umum yang ditujukan bagi masyarakat luas, membersihkan lingkungan desa, hingga kerja bakti yang dilakukan secara bersama-sama. Sedangkan tolong menolong sendiri merupakan suatu kegiatan yang di dalamnya terdapat aksi saling tolong menolong di antara satu sama lain dengan tujuan untuk meringankan beban hidup dari seseorang ataupun beban dari sebuah pekerjaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman.\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Indonesia merupakan sebuah negara yang kaya akan budaya dan tradisinya. Indonesia juga kental akan keanekaragaman suku dan etniknya, kita dapat dengan mudah bertemu dengan berbagai orang yang memiliki latar belakang suku yang berbeda-beda. Di indonesia sendiri terdapat begitu banyak suku yang tersebar di seluruh penjuru negeri. Kita mengenal suku betawi yang ada di Jakarta, suku sunda yang ada di Jawa Barat, suku bugis yang ada di Sulawesi, atau bahkan suku dayak yang ada di Kalimantan. Dengan letak geografis dari Indonesia yang berbentuk pulau-pulau, sudah menjadi hal yang wajar apabila negeri kita ini memiliki beragam corak dan keanekaragaman.\",\"targetOption\":\"_blank\"}}}},\"1\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\"}}}},\"2\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan “bhinneka tunggal ika” yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi.\",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\"Di mana corak dan keanekaragaman ini dapat kita lihat dari adanya puluhan rumah adat, lagu daerah, atau bahkan pakaian adat yang begitu bermacam-macam. Keberagaman budaya yang ada di Indonesia sendiri tergambar sangat jelas dari semboyan “bhinneka tunggal ika” yang telah diwariskan sejak ratusan tahun silam dari generasi ke generasi.\",\"targetOption\":\"_blank\"}}}},\"3\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\",\"_map\":{\"type\":\"LINK\",\"mutability\":\"MUTABLE\",\"data\":{\"url\":\"https://docs.google.com/spreadsheets/d/1DUF2isFWsqVSYhbaACYtbgcLi_YjDqpE3GLQIVgkKQg/edit#gid=69851113\",\"title\":\" \",\"targetOption\":\"_blank\"}}}}}}', 'Budaya Gotong Royong.png', 'https://drive.google.com/drive/folders/1DbteAekdYtFGKdA3fOUWlKyRYEGunHHV?usp=sharing', '', 'https://api.informatics-expo.id/Budaya Gotong Royong.png', 747, 17, 3, '2022-07-30 21:22:31', '2022-07-30 21:22:31'),
(488, 'S.A.T.A', '{\"blocks\":[{\"key\":\"16o5b\",\"text\":\"S.A.T.A (System Aplication Technology Agricultural) merupakan aplikasi sistem informasi yang berperan sebagai penyalur informasi terkait pertanian di domisili yogyakarta. namun untuk saat ini SATA hanya berfokus di bagian pupuk pertanian saja. tetapi jangan khawatir SATA dapat di kembangkan menjadi mencakup seluruh kebutuhan dan perkembangan di sektor pertanian. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d63bo\",\"text\":\"Berikut Fitur yang terdapat pada S.A.T.A :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8n5m\",\"text\":\"Dashboard yang memperlihatkan informasi berbentuk chart yang menunjukkan perkembangan dari data atau informasi terkait pupuk di domisili yogayakarta\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6a78b\",\"text\":\"Tampilan halaman yang memperlihatkan list data dari beberapa jenis pupuk yang terdaftar di server S.A.T.A\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6jsg1\",\"text\":\"Dan fitur bagi user yang mendaftar sebagai distributor yang dapat menginput atau meng update data yang akan ditampilkan di website S.A.T.A\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'sata-22.jpg', 'https://youtu.be/rfZZpOTBryc', 'https://sata-psi.000webhostapp.com/', 'https://api.informatics-expo.id/sata-22.jpg', 721, 9, 3, '2022-07-30 21:24:56', '2022-07-30 21:24:56'),
(489, 'INPUS', '{\"blocks\":[{\"key\":\"aflfe\",\"text\":\"INPUS adalah suatu sistem perangkat lunak untuk menginformasikan suatu program yang ada di sebuah masjid tertentu mencakup pada kepengurusan keanggotaan dan kegiatan yang dilakukan pada masjid secara terstruktur dan juga terdapat beberapa jadwal puasa serta waktu berbuka maupun imsak’ dan donasi uang atau takjil pada daerah tertentu serta terdapat fitur yang mencatat kegiatan masjid.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":386,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":386,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":386,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":386,\"style\":\"fontfamily-Arial\"},{\"offset\":0,\"length\":386,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":386,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'INPUS.png', '', 'https://www.figma.com/file/HKpr3Uwi4sVKYw3cneKIKk/Untitled?node-id=0%3A1', 'https://api.informatics-expo.id/INPUS.png', 753, 8, 3, '2022-07-30 21:54:27', '2022-07-30 21:58:27'),
(490, 'HIDRASEE', '{\"blocks\":[{\"key\":\"4mmrh\",\"text\":\"HIDRASEE is a web application that provides user with water product deliveries, taking inspiration from Gojek and Grab. Users can select their current or preferred location and the system will provide you with the high rated, trusted water depots nearby. Users will have the ability to add and select their product of choice, which can be delivered either via store\'s driver or self pickup.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":390,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":390,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":390,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"2bs4h\",\"text\":\"HIDRASEE will help Indonesian citizens with easy access of water and hydration, with a single touch of application.  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":115,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":115,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":115,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":115,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":115,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}}],\"entityMap\":{}}', 'HIDRASEE.png', 'https://youtu.be/SI2yjWArGPU', 'https://www.figma.com/file/x4PlqsYGW7vaUi3dXUGowM/Desktop-Hidrasee?node-id=61%3A49', 'https://api.informatics-expo.id/HIDRASEE.png', 754, 6, 3, '2022-07-30 21:59:28', '2022-07-30 21:59:28'),
(491, 'How\'s Life', '{\"blocks\":[{\"key\":\"bca8t\",\"text\":\"How\'s Life, a mental health system made for you.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"en1sg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"438ng\",\"text\":\"Connects you with your health counselor, now with a tap from your finger.\\nHelps your counselor assess your conditions gradually to make better decision.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f3onn\",\"text\":\"How’s Life presented in 3 forms\\nPatient’s App, a mobile app\\nCounselor’s App, also a mobile app\\nCampus Health System App, a web app\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e5gqb\",\"text\":\"*To use in integration with your campus’ health consultation system*\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'How\'s Life.png', 'https://youtube.com', 'https://lynk.id/howslife', 'https://api.informatics-expo.id/How\'s Life.png', 581, 18, 3, '2022-07-30 22:14:46', '2022-07-30 22:14:46'),
(492, 'Kebudayaan di Yogyakarta', '{\"blocks\":[{\"key\":\"4rudn\",\"text\":\"Ada apa aja sih di Yogyakarta?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1397d\",\"text\":\"Kali ini,  bersama Mas Tejo dan Mbak Dita, kita akan berkeliling Yogyakarta sembari belajar mengenai kebudayaan di Yogyakarta. Kira-kira ada apa aja yaa?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"63mv5\",\"text\":\"Yuk, langsung kita tonton!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Kebudayaan di Yogyakarta.png', 'https://youtu.be/u9D99M7-Emc', '', 'https://api.informatics-expo.id/Kebudayaan di Yogyakarta.png', 755, 4, 3, '2022-07-30 22:31:19', '2022-07-30 22:31:19'),
(493, 'Menjelajah Samudra', '{\"blocks\":[{\"key\":\"blf0j\",\"text\":\"Mengambil tema budaya dari sebuah lagu ciptaan ibu Sud pada 1940 yang berjudul \\\"nenek moyangku seorang pelaut\\\" mengandung nilai-nilai pesan moral dan mengekspresikan bahwa bangsa kita adalah bangsa yang terbiasa mengarungi samudera, lautan yang luas, dan menjelajahi bermacam-macam pulau. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":244,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":245,\"length\":43,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Menjelajah Samudra.png', 'https://youtu.be/-Lxa92Z20Ks', '', 'https://api.informatics-expo.id/Menjelajah Samudra.png', 760, 14, 3, '2022-07-30 22:48:31', '2022-07-30 22:48:31'),
(494, 'MIBOOK', '{\"blocks\":[{\"key\":\"bsqc9\",\"text\":\"Layanan Peminjaman Buku (MiBook) adalah suatu sistem perangkat lunak yang dirancang untuk mengelola data perpustakaan dalam skala kecil termasuk pinjam-kembali buku. Layanan MiBook juga dapat menerima buku-buku yang ingin disumbangkan. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":235,\"style\":\"color-rgb(0,0,0)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MIBOOK.png', 'https://youtu.be/gpq8vGlSHu0', '', 'https://api.informatics-expo.id/MIBOOK.png', 567, 4, 3, '2022-07-30 22:50:26', '2022-07-30 22:51:57'),
(495, 'Malin Kundang The West Sumatran Folktales', '{\"blocks\":[{\"key\":\"1u863\",\"text\":\"Malin Kundang The West Sumatran Folktales\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":41,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d52ei\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cpa32\",\"text\":\"Sebuah karya sederhana dari kelompok kami mengenai Animasi yang mengangkat kisah rakyat Sumatra Barat yang melegenda,  yakni Malin Kundang. Animasi ini, keseluruhannya dibuat menggunakan software processing. Selamat Menyaksikan !\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5jlju\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2mmnl\",\"text\":\"PS : Jangan lupa like video dan vote karya kami : ) \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang The West Sumatran Folktales.jpeg', 'https://youtu.be/6gqhtae5DrQ', '', 'https://api.informatics-expo.id/Malin Kundang The West Sumatran Folktales.jpeg', 742, 4, 3, '2022-07-30 23:09:14', '2022-07-31 01:16:28'),
(496, 'sangkuriang', '{\"blocks\":[{\"key\":\"61er9\",\"text\":\"Grafika dan Multimedia\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'sangkuriang.png', 'https://youtu.be/F9zL626gDMA', '', 'https://api.informatics-expo.id/sangkuriang.png', 764, 4, 3, '2022-07-30 23:13:24', '2022-07-30 23:13:24'),
(497, '1000 Candi Dalam Semalam', '{\"blocks\":[{\"key\":\"7ont3\",\"text\":\"Roro x Bandung\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', '1001 Candi Dalam Semalam.png', 'https://youtu.be/J4Hk3eL9vBc', 'https://github.com/gabriel-tama/tubes_gmm', 'https://api.informatics-expo.id/1001 Candi Dalam Semalam.png', 733, 4, 3, '2022-07-30 23:16:55', '2022-07-30 23:19:26'),
(498, 'Silap', '{\"blocks\":[{\"key\":\"7tm1f\",\"text\":\"Sistem layanan puskesmas (SILAP) merupakan sebuah aplikasi yang dapat memudahkan pasien untuk mengakses layanan puskesmas dengan skala kecil, khususnya pada layanan informasi, lokasi terdekat dan konsultasi.\\n\\nFitur SILAP: \\n1. Statistik penyakit yang sedang ramai di Indonesia\\n2. Pendaftaran pasien puskesmas\\n3. Konsultasi dengan dokter atau bidan\\n4. Lokasi puskesmas terdekat\\n5. Lihat jadwal kegiatan puskesmas\\n6. Lihat berita seputar puskesmas dan kesehatan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Silap.png', 'https://youtu.be/GYkMV6GOMl4', 'https://www.canva.com/design/DAFH4ZyO6CI/bj1Z-Eo_tyi3XP_Wi4XJeA/edit?utm_content=DAFH4ZyO6CI&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton', 'https://api.informatics-expo.id/Silap.png', 761, 18, 3, '2022-07-30 23:23:12', '2022-07-30 23:23:12'),
(499, 'Malin Kundang Reborn', '{\"blocks\":[{\"key\":\"etku9\",\"text\":\"Animasi ini diangkat dari Cerita Malin Kundang yang merupakan cerita yang berasal dari provinsi Sumatera Barat, Indonesia. Legenda ini menceritakan tentang seorang anak yang durhaka pada ibunya dan oleh sebab itu dia dikutuk menjadi batu oleh ibunya sendiri.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":258,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":258,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":258,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":258,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"7h43o\",\"text\":\"Malin Kundang termasuk anak yang rajin dan suka membantu orang tuanya. Ketika ayahnya pergi dan tidak kembali lagi, dia ingin membantu ibunya dengan merantau untuk mencari harta yang banyak.\\nKetika Malin Kundang sudah sukses dan memiliki istri yang cantik, dia kembali ke desanya. Sayangnya ketika ibunya memeluknya, dia tidak mengakui ibunya. Karena durhaka, Malin Kundang dikutuk oleh ibunya menjadi batu. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":190,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":191,\"length\":216,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":190,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":191,\"length\":216,\"style\":\"bgcolor-rgb(255,255,255)\"},{\"offset\":0,\"length\":190,\"style\":\"fontsize-18\"},{\"offset\":191,\"length\":216,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":190,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"},{\"offset\":191,\"length\":216,\"style\":\"fontfamily-ProximaNova, Helvetica, Arial, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Malin Kundang Reborn.png', 'https://youtu.be/hbON1ZYx0Yk', '', 'https://api.informatics-expo.id/Malin Kundang Reborn.png', 758, 16, 3, '2022-07-30 23:29:38', '2022-07-30 23:29:38'),
(501, 'AssistMe', '{\"blocks\":[{\"key\":\"a0agl\",\"text\":\"AssistMe adalah aplikasi panggilan darurat yang dapat dipakai dengan mudah bagi masyarakat umum ketika berada dikondisi gawat darurat. Aplikasi ini merespon dengan cepat tanggap untuk berbagai situasi gawat darurat misalnya terjadi pencurian, pembegalan, kerusuhan, kecelakaan, kebakaran, penanganan medis darurat hingga bencana alam.  Di dalam aplikasi AsssistMe terdapat fitur-fitur seperti No.Darurat, Daerah Rawan, Laporan, Berita dan fitur utama aplikasi ini yaitu One Tap Button. Diharapkan dengan fitur-fitur tersebut akan membantu masyarakat umum untuk tidak  perlu lagi merasa khawatir dalam menjalankan rutinitas sehari-hari.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'AssistMe.jpeg', 'https://youtu.be/JlJtTAyX6x8', 'https://www.figma.com/proto/elT6utfPoDpsq92PcD6OP7/AssistMe?node-id=15%3A10&scaling=scale-down&page-id=0%3A1&starting-point-node-id=15%3A10&show-proto-sidebar=1', 'https://api.informatics-expo.id/AssistMe.jpeg', 697, 16, 3, '2022-07-30 23:37:48', '2022-07-30 23:38:30'),
(502, 'MyFinport', '{\"blocks\":[{\"key\":\"4f98h\",\"text\":\"Aplikas MyFinport merupakan aplikasi pengelolaan keuangan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MyFinport.jpeg', 'https://www.youtube.com/watch?v=nDN4_09myxM', 'https://github.com/raihanph21/PSI-Tubes-Kelompok-3', 'https://api.informatics-expo.id/MyFinport.jpeg', 770, 9, 3, '2022-07-30 23:39:46', '2022-07-30 23:40:40'),
(503, 'Pulang Kampung', '{\"blocks\":[{\"key\":\"seff\",\"text\":\"Menceritakan seorang perantau yang akhirnya pulang ke kampung halamannya di Yogyakarta. Melihat indahnya kampung halaman ditambah megahnya rumah adat sebagai tanda keaslian suku dan budaya \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":188,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":188,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":188,\"style\":\"fontfamily-Montserrat, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pulang Kampung.jpeg', 'https://youtu.be/UBluw_V2hBc', '', 'https://api.informatics-expo.id/Pulang Kampung.jpeg', 766, 17, 3, '2022-07-30 23:41:42', '2022-07-30 23:41:42'),
(504, 'Tale of Danau Toba', '{\"blocks\":[{\"key\":\"ar01c\",\"text\":\"Indonesia terkenal akan legendanya di berbagai daerah. Banyak kisah yang unik dan menarik dari legenda tersebut, salah satu legenda yang terkenal adalah Danau Toba. Danau toba adalah sebuah danau yang terletak di Sumatera Utara yang konon kisahnya lahir dari sebuah kisah penghianatan janji Toba kepada istrinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7oc9r\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dvq9a\",\"text\":\"Lalu, bagaimanakah seorang gadis kecil Anya mengupas legenda Danau Toba ini? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"80ul8\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4sb9g\",\"text\":\"Mari kita ikuti kisah Anya dalam mengupas legenda Danau Toba\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Tale of Danau Toba.png', 'https://youtu.be/l3f7SRF0qrw', '', 'https://api.informatics-expo.id/Tale of Danau Toba.png', 765, 2, 3, '2022-07-30 23:50:49', '2022-07-30 23:50:49'),
(505, 'PEMKER', '{\"blocks\":[{\"key\":\"679td\",\"text\":\"PEMKER merupakan aplikasi yang digunakan unruk melakukan pemungutan suara secara online (e-voting). Dengan adanya PEMKER, pemungutan suara menjadi lebih efisien dan hemat kertas.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PEMKER.jpeg', 'https://youtu.be/5kwh5CmjqIY', 'https://drive.google.com/file/d/15rNEQp5ABP84d-h5ogP5cOOHJnbGJS7z/view?usp=sharing', 'https://api.informatics-expo.id/PEMKER.jpeg', 767, 9, 3, '2022-07-30 23:51:24', '2022-07-31 00:01:59'),
(506, 'Mstore', '{\"blocks\":[{\"key\":\"5kni\",\"text\":\"M-Store adalah sebuah sistem yang dikembangkan untuk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"frv01\",\"text\":\"mendukung penuh proses jual beli produk merchendise yang terjadi di sebuah \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1qbj9\",\"text\":\"perusahaan. M-Store sendiri merupakan sebuah sistem yang dikembangkan\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9ad72\",\"text\":\"dengan memanfaatkan platform browser sebagai media aksesnya, \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"blog2\",\"text\":\"Dengan dikembangkannya sistem M-Store ini, kami berharap agar \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3mj0i\",\"text\":\"perusahaan kami mampu lebih dekat dan lebih banyak lagi\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"nduv\",\"text\":\"dalam menjangkau pelanggan. Sistem M-Store dikembangkan \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"52qok\",\"text\":\"dalam dua bentuk, pertama, sistem dashboard admin yang \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ee151\",\"text\":\"dibangun dengan tujuan untuk membantu para eksekutif dalam \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bfah\",\"text\":\"menentukan suatu kebijakan/keputusan tertentu yang berkaitan dengan perusahaan, dimana\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"616k3\",\"text\":\"dashboard admin ini akan menampilkan visualisasi data dari seluruh data\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"erctn\",\"text\":\"yang dimiliki oleh perusahaan baik yang berhubungan dengan penjualan,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2gtdv\",\"text\":\"keuangan, pelanggan, maupun produk. Kemudian, untuk sistem yang kedua ialah\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3n7nb\",\"text\":\"official website, sistem ini dikembangkan agar pelanggan mampu lebih\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"frdav\",\"text\":\"dekat dengan perusahaan, dimana mereka dapat mengetahui berbagai hal yang\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9dt\",\"text\":\"berkaitan dengan perusahaan hanya dengan mengunjungi official website,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7sqd5\",\"text\":\"melalui sistem ini pelanggan akan lebih mudah dalam mencari tahu \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3e8pc\",\"text\":\"tentang produk-produk merchendise apa saja yang diperjualbelikan oleh perusahaan,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"febhl\",\"text\":\"selain itu, melalui sistem ini juga pelanggan dapat melakukan pemesanan produk\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6366p\",\"text\":\"dengan lebih efisien tanpa perlu datang ke official store dari perusahaan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Mstore.jpeg', 'https://youtu.be/ZTapbwiBJbo', 'https://github.com/Devanoz/mstore-core-ui', 'https://api.informatics-expo.id/Mstore.jpeg', 769, 9, 3, '2022-07-30 23:58:06', '2022-07-30 23:58:06');
