(507, 'I kost', '{\"blocks\":[{\"key\":\"aaoqn\",\"text\":\"Assalamualaikum, \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":17,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":17,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":17,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"evrlj\",\"text\":\"Hallo teman-teman kesulitan mencari kost dengan kualitas yang baik? Tenang kami punya solusi memberikan rekomendasi dan berusaha menampilkan informasi-informasi dengan tepat dan objectif. yang pastinya dengan tampilan grafik sesuai dengan penggunaan yang semakin memudahkan pengguna khususnya bagi mahasiswa mencari kost. Mencari kost sesuai dengan budget: ingin mencari kost yang cocok dengan budget yang dimilikinya. User akan ditujukan pada kolom pencarian disana akan ada filter berdasarkan rentang harga. Tentunya ini akan semakin memudahkan pencarian kost berdasarkan keinginan pengguna.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":593,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":593,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":593,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":593,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":593,\"style\":\"fontfamily-inherit\"},{\"offset\":6,\"length\":61,\"style\":\"BOLD\"},{\"offset\":93,\"length\":22,\"style\":\"BOLD\"},{\"offset\":121,\"length\":66,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"0px\"}},{\"key\":\"aj4ob\",\"text\":\"\\n Salam,\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'I kost.png', 'https://www.youtube.com/watch?v=VzQM4DtOVSQ', 'https://www.figma.com/proto/nVgDmT8rcJYHpEZsvWHNFY/Pengembangan-sistem-informasi?node-id=1%3A72&scaling=min-zoom&page-id=0%3A1&starting-point-node-id=1%3A72&show-proto-sidebar=1', 'https://api.informatics-expo.id/I kost.png', 771, 9, 3, '2022-07-31 06:51:45', '2022-07-31 06:51:45'),
(508, 'MyDesa', '{\"blocks\":[{\"key\":\"au4be\",\"text\":\"Pada era modern abad ke 21, masih terdapat banyak permasalahan yang beredar di masyarakat, salah satunya lamanya pengantrian untuk pengurusan administrasi desa selain karena itu terdapat human error yang dapat menyebabkan kesalahan pengisian dan pemeriksaan form administrasi, disitu kami kelompok Domingo datang membawa solusi yaitu MyDesa merupakan sebuah aplikasi yang bertujuan untuk mempermudah pelayanan administrasi desa, aplikasi ini dibuat untuk memecahkan masalah dan mempermudah kedua belah pihak pengguna yaitu masyarakat dan aparat desa.\\n \\nFitur-fitur yang ada di aplikasi kami yaitu:\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":550,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":553,\"length\":44,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":550,\"style\":\"bgcolor-transparent\"},{\"offset\":553,\"length\":44,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":550,\"style\":\"fontsize-28pt\"},{\"offset\":553,\"length\":44,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":550,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":553,\"length\":44,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":553,\"length\":44,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"649ef\",\"text\":\"Pendataan(Masyarakat)   \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":22,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":22,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":22,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":22,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":0,\"length\":24,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"6vlkn\",\"text\":\"pada fitur ini kita dapat memilih form pelayanan administrasi yang ingin kita lakukan.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":86,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":86,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":86,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":86,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"7al7q\",\"text\":\"Chat(Masyarakat dan Aparat Desa) \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":32,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":32,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":32,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":32,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":0,\"length\":33,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"8rvh9\",\"text\":\"fitur ini digunakan apabila Masyarakat memiliki pertanyaan seputar pelayanan administrasi desa, maka pihak masyarakat dan aparat desa bisa berkomunikasi secara mudah langsung dari aplikasi.\\n \\nResi(Masyarakat)    \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":189,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":192,\"length\":17,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":189,\"style\":\"bgcolor-transparent\"},{\"offset\":192,\"length\":17,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":189,\"style\":\"fontsize-28pt\"},{\"offset\":192,\"length\":17,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":189,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":192,\"length\":17,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":192,\"length\":20,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"e3p1l\",\"text\":\"merupakan fitur yang bertujuan untuk memperjelas alur administrasi dengan menyediakan status pendataan yang kita lakukan, apakah sudah diterima apa ditolak serta tanggal pengambilan dokumen hard copy pada kantor desa.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":217,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":217,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":217,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":217,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"807u4\",\"text\":\"Dokumen(Masyarakat dan Aparat Desa) \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":36,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":36,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":36,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":36,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":0,\"length\":36,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"2dis2\",\"text\":\"Sebuah fitur yang tujuannya untuk memudahkan masyarakat dan aparat desa untuk mencari dokumen terkait pelayanan desa.\\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":117,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":117,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":117,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":117,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"b6c0m\",\"text\":\"Print \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":6,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":6,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":6,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":6,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"},{\"offset\":0,\"length\":6,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}},{\"key\":\"riud\",\"text\":\"Fitur tambahan untuk memperlengkap fitur Pendataan dan Dokumen, bertujuan untuk pengguna yang perlu dokumen/form hard copy pelayanan desa, dengan memperbolehkan user untuk print dokumen dan form pendataan.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":205,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":205,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":205,\"style\":\"fontsize-28pt\"},{\"offset\":0,\"length\":205,\"style\":\"fontfamily-Source Sans Pro\\\", sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"14pt\"}}],\"entityMap\":{}}', 'MyDesa.jpeg', 'https://www.youtube.com/watch?v=ahfVnvlLoQQ&t=3s', 'https://github.com/just-a-star/MyDesa', 'https://api.informatics-expo.id/MyDesa.jpeg', 774, 8, 3, '2022-07-31 14:41:10', '2022-07-31 14:53:26'),
(509, 'MALIN KUNDANG', '{\"blocks\":[{\"key\":\"7u1vp\",\"text\":\"Kisah Malin kundang di kemas dengan modern.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'MALIN KUNDANG.png', 'https://youtu.be/PXd3dIXDLSc', '', 'https://api.informatics-expo.id/MALIN KUNDANG.png', 633, 2, 3, '2022-07-31 14:48:16', '2022-07-31 14:48:16'),
(510, 'SIMKO', '{\"blocks\":[{\"key\":\"ehg7b\",\"text\":\"Sistem Informasi Manajemen Keuangan Organisasi (SIMKO) adalah suatu sistem perangkat lunak untuk pengelolaan data keuangan skala kecil, seperti BUMDES yang memerlukan sistem manajemen keuangan organisasinya ; khususnya pada laporan transaksi pendapatan dan pengeluaran keuangan BUMDES. SIMKO dapat melakukan pencatatan pemasukan dan pengeluaran keuangan, pencatatan data keanggotaan, dan rekap laporan keuangan yang berisi  riwayat-riwayat transaksi dan grafik keuangan dalam kurun waktu tertentu. Data dalam SIMKO hanya dapat diedit oleh pengurus organisasi sedangkan anggota hanya dapat melihatnya saja. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":606,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":606,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":606,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":606,\"style\":\"fontfamily-Times New Roman\"},{\"offset\":0,\"length\":46,\"style\":\"ITALIC\"},{\"offset\":0,\"length\":54,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"36pt\"}},{\"key\":\"5pm3\",\"text\":\"SIMKO dimaksudkan untuk mengatasi permasalahan transparansi keuangan dalam organisasi BUMDES. Dalam hal manajemen keuangan, kecurigaan pencatatan keuangan, kesalahan pencatatan keuangan, dan hilangnya buku keuangan biasa terjadi dalam organisasi. Oleh karena itu dengan SIMKO, diharapkan pencatatan keuangan menjadi lebih efektif, efisien, dan lebih transparan sehingga tidak ada lagi kecurigaan pengelolaan keuangan dalam organisasi.\\n \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":434,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":434,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":434,\"style\":\"fontsize-12pt\"},{\"offset\":0,\"length\":434,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"36pt\"}}],\"entityMap\":{}}', 'SIMKO.png', 'https://youtu.be/gjmObhWHQvM', 'https://github.com/iloveu831/SIMKO', 'https://api.informatics-expo.id/SIMKO.png', 775, 8, 3, '2022-07-31 15:23:41', '2022-08-01 22:06:33'),
(511, 'Restaurant Monitoring System', '{\"blocks\":[{\"key\":\"2jog7\",\"text\":\"Sistem monitoring yang dapat memantau besaran penjualan tiap menu, segala transaksi seperti pemasukan dan pengeluaran yang nantinya akan menjadi keluaran dalam bentuk dashboard \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":176,\"style\":\"color-rgb(89,89,89)\"},{\"offset\":0,\"length\":176,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":176,\"style\":\"fontsize-13pt\"},{\"offset\":0,\"length\":176,\"style\":\"fontfamily-Lato, sans-serif\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Restaurant Monitoring System.png', 'https://youtu.be/mBc5KxNYx20', '', 'https://api.informatics-expo.id/Restaurant Monitoring System.png', 777, 12, 3, '2022-07-31 21:16:07', '2022-07-31 21:17:42'),
(513, 'Nobelesse', '{\"blocks\":[{\"key\":\"5vekh\",\"text\":\"Noblesse adalah aplikasi berbasis SCM (Supply Chain Management) yang berguna untuk mengontrol stok barang, merating barang, memastikan barang terjual tepat sasaran dan memastikan barang samapi dengan aman hingga ke tangan pelanggan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'noblesse.jpg', 'https://youtu.be/JTXHmAqu_YI', 'https://www.figma.com/proto/1xGk6GxFLR6fQtvIDEdgUX/NOBLESSE-(Real)?node-id=204%3A2880&scaling=scale-down-width&page-id=0%3A1&starting-point-node-id=204%3A3395', 'https://api.informatics-expo.id/noblesse.jpg', 790, 9, 3, '2022-08-01 20:38:08', '2022-08-01 20:38:16'),
(515, 'Traspick', '{\"blocks\":[{\"key\":\"5s7la\",\"text\":\"The formation of this application can help a lot of people who have problem with their household trash management, also the efficiency in terms of time. Customer just order when they want their trash to be picked up by the garbage collector. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":241,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":241,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":241,\"style\":\"fontsize-18\"},{\"offset\":0,\"length\":241,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"2mo4k\",\"text\":\"Goals :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":7,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":7,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":7,\"style\":\"color-rgb(26,26,26)\"},{\"offset\":0,\"length\":7,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":7,\"style\":\"fontfamily-Raleway, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"62r87\",\"text\":\"Provides an easier method of disposing of household waste\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":57,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":57,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":57,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":57,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":57,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":57,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":57,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"ajd00\",\"text\":\"Ensure customers satisfaction with the applications and services provided\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":73,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":73,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":73,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":73,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":73,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":73,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":73,\"style\":\"fontfamily-Calibri, sans-serif\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"2809a\",\"text\":\"Feature :\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":9,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":9,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":9,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":9,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":9,\"style\":\"fontfamily-inherit\"},{\"offset\":0,\"length\":9,\"style\":\"color-rgb(26,26,26)\"},{\"offset\":0,\"length\":9,\"style\":\"fontfamily-Raleway, sans-serif\"}],\"entityRanges\":[],\"data\":{\"text-align\":\"start\"}},{\"key\":\"4gvrc\",\"text\":\"Pick up Trash\",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":13,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":13,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":13,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}},{\"key\":\"aampn\",\"text\":\"Secured Transaction  \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":20,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-16\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-Montserrat, sans-serif\"},{\"offset\":0,\"length\":20,\"style\":\"fontsize-inherit\"},{\"offset\":0,\"length\":20,\"style\":\"fontfamily-inherit\"}],\"entityRanges\":[],\"data\":{\"margin-left\":\"1.5em\"}}],\"entityMap\":{}}', 'Traspick.jpeg', 'https://youtu.be/Yg-YYPVxK-E', 'https://github.com/helggaa/Expo.git', 'https://api.informatics-expo.id/Traspick.jpeg', 826, 9, 4, '2023-01-12 21:28:44', '2023-01-12 21:28:44'),
(516, 'testing', '{\"blocks\":[{\"key\":\"9irdi\",\"text\":\"gjgh\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'testing.jpeg', '', '', 'https://api.informatics-expo.id/testing.jpeg', 822, 2, 4, '2023-01-12 21:34:44', '2023-01-12 21:34:44'),
(517, 'YouthCare', '{\"blocks\":[{\"key\":\"8t10l\",\"text\":\"YouthCare is an educational application where users can listen to educational podcast about mental and physical health, we also provide a platform where you can donate to the unfortunate peopel who need medical support, lastly we have a feature where you can buy medicine and get it deliver directly to your door. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bu14a\",\"text\":\"Our main goal is to improve the knowledge about health to the people aroud us as well as improving the health level for people around us.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'YouthCare.jpeg', '', 'https://github.com/itsjihansyah/youthcare_rev', 'https://api.informatics-expo.id/YouthCare.jpeg', 806, 3, 4, '2023-01-12 21:55:47', '2023-01-12 21:55:47'),
(518, 'Omlet Clothing', '{\"blocks\":[{\"key\":\"eaklt\",\"text\":\"Omlet clothing adalah sebuah website yang berfungsi untuk memesan dan memproduksi kaos oblong, kaos polo, dan pdl. Omlet clothing mempunyai fitur utama yaitu pemesanan dan pembelian.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":182,\"style\":\"color-rgb(19,47,74)\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Omlet Clothing.png', '', 'https://github.com/Alifianf/omlet', 'https://api.informatics-expo.id/Omlet Clothing.png', 828, 12, 4, '2023-01-12 22:07:23', '2023-01-13 11:37:55'),
(519, 'Food Kita', '{\"blocks\":[{\"key\":\"ecth0\",\"text\":\"Food Kita merupakan sebuah aplikasi yang dapat mempermudah kantin dalam melakukan penjualan produk berupa makanan, minuman, Snack, dan buah-buahan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"26not\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Food Kita.jpeg', '', 'https://github.com/Abigailoby/venilex', 'https://api.informatics-expo.id/Food Kita.jpeg', 819, 2, 4, '2023-01-12 22:37:04', '2023-01-13 13:29:24'),
(520, 'Pajaku', '{\"blocks\":[{\"key\":\"fi8t2\",\"text\":\"Starting from the majority of people who have difficulty paying taxes in indonesia, we created an application that can make it easier for citizens to pay taxes. Pajaku can make it easier for citizens to remind and pay taxes. This system is expected to help the government to more easily control texes. This makes it easier for users to avoid a very complicated process. With this we take the initiative to help the government so that citizen always pay taxes on time.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":467,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":467,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":467,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":467,\"style\":\"fontfamily-Times New Roman\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Pajaku.png', '', '', 'https://api.informatics-expo.id/Pajaku.png', 830, 8, 4, '2023-01-12 23:56:43', '2023-01-12 23:56:43'),
(521, 'Volfund', '{\"blocks\":[{\"key\":\"rlm7\",\"text\":\"Volfund, created by Nostress!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dh6hm\",\"text\":\"\\\"Volfund is an application that is created as a solution to people that want to help their community by providing necessary items. We Nostress is aiming to make volfund big enough to serve nationally in Indonesia!\\\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Volfund.png', '', 'https://github.com/gitogit18/webdev_nostress.git', 'https://api.informatics-expo.id/Volfund.png', 807, 11, 4, '2023-01-13 00:09:04', '2023-01-13 00:09:04'),
(522, 'eBox ', '{\"blocks\":[{\"key\":\"6bbmv\",\"text\":\"eBox adalah aplikasi berbasis web yang bergerak di bidang online untuk mempermudah manajemen stok gudang. eBox menyediakan jasa terpadu bagi business e-commerce dan UKM untuk pengelolan stok gudang dengan menyewakan gudang yang dapat digunakan dan penyimpanan barang. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":268,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":268,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":268,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":268,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2cip\",\"text\":\"Dengan menggunakan eBox pengguna dapat mengakses dan mengelola lebih dari satu gudang yang di miliki. \\n\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":102,\"style\":\"color-rgb(0,0,0)\"},{\"offset\":0,\"length\":102,\"style\":\"bgcolor-transparent\"},{\"offset\":0,\"length\":102,\"style\":\"fontsize-11pt\"},{\"offset\":0,\"length\":102,\"style\":\"fontfamily-Arial\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'eBox .jpeg', 'https://youtu.be/EX1clRgTEGI', 'https://github.com/tanziilaag/eboxValyou.git', 'https://api.informatics-expo.id/eBox .jpeg', 831, 9, 4, '2023-01-13 10:55:01', '2023-01-13 10:55:01'),
(523, 'BETTR', '{\"blocks\":[{\"key\":\"6mg1c\",\"text\":\"BETTR adalah sebuah aplikasi berbasis web yang memungkinkan anda sebagai kreator untuk mencari dan mempublikasikan karya seni visual. Dengan tujuan untuk menambah motivasi para artis seni visual lokal, BETTR menawarkan tempat yang nyaman bagi mereka untuk menaikan reputasi mereka sampai bisa berkolaborasi dengan artis luar negeri seperti musisi, pelukis, film director, merk dagang, dan lain-lain. BETTR akan memberikan beberapa bentuk karya seni visual seperti Digital Art, Lukisan, dan Video Content yang mana masing-masing bentuk dari karya seni visual tersebut tidak hanya ditarwarkan kepada para penggiat karya seni visual tetapi kepada khalayak umum juga.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'BETTR.png', 'https://youtu.be/HISK8jSRht0', 'https://github.com/bwahyuh/Bettr-VisualArtMarket', 'https://api.informatics-expo.id/BETTR.png', 825, 11, 4, '2023-01-13 12:04:59', '2023-01-13 12:04:59'),
(524, 'Helpdesk', '{\"blocks\":[{\"key\":\"64f8s\",\"text\":\"Helpdesk merupakan sebuah aplikasi berbasis website yang melayani keluhan dari pelanggan serta memberikan solusi ke pelanggan atas permasalahan yang dihadapinya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"blisu\",\"text\":\"Helpdesk menawarkan fitur ticketing. Fitur tiketing ini adalah sebuah fitur dimana pelanggan akan membuat tiket yang berisi keluhan yang mereka ingin sampaikan. Setelah tiket dibuat, tiket akan dikirim dan diterima oleh staff customer service. Respon tiket akan dikirimkan ke pelanggan setelah staff customer service telah menemukan solusi dari permasalahan yang dikirim sebelumnya. Aplikasi helpdesk juga menautkan nomor telepon jika fitur ticketing sedang bermasalah atau pelanggan lebih memilih menggunakan telepon.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'Helpdesk.jpeg', '', 'https://drive.google.com/file/d/12JDfhMHvKyLmb2DOUvCDCVW-T6RYVY3M/view?usp=share_link', 'https://api.informatics-expo.id/Helpdesk.jpeg', 820, 8, 4, '2023-01-13 12:49:42', '2023-01-13 13:25:29'),
(525, 'PortalBuku', '{\"blocks\":[{\"key\":\"c0ptg\",\"text\":\"Portal buku adalah website dimana kalian bisa mendonasikan, menyewa dan meminta buku untuk para pelajar. Potal Buku.id terinspirasi dari kurangnya inisiatif pelajar untuk mencari atau membaca buku ke perpustakaan dan banyaknya pelajar yang membutuhkan buku tetapi tidak mempunyai cukup uang untuk membeli ataupun menyewa buku. Portal buku merupakan website yang tujuannya yaitu seseorang bisa mendonasikan buku-buku yang tidak dibutuhkan untuk orang-orang yang membutuhkan, memudahkan pelajar dalam mencari dan menyewa buku yang dibutuhkan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'PortalBuku.jpeg', '', 'https://github.com/just-a-star/PortalBuku-4One', 'https://api.informatics-expo.id/PortalBuku.jpeg', 829, 4, 4, '2023-01-13 13:47:08', '2023-01-13 13:47:08'),
(526, 'UII Student Employment', '{\"blocks\":[{\"key\":\"fo53i\",\"text\":\"UII Student Employment merupakan platform yang menyediakan ruang bagi mahasiswa untuk mencari/menemukan rekan kompetisi akademik. Selain itu, platform ini juga menjadi ruang lowongan kerja part-time/full time di lingkungan kampus bagi mahasiswa.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'UII Student Employment.jpeg', '', 'https://github.com/ilham-2001/unisi_pt', 'https://api.informatics-expo.id/UII Student Employment.jpeg', 836, 17, 4, '2023-01-13 18:25:01', '2023-01-13 18:25:01'),
(527, 'HIDRASEE', '{\"blocks\":[{\"key\":\"d1hnq\",\"text\":\"HIDRASEE is a web-based application where customers can find the nearest water depot to ease their need of hydration. Users will put their preferred location where then the system will track down the nearest, high-rated available depot for customers to rely & trust on for their needs of hydration.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"kf09\",\"text\":\"Users can also order products directly from our app. Water depots that have registered themselves & owns an account in HIDRASEE can sell their product within our app to ease customers in ordering their products. Orders can be delivered either by the depot\'s own delivery system (Depot Delivery) or by our HIDRASEE drivers (HIDRASEE Delivery). Users can also order and pick-up the orders on their own (Self Pick-up).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'HIDRASEE.png', '', 'https://hidrasee.my.id', 'https://api.informatics-expo.id/HIDRASEE.png', 833, 6, 4, '2023-01-14 23:42:18', '2023-01-14 23:42:18'),
(528, 'TRCHNESS', '{\"blocks\":[{\"key\":\"9ctsh\",\"text\":\"Trchness is a software system that eases the process of management of collecting and recycling trash. The system can display the nearest garbage collecting point.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"116nl\",\"text\":\"The trash management system is intended to reduce scattered waste and burned waste. The system also helps the community to manage its waste. The system will display information on how to manage waste.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'TRCHNESS.png', '', '', 'https://api.informatics-expo.id/TRCHNESS.png', 823, 13, 4, '2023-05-17 06:40:24', '2023-05-17 06:40:24'),
(529, 'testlagii', '{\"blocks\":[{\"key\":\"afasa\",\"text\":\"testlagii\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'testlagii.png', '', '', 'https://api.informatics-expo.id/testlagii.png', 839, 2, 4, '2023-06-24 00:00:13', '2023-06-24 00:00:13'),
(530, 'delta project hala', '{\"blocks\":[{\"key\":\"ega22\",\"text\":\"dfdsf\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":5,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}', 'delta project hala.png', '', '', 'https://expo-bucket.s3.amazonaws.com/delta project hala.png', 840, 2, 4, '2023-06-24 19:44:59', '2023-06-24 19:44:59');
